{"department_text": "Safety", "level": 1, "url": "http://www.amazon.com/b/ref=sd_allcat_ind_saf/177-2158649-1745262?ie=UTF8&node=318135011", "text": "Safety", "department_url": "http://www.amazon.com/b/ref=sd_allcat_ind_saf/177-2158649-1745262?ie=UTF8&node=318135011", "description_title": "Safety Supplies", "keyword_count": {"safety supplies": 3, "supplies": 4, "safety": 16}, "description_wc": 308, "description_text": "Safety supplies come in a variety of forms, including safety signs, personal protective equipment, and a wide array of other safety equipment. Safety supplies are used to mark an area, or to help protect persons from potentially hazardous conditions. Lock out tag out, sometimes referred to as lockout tagout (LO/TO), are safety procedures that use safety devices to help keep areas safe. Lock out tag out devices use color, warning labels or tags, and a physical barrier to temporarily prohibit machine operation or power activation, and reduce accidents, during maintenance or repair. Safety signs, or warning signs such as \u201cExit\u201d, \u201cDanger\u201d, or \u201cCaution\u201d, are used to display messaging and inform people of important circumstances. Personal protective equipment is anything from reflective chest coverings to hardhats, or Geiger counters & radiation detectors, used to detect the presence of ionizing radiation, to emergency response, first aid supplies, and eye wash units. Fire alarms and fire extinguishers are also used in safety. Additional safety products include: gloves, safety glasses, ear protection, hardhats, coveralls, fire-resistant clothing, rainwater & chemical splash apparel, and lab coats. Hazardous storage cabinets, and hazardous storage cans are safety equipment. Glove options include; cleanroom gloves, controlled environment gloves, cryogenic gloves, cut-resistant gloves, disposable gloves, and work gloves. Flags are a type of safety sign that come in a variety of colors, shapes, dimensions, and may have a magnetic, quick disconnect, or threaded hex base type. Flags can also come with reflective markings and lighting. Floor markers come in various types of adhesive tape, colors, markings (such as stripes, arrows, or words), and widths that can be used to mark an area. Safety mirrors are used as personal protective equipment. Safety supplies are used in construction sites, work sites, high-traffic areas, and in home applications. Safety equipment can meet various safety standards.", "parent_text": "Automotive, Industrial", "keyword_density": {"safety supplies": "2.0", "supplies": "1.3", "safety": "5.3"}, "department_id": 148},
