{"nr_products": "32314", "level": 0, "url": "http://www.amazon.com/s/ref=lp_3427287011_nr_p_n_date_1?rh=n%3A2350149011%2Cn%3A%212445993011%2Cn%3A3427287011%2Cp_n_date%3A2479572011&bbn=3427287011&ie=UTF8&qid=1394033540&rnid=2479567011", "text": "Last 90 days", "department_url": "http://www.amazon.com/b/ref=sd_allcat_fire_apps_games/177-2158649-1745262?ie=UTF8&node=3427287011", "description_wc": 0, "parent_url": "http://www.amazon.com/b/ref=sd_allcat_fire_apps_games/177-2158649-1745262?ie=UTF8&node=3427287011", "parent_text": "Apps & Games", "department_text": "Apps & Games", "department_id": 33},
{"department_text": "Tires & Wheels", "level": 1, "url": "http://www.amazon.com/b/ref=sd_allcat_wt/177-2158649-1745262?ie=UTF8&node=15706571", "text": "Tires & Wheels", "department_url": "http://www.amazon.com/b/ref=sd_allcat_wt/177-2158649-1745262?ie=UTF8&node=15706571", "description_title": "More about Tires, Rims, and Wheels", "keyword_count": {"tires": 11, "wheels": 4, "tires rims and wheels": 2, "tires rims": 3, "rims": 5}, "description_wc": 229, "description_text": "Amazon.com Automotive has a great selection of tires, rims, and wheels for your vehicle. Our wide selection of rims and tires allows any car enthusiast to quickly find and replace their current wheels, or improve their current vehicle. Our website allows customers to browse through a wide variety of tires, rims, or wheels based on need. For example, we have tires for trailers , commercial trucks , SUVs , RVs , and more. Our tire selection allows you to browse and find the correct products for whatever purpose. Our selection includes all-season tires , off-roading tires , performance tires , and more. We even have tires for motorcycles and ATVs . Our rims and tires don\u2019t come alone, either. Our pages have all the necessary tire accessories , wheel and rim accessories, and tire and wheel repair tools that you may need. This will allow you to purchase the necessary equipment to do tasks such as diagnose your wheel alignment and balancing. You can even find kits for rim and tire installation , so you can do it yourself and enhance your vehicle, whether it is a car, truck, or ATV, year round for every season. With Amazon.com\u2019s Part Finder tool you can find the perfect rim and tires that fit your vehicle. You can shop for tires, rims, and wheels confidently online at Amazon.com.", "parent_text": "Automotive, Industrial", "keyword_density": {"tires": "5.0", "wheels": "1.8", "tires rims and wheels": "3.7", "tires rims": "2.7", "rims": "2.3"}, "department_id": 143},
