{"department_text": "Motorcycle & Powersports", "level": 1, "url": "http://www.amazon.com/Motorcycle-ATV-Automotive/b/ref=sd_allcat_matv/177-2158649-1745262?ie=UTF8&node=346333011", "text": "Motorcycle & Powersports", "department_url": "http://www.amazon.com/Motorcycle-ATV-Automotive/b/ref=sd_allcat_matv/177-2158649-1745262?ie=UTF8&node=346333011", "description_title": "More about Motorcycle and Powersports Parts", "keyword_count": {"powersports parts": 5, "parts": 16, "motorcycle": 14}, "description_wc": 224, "description_text": "Amazon.com has a great selection of motorcycle parts and powersports parts. Find motorcycle parts for your bike\u2019s motor , body , braking system , or drive train . Discover replacement or performance exhaust systems , and replacement or upgraded lighting in our motorcycle parts selection. You can also find a wide variety of ATV and powersports parts, including replacement or performance items. Motorcycle helmets and protective gear are popular items. Flip-up, full face, open face and off-road motorcycle helmets are featured from the industry\u2019s top names. You can even find replacement shields for motorcycle helmets. Choose from a large selection of jackets, pants, gloves and jerseys for yourself and a friend, and choose many other new motorcycle parts and accessories to match your new gear. Need gift ideas or looking for bargains? There\u2019s a motorcycle parts gift guide and an outlet for motorcycle parts on the site. Battery chargers and helmets are very popular motorcycle parts gifts. We also host a wide selection of ATV and powersports parts that are easy to gift. Shop for motorcycle parts based on customer review, price, brand, or shipping option. You can also search by the best selling motorcycle parts and powersports parts. It\u2019s easy to find the right motorcycle parts when you shop for motorcycle parts and powersports parts on Amazon.com.", "parent_text": "Automotive, Industrial", "keyword_density": {"powersports parts": "4.6", "parts": "7.3", "motorcycle": "6.4"}, "department_id": 144},
