{"nr_products": "1952", "level": -1, "url": "http://www.amazon.com/s/ref=lp_3310316011_nr_n_7?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A317971011%2Cn%3A3310316011%2Cn%3A3310318011&bbn=3310316011&ie=UTF8&qid=1394033551&rnid=3310316011", "text": "Hand Dryers", "department_url": "http://www.amazon.com/b/ref=sd_allcat_ind_jan/177-2158649-1745262?ie=UTF8&node=317971011", "description_wc": 0, "parent_url": "http://www.amazon.com/s/ref=lp_317971011_nr_n_6?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A317971011%2Cn%3A3310316011&bbn=317971011&ie=UTF8&qid=1394033544&rnid=317971011", "parent_text": "Restroom Fixtures", "department_text": "Janitorial", "department_id": 147},
{"department_text": "Automotive Tools & Equipment", "nr_products": "14244", "level": 0, "url": "http://www.amazon.com/s/ref=lp_15706941_nr_n_37?rh=n%3A15684181%2Cn%3A%2115690151%2Cn%3A15706941%2Cn%3A13400481&bbn=15706941&ie=UTF8&qid=1394033547&rnid=15706941", "text": "Welding Tools", "department_url": "http://www.amazon.com/Tools-Equipment-Automotive/b/ref=sd_allcat_ate/177-2158649-1745262?ie=UTF8&node=15706941", "description_title": "Welding Supplies from Amazon.com", "parent_url": "http://www.amazon.com/Tools-Equipment-Automotive/b/ref=sd_allcat_ate/177-2158649-1745262?ie=UTF8&node=15706941", "keyword_count": {"welding supplies": 4, "amazoncom": 2, "welding": 18}, "description_wc": 323, "description_text": "Welding is a precise job that requires the correct materials and equipment to achieve great results. Whether you need welding accessories for MIG, TIG, or stick welding, you\u2019ll find a wide variety of raw materials, wire, safety equipment, and tools to help you get the job done right every time. The most common type of welding for home shops is metal inert gas, or MIG welding. This process uses inert gas to shield the steel being welded, and is generally considered a high-speed method that\u2019s easy to learn. MIG welding is very useful for joining thin steel, and is somewhat resistant to contaminates and dirty surfaces. At Amazon.com, we offer a complete line of MIG welding supplies and equipment, ranging from welders to masks to wire and electrical components. Many small MIG welders are highly portable, so you can pack them up and bring them wherever you need to go. For highly precise welds, many professionals prefer tungsten inert gas, or TIG welding. This process is much slower than MIG or stick welding, but produces the \u201ccleanest\u201d welds, and is therefore popular in aerospace and performance automotive applications. TIG welding can join many different types of metal, including steel, stainless steel, copper, aluminum, and dozens of alloys in nearly any thickness, so it\u2019s a particularly useful method. Since TIG welding requires pristine surfaces to join metals, it\u2019s important you have the correct welding supplies including wire brushes, gas flow meters, nozzles, and wire feeders to ensure a quality weld. Stick welding is one of the oldest arc welding methods, and has been in use around the world for decades. It is a versatile process that requires no shielding gas, so fewer welding supplies are needed. Stick welding does, however, require more clean up on the finished weld to ensure longevity. You\u2019ll find all the welding supplies you need for MIG, TIG, stick, and gas welding at Amazon.com.", "parent_text": "Automotive Tools & Equipment", "keyword_density": {"welding supplies": "2.5", "amazoncom": "0.6", "welding": "5.6"}, "department_id": 141},
