{"nr_products": "1468", "level": -1, "url": "http://www.amazon.com/s/ref=sr_nr_n_0?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A317970011%2Cn%3A7301207011%2Cn%3A7656049011&bbn=7301207011&ie=UTF8&qid=1394033553&rnid=7301207011", "text": "Lab Cleaning Supplies", "department_url": "http://www.amazon.com/Lab-Scientific-Supplies/b/ref=sd_allcat_ind_lab/177-2158649-1745262?ie=UTF8&node=317970011", "description_wc": 0, "parent_url": "http://www.amazon.com/s/ref=lp_317970011_nr_n_5?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A317970011%2Cn%3A7301207011&bbn=317970011&ie=UTF8&qid=1394033546&rnid=317970011", "parent_text": "Lab Supplies & Consumables", "department_text": "Lab & Scientific", "department_id": 146},
{"department_text": "Automotive Tools & Equipment", "nr_products": "521", "level": -1, "url": "http://www.amazon.com/s/ref=lp_13400481_nr_n_5?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A328182011%2Cn%3A8106310011%2Cn%3A13400481%2Cn%3A3753921&bbn=13400481&ie=UTF8&qid=1394033555&rnid=13400481", "text": "Plasma Cutters", "department_url": "http://www.amazon.com/Tools-Equipment-Automotive/b/ref=sd_allcat_ate/177-2158649-1745262?ie=UTF8&node=15706941", "description_title": "Plasma Cutters from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_15706941_nr_n_37?rh=n%3A15684181%2Cn%3A%2115690151%2Cn%3A15706941%2Cn%3A13400481&bbn=15706941&ie=UTF8&qid=1394033547&rnid=15706941", "keyword_count": {"plasma cutters": 7, "amazoncom": 1, "plasma": 14}, "description_wc": 340, "description_text": "Custom metal work requires specialized equipment to achieve professional results. Plasma cutters are crucial for cutting steel and other resilient metals without causing mechanical burring, deformation, and irregularity in the material. Plasma cutters work in a similar fashion to many arc welders. Gas is injected through a highly energized electrical arc, which is then ionized, producing extremely hot plasma that is capable of cleanly cutting through steel. At Amazon.com, we offer a variety of plasma cutters suitable for different size shops. If you need a plasma cutter for occasional use and light duty work, you\u2019ll find several highly portable models that are easy to store and set up when you need to get to work. Midrange plasma cutters are between 50 and 70 amps, and can handle most home projects well. You\u2019ll also find 80+ amp plasma cutters for heavy-duty use and commercial applications. The most basic plasma cutter design requires contact between the cutting nozzle and the material to initiate an arc, which often requires any paint or rust to be cleaned prior to use. Newer, more advanced plasma cutters are able to initiate the arc and begin cutting without contact, so no extra prep is required. To find a plasma cutter that suits your requirements well, you can use our helpful product filters. Choose the brand, amperage, features, and price range you want, and we\u2019ll create a list of products that fit your criteria. Since most plasma cutters have detailed information about cutting capacity, special features like pilot arc systems, and electrical and gas requirements, you\u2019ll be sure to choose a plasma cutter that has everything you\u2019re looking for. We also offer a full selection of accessories and equipment to keep your plasma cutter in top condition. You\u2019ll find nozzles, tips, hoses, electrodes, and all the other parts you need in one convenient place. A capable plasma cutter offers an effective way to manipulate extremely durable materials like steel quickly and safely, and create custom metal work for dozens of applications.", "parent_text": "Welding Tools", "keyword_density": {"plasma cutters": "4.1", "amazoncom": "0.3", "plasma": "4.1"}, "department_id": 141},
{"nr_products": "1444", "level": -1, "url": "http://www.amazon.com/s/ref=lp_10981291_nr_n_6?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A3248684011%2Cn%3A10981291%2Cn%3A172529&bbn=10981291&ie=UTF8&qid=1394033553&rnid=10981291", "text": "Radar Detectors", "department_url": "http://www.amazon.com/b/ref=sd_allcat_ceg/177-2158649-1745262?ie=UTF8&node=3248684011", "description_wc": 0, "parent_url": "http://www.amazon.com/s/ref=lp_3248684011_nr_n_4?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A3248684011%2Cn%3A10981291&bbn=3248684011&ie=UTF8&qid=1394033547&rnid=3248684011", "parent_text": "Vehicle Electronics Accessories", "department_text": "Car/Vehicle Electronics & GPS", "department_id": 142},
{"department_text": "Automotive Tools & Equipment", "nr_products": "3219", "level": -1, "url": "http://www.amazon.com/s/ref=lp_13400481_nr_n_6?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A328182011%2Cn%3A8106310011%2Cn%3A13400481%2Cn%3A553012&bbn=13400481&ie=UTF8&qid=1394033555&rnid=13400481", "text": "Welders", "department_url": "http://www.amazon.com/Tools-Equipment-Automotive/b/ref=sd_allcat_ate/177-2158649-1745262?ie=UTF8&node=15706941", "description_title": "Welders from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_15706941_nr_n_37?rh=n%3A15684181%2Cn%3A%2115690151%2Cn%3A15706941%2Cn%3A13400481&bbn=15706941&ie=UTF8&qid=1394033547&rnid=15706941", "keyword_count": {"amazoncom": 3, "welders": 10}, "description_wc": 310, "description_text": "Professionals and hobbyists alike can find the welders they need for fabrication, repairs and more at Amazon.com. With our selection of accessories and other welding equipment, you can also make sure you have all the extras you need to make excellent welds and stay safe. We have a wide variety of welders to choose from. Electrical welders are reliable, and ideal for a number of applications. Arc welders can be used at home or at the jobsite for metal fabrication, so whether you\u2019re welding artistic sculptures or structures for construction purposes, our welders can give you the service you need. Some come built with robust, wheeled steel cases, so you can move them around to your worksite with utmost ease. Welders with long, flexible nozzles give you the ability to move around and get full control over your angles and positions. To ensure that you get welders from the same quality brands that you\u2019ve trusted before, we offer Campbell Hausfeld, Maxus, Longevity, and other popular models. If you want to ensure that you\u2019re getting a model that other customers have bought and loved, try filtering your search by average customer rating and read the great reviews to get a better understanding before you buy. After you choose your welder, you can also find a great selection of welding accessories and equipment on Amazon.com as well. Safety is the most important issue before you do any fabrication work, and we carry a collection of safety goggles and masks especially made for welders. We also offer stainless steel brushes to clean off your workstations, welding tip cleaners, electrode kits, and flint strikers. If you\u2019re looking for welders and other equipment on a budget, try filtering your search by price to see some of the most affordable options we carry. You can find reliable and trusted welders at Amazon.com.", "parent_text": "Welding Tools", "keyword_density": {"amazoncom": "1.0", "welders": "3.2"}, "department_id": 141},
{"department_text": "Automotive Tools & Equipment", "nr_products": "1599", "level": -1, "url": "http://www.amazon.com/s/ref=lp_13400481_nr_n_4?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A328182011%2Cn%3A8106310011%2Cn%3A13400481%2Cn%3A13400561&bbn=13400481&ie=UTF8&qid=1394033555&rnid=13400481", "text": "TIG Welding Equipment", "department_url": "http://www.amazon.com/Tools-Equipment-Automotive/b/ref=sd_allcat_ate/177-2158649-1745262?ie=UTF8&node=15706941", "description_title": "TIG Welding Equipment from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_15706941_nr_n_37?rh=n%3A15684181%2Cn%3A%2115690151%2Cn%3A15706941%2Cn%3A13400481&bbn=15706941&ie=UTF8&qid=1394033547&rnid=15706941", "keyword_count": {"equipment": 6, "tig welding": 9, "tig welding equipment": 3, "welding equipment": 4, "amazoncom": 2, "tig": 13, "welding": 17}, "description_wc": 340, "description_text": "Tungsten Inert Gas welding, or TIG welding is a highly precise, versatile method of welding many different metals, including thinner stainless steel, copper alloys, aluminum, magnesium, and other non-ferrous materials. TIG welding requires precise control, clean materials, and specialized equipment, but produces extremely strong, long-lasting welds. At Amazon.com, we offer a complete selection of TIG welding equipment, including welders, filler rods, electrodes, gas lenses, and more. Since TIG welding requires such tight tolerances to produce quality welds, it\u2019s important to make sure your equipment is maintained well. You\u2019ll find all the parts and supplies you need to keep your TIG welder in top condition, from hoses and gaskets, to electrical components and clamps. You\u2019ll find smaller TIG welders that are suitable for light duty garage work, larger units that are designed for more frequent use, and commercial grade welders that can stand up to the rigors of a full day of welding. You can use our helpful product filters to find TIG welding equipment that meets your needs. Choose the brands, key features, and price range you want, and we\u2019ll show you products that fit your criteria. Since most TIG welding equipment has detailed information regarding capabilities, power consumption, replacement parts, and other important features, you\u2019ll be sure to choose a TIG welder that meets all your expectations. Shopping online at Amazon.com makes it easy to compare similar products, and choose the tools that have the features and capabilities you need most. In addition to complete TIG welding setups, we offer other welding equipment, including MIG, stick, and gas welding parts and accessories, so you can build out a well-rounded welding shop all in one convenient place. Many TIG welding products are eligible for FREE Super Saver Shipping, so you can get everything you need to start welding delivered straight to your door at no additional cost. TIG welding is a precise and long-lasting method of welding many different materials that will produce consistently professional results for experienced welders and technicians.", "parent_text": "Welding Tools", "keyword_density": {"welding equipment": "2.4", "tig welding": "5.3", "tig welding equipment": "2.6", "equipment": "1.8", "amazoncom": "0.6", "tig": "3.8", "welding": "5.0"}, "department_id": 141},
{"department_text": "Automotive Tools & Equipment", "nr_products": "506", "level": -1, "url": "http://www.amazon.com/s/ref=lp_13400481_nr_n_3?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A328182011%2Cn%3A8106310011%2Cn%3A13400481%2Cn%3A13400551&bbn=13400481&ie=UTF8&qid=1394033555&rnid=13400481", "text": "Spot Welding Equipment", "department_url": "http://www.amazon.com/Tools-Equipment-Automotive/b/ref=sd_allcat_ate/177-2158649-1745262?ie=UTF8&node=15706941", "description_title": "Spot Welding Equipment from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_15706941_nr_n_37?rh=n%3A15684181%2Cn%3A%2115690151%2Cn%3A15706941%2Cn%3A13400481&bbn=15706941&ie=UTF8&qid=1394033547&rnid=15706941", "keyword_count": {"spot": 11, "equipment": 9, "amazoncom": 1, "spot welding": 9, "spot welding equipment": 6, "welding": 10}, "description_wc": 332, "description_text": "Spot welding is a specialized technique used to attach thin sheets of metal together at a specific point. The process can be a permanent part of the construction process, but is often used to temporarily hold sheet metal in a fixed position so more extensive welds can be applied without disturbing the position of the material. Spot welding equipment typically includes a traditional arc welder, but specialized equipment is also available that is purpose-built for spot welding. At Amazon.com, we offer a range of spot welding equipment and supplies, including welders, electrical components and accessories, and safety equipment from top brands like Hobart, Blair, and Motor Guard. You\u2019ll find portable spot welding equipment that\u2019s easy to pack up with you wherever you go, as well as commercial and industrial grade equipment that\u2019s designed to stand up to heavy use in a professional shop. For automotive applications, we offer handheld spot welding guns that fit more easily into tight spots. Many auto body shops rely on smaller units to attach studs to dented body work, so they can be pulled and reshaped reliably and securely. Our helpful product filters make it fast and easy to find spot welding equipment that meets your needs. You can select the brands, key features, and price range you\u2019re looking for, and we\u2019ll create a list of products that fit your criteria. Most of our spot welding equipment and supplies have detailed descriptions of their power requirements, metal compatibilities, and gauge limits, so you\u2019ll be sure to choose tools and accessories that work for the application you\u2019ve got in mind. Spot welders with copper electrodes are designed to clamp the material in place to ensure precise control over the location of your welds, and many of them are capable of welding many different materials, including stainless and galvanized steel. Spot welding equipment is important for jobs that require the type of accurate welds that are necessary for sheet metal fabrication.", "parent_text": "Welding Tools", "keyword_density": {"spot": "3.3", "equipment": "2.7", "amazoncom": "0.3", "spot welding": "5.4", "spot welding equipment": "5.4", "welding": "3.0"}, "department_id": 141},
{"department_text": "Automotive Tools & Equipment", "nr_products": "3318", "level": -1, "url": "http://www.amazon.com/s/ref=lp_13400481_nr_n_0?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A328182011%2Cn%3A8106310011%2Cn%3A13400481%2Cn%3A13400491&bbn=13400481&ie=UTF8&qid=1394033555&rnid=13400481", "text": "Arc Welding Equipment", "department_url": "http://www.amazon.com/Tools-Equipment-Automotive/b/ref=sd_allcat_ate/177-2158649-1745262?ie=UTF8&node=15706941", "description_title": "Arc Welding from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_15706941_nr_n_37?rh=n%3A15684181%2Cn%3A%2115690151%2Cn%3A15706941%2Cn%3A13400481&bbn=15706941&ie=UTF8&qid=1394033547&rnid=15706941", "keyword_count": {"amazoncom": 1, "arc welding": 10, "arc": 11, "welding": 17}, "description_wc": 330, "description_text": "Shielded gas welding is commonly referred to as arc welding, and is one of the most popular and cost-effective ways to join many different types of metals for repair and construction projects. Architectural, automotive, household, and artistic applications of arc welding are common on many scales, from table top wire welding, to the structural core of skyscrapers. Arc welding includes MIG and TIG welding, which are the two most common types of shielded gas welding for consumer and commercial applications. At Amazon.com, we offer a wide variety of arc welding equipment, including welders and accessories, welding materials like wire, and safety equipment like masks, gloves, and leather aprons. You\u2019ll find a complete selection of consumer grade arc welding equipment and supplies to help you get started on repair and building projects around the house and in the garage, as well as commercial grade equipment you can bring with you to the job site day after day. You can choose from popular brands like Lincoln Electric, Forney, Hobart, and more. No matter what your preferences are, you\u2019ll find plenty of arc welding equipment to choose from. Our helpful product features make it fast and easy to find arc welding equipment that meets your needs completely. Select the brands, key features, and price range you\u2019re looking for, and we\u2019ll display products that fit your specifications. Since most arc welding equipment has detailed information and photos describing capabilities, compatibilities, and tolerances, you\u2019ll be sure to choose gear that works well for the projects you\u2019ve got in mind. MIG welding is cost effective and somewhat forgiving of surface impurities and technical variations, while TIG welding is highly precise, but capable of joining a wide variety of metals and alloys. Arc welding is an extremely useful skill that\u2019s more accessible and easier to learn than many people think. With basic arc welding equipment, you can get started with fabrication, construction, repairs, and custom automotive work right away.", "parent_text": "Welding Tools", "keyword_density": {"amazoncom": "0.3", "arc welding": "6.1", "arc": "3.3", "welding": "5.2"}, "department_id": 141},
{"department_text": "Automotive Tools & Equipment", "nr_products": "3359", "level": -1, "url": "http://www.amazon.com/s/ref=lp_13400481_nr_n_2?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A328182011%2Cn%3A8106310011%2Cn%3A13400481%2Cn%3A13400531&bbn=13400481&ie=UTF8&qid=1394033555&rnid=13400481", "text": "MIG Welding Equipment", "department_url": "http://www.amazon.com/Tools-Equipment-Automotive/b/ref=sd_allcat_ate/177-2158649-1745262?ie=UTF8&node=15706941", "description_title": "MIG Welding Supplies from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_15706941_nr_n_37?rh=n%3A15684181%2Cn%3A%2115690151%2Cn%3A15706941%2Cn%3A13400481&bbn=15706941&ie=UTF8&qid=1394033547&rnid=15706941", "keyword_count": {"mig": 10, "mig welding": 9, "amazoncom": 2, "mig welding supplies": 1, "supplies": 3, "welding": 10}, "description_wc": 322, "description_text": "MIG welding is a fast and easy to learn welding technique that\u2019s particularly well-suited for thin steel, but also works well with more substantial pieces. MIG welding doesn\u2019t require perfectly clean surfaces, so you can focus on joining your materials, rather than buffing them out. Some MIG welders are small and highly portable, so you can bring your welder wherever you need to work, while larger, commercial grade MIG welding equipment is designed to withstand the rigors of day-in, day-out use. At Amazon.com, we offer a complete selection of MIG welding equipment and supplies, including welders, to electrical components, to wire and safety equipment. If you\u2019re deciding what type of MIG welding setup is appropriate for your shop or garage, be sure to read the detailed product descriptions that most welders feature to determine the exact electrical and gas requirements, dimensions, material capabilities, and key features of the products you\u2019re interested in. Our selection includes a wide range of consumer and commercial grade MIG welding equipment, so you\u2019re sure to find something that meets your needs completely. You can quickly find the MIG welding supplies you\u2019re looking for with our helpful product filters. Choose the brands, features, and price range you want, and we\u2019ll create a list of products that fit your criteria. Shopping online at Amazon.com for MIG welding equipment makes it fast and easy to compare similar products, so you can be sure you\u2019ve purchased the right tools for the job. From wire to safety equipment, everything you need to weld like a pro is available in one convenient place. Many items are eligible for FREE Super Saver Shipping, so you can get all your supplies delivered straight to your door at no additional cost. MIG welding is a fast and effective way to join metal and create custom fabricated parts for automotive, architectural, and household projects and repairs.", "parent_text": "Welding Tools", "keyword_density": {"mig": "3.1", "mig welding supplies": "0.9", "amazoncom": "0.6", "mig welding": "5.6", "supplies": "0.9", "welding": "3.1"}, "department_id": 141},
