{"department_text": "Industrial Supplies", "nr_products": "20535", "level": -1, "url": "http://www.amazon.com/s/ref=lp_256409011_nr_n_9?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011%2Cn%3A5006545011&bbn=256409011&ie=UTF8&qid=1394033553&rnid=256409011", "text": "Pressure & Temperature", "department_url": "http://www.amazon.com/industrial-scientific-supplies/b/ref=sd_allcat_ind_sup/177-2158649-1745262?ie=UTF8&node=16310091", "description_title": "Pressure & Temperature", "parent_url": "http://www.amazon.com/s/ref=lp_16310091_nr_n_18?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011&bbn=16310161&ie=UTF8&qid=1394033546&rnid=16310161", "keyword_count": {"pressure": 11, "temperature": 9}, "description_wc": 118, "description_text": "Equipment for measuring and monitoring mechanical pressure and temperature include pressure gauges , pressure sensors , pressure transmitters , temperature controllers , temperature sensors , and thermometers . A pressure gauge measures the pressure of a gas or liquid inside a container. A pressure sensor and pressure transmitter monitor changes in mechanical pressure and convert the pressure measurement to an electronic signal. A temperature controller manages the temperature of a system based on input from a temperature sensor, which measures temperature. A thermometer contains a sensor and scale to report the temperature reading. Pressure and temperature measurement devices are used for industrial applications such as petrochemical processing, hydraulic installations, process control, heavy equipment, and HVAC installations, among others.", "parent_text": "Test, Measure & Inspect", "keyword_density": {"pressure": "9.8", "temperature": "8.0"}, "department_id": 145},
