{"nr_products": "24895", "level": -1, "url": "http://www.amazon.com/s/ref=lp_256409011_nr_n_3?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011%2Cn%3A5011659011&bbn=256409011&ie=UTF8&qid=1394033553&rnid=256409011", "text": "Electrical Testing", "department_url": "http://www.amazon.com/industrial-scientific-supplies/b/ref=sd_allcat_ind_sup/177-2158649-1745262?ie=UTF8&node=16310091", "description_wc": 0, "parent_url": "http://www.amazon.com/s/ref=lp_16310091_nr_n_18?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011&bbn=16310161&ie=UTF8&qid=1394033546&rnid=16310161", "parent_text": "Test, Measure & Inspect", "department_text": "Industrial Supplies", "department_id": 145},
{"department_text": "Industrial Supplies", "nr_products": "416", "level": -1, "url": "http://www.amazon.com/s/ref=lp_256409011_nr_n_6?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011%2Cn%3A393278011&bbn=256409011&ie=UTF8&qid=1394033553&rnid=256409011", "text": "Light Measurement", "department_url": "http://www.amazon.com/industrial-scientific-supplies/b/ref=sd_allcat_ind_sup/177-2158649-1745262?ie=UTF8&node=16310091", "description_title": "Light Measurement", "parent_url": "http://www.amazon.com/s/ref=lp_16310091_nr_n_18?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011&bbn=16310161&ie=UTF8&qid=1394033546&rnid=16310161", "keyword_count": {"light": 17, "measurement": 4}, "description_wc": 360, "description_text": "A photometer and a light meter are instruments for measuring luminance, the intensity of light. While a photometer is sometimes called a light meter, there are distinctions between these devices. Whereas a photometer measures the intensity of light that passes through a solution, a light meter measures the amount of ambient or reflected light in a given environment. Both are available in portable, battery-powered models, and a photometer is also available in benchtop form. Test results are generally displayed on a digital readout. A photometer is used for water quality testing in industrial and scientific applications in the laboratory and in the field. A light meter is used for environmental testing of light pollution, determining proper lighting for photography, and checking conditions for plant growth. Photometers test a solution for specific substances or properties. They may be calibrated for a certain element, compound, or chemical such as ammonia, chlorine, phosphates, or surfactants; or for a certain property such as hardness, color, or pH. While some photometers test for a single parameter, others test for multiple parameters. Many photometers accommodate a cuvette for holding samples. Reagents are available for performing particular testing methods. A photometer is a simplified version of a spectrophotometer , which measures the amount of light of a specified wavelength that passes through a sample. Light meters usually consist of a handheld display unit and a light sensor probe. They measure light in lumens, showing measurements in either lux (1 lumen per square meter) or foot-candles (1 lumen per square foot). Some meters toggle between both units of measure. Measurement range, accuracy, resolution, and sampling rate vary from meter to meter. For example, a typical single-range light meter measures up to 2,000 foot candles (fc)/20,000 lux whereas a high-intensity light meter with multiple measurement ranges, such as the Extech EA33, may have a top range of 99,990 fc/999,900 lux. Among the features a light meter may have are storage and recall of readings, data logging, comparator function, averaging function, and measurement hold. Light meter reviews can be a source of information to help consumers select the best meter for an application.", "parent_text": "Test, Measure & Inspect", "keyword_density": {"light": "4.7", "measurement": "1.1"}, "department_id": 145},
{"nr_products": "1967", "level": -1, "url": "http://www.amazon.com/s/ref=lp_256409011_nr_n_7?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011%2Cn%3A5006560011&bbn=256409011&ie=UTF8&qid=1394033553&rnid=256409011", "text": "Motion, Speed & Force", "department_url": "http://www.amazon.com/industrial-scientific-supplies/b/ref=sd_allcat_ind_sup/177-2158649-1745262?ie=UTF8&node=16310091", "description_wc": 0, "parent_url": "http://www.amazon.com/s/ref=lp_16310091_nr_n_18?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011&bbn=16310161&ie=UTF8&qid=1394033546&rnid=16310161", "parent_text": "Test, Measure & Inspect", "department_text": "Industrial Supplies", "department_id": 145},
{"nr_products": "1032", "level": -1, "url": "http://www.amazon.com/s/ref=lp_256409011_nr_n_0?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011%2Cn%3A5006563011&bbn=256409011&ie=UTF8&qid=1394033553&rnid=256409011", "text": "Airflow & Air Quality", "department_url": "http://www.amazon.com/industrial-scientific-supplies/b/ref=sd_allcat_ind_sup/177-2158649-1745262?ie=UTF8&node=16310091", "description_wc": 0, "parent_url": "http://www.amazon.com/s/ref=lp_16310091_nr_n_18?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011&bbn=16310161&ie=UTF8&qid=1394033546&rnid=16310161", "parent_text": "Test, Measure & Inspect", "department_text": "Industrial Supplies", "department_id": 145},
{"department_text": "Industrial Supplies", "nr_products": "22713", "level": -1, "url": "http://www.amazon.com/s/ref=lp_256409011_nr_n_2?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011%2Cn%3A4989299011&bbn=256409011&ie=UTF8&qid=1394033553&rnid=256409011", "text": "Dimensional Measurement", "department_url": "http://www.amazon.com/industrial-scientific-supplies/b/ref=sd_allcat_ind_sup/177-2158649-1745262?ie=UTF8&node=16310091", "description_title": "Dimensional Measurement", "parent_url": "http://www.amazon.com/s/ref=lp_16310091_nr_n_18?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011&bbn=16310161&ie=UTF8&qid=1394033546&rnid=16310161", "keyword_count": {"dimensional measurement": 2, "measurement": 8}, "description_wc": 364, "description_text": "Making dimensional measurements is a critical part of everyday operations in fields such as manufacturing, machining, metalworking, woodworking, engineering, drafting, automotive maintenance, medicine, and scientific research. Various measurement tools are available, from basic rulers for linear measurement to ultrasonic thickness gauges for nondestructive testing of material thickness. A ruler is a tool with an inch, metric, or both inch and metric scale for measuring distances and marking lines. A straight edge is used to draw or scribe straight lines and often does not have graduations. To set and measure angles through either 180 or 360 degrees, a protractor may be used. A caliper measures the inside and outside dimensions of an object as well as the depth of a hole, displaying measurements on a vernier scale, dial, or digital readout. Most calipers are either pivot-type with two legs that mark the points of measurement, or slide-type with a set of adjustable jaws. A micrometer measures either the external dimensions of an object or internal dimensions such as the diameter of a hole or the width of a groove. It has a screw mechanism for precise adjustment of the measuring faces. There are a variety of gauges for dimensional measurement. A chamfer gauge measures the largest diameter of a chamfer, or beveled edge, while a countersink gauge measures the largest diameter of a countersunk hole. A bore gauge , or hole gauge , measures the distance between the sides of a hole. Depth gauges measure the depth of a hole, slot, step, or recess. Height gauges are used to determine the height of an object. A radius gauge checks the radius of a groove, corner, or other rounded surface. Pin gauges are cylindrical plugs for measuring the diameter of machined holes and slots. Ring gauges are metal bands for go/no-go inspections and may serve as a master for other measurement tools. A snap gauge is used to make comparative measurements of the outside dimensions of objects. Thread gauges check the thread size and pitch diameter of threaded parts. A feeler gauge measures gaps between parts. Thickness gauges measure the thickness of materials. Many gauges incorporate a dial indicator that displays readings.", "parent_text": "Test, Measure & Inspect", "keyword_density": {"dimensional measurement": "1.1", "measurement": "2.2"}, "department_id": 145},
{"nr_products": "377", "level": -1, "url": "http://www.amazon.com/s/ref=lp_3310316011_nr_n_2?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A317971011%2Cn%3A3310316011%2Cn%3A3310319011&bbn=3310316011&ie=UTF8&qid=1394033551&rnid=3310316011", "text": "Commercial Toilet Bowls", "department_url": "http://www.amazon.com/b/ref=sd_allcat_ind_jan/177-2158649-1745262?ie=UTF8&node=317971011", "description_wc": 0, "parent_url": "http://www.amazon.com/s/ref=lp_317971011_nr_n_6?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A317971011%2Cn%3A3310316011&bbn=317971011&ie=UTF8&qid=1394033544&rnid=317971011", "parent_text": "Restroom Fixtures", "department_text": "Janitorial", "department_id": 147},
