{"nr_products": "416", "level": -1, "url": "http://www.amazon.com/s/ref=lp_3430070011_nr_n_0?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A318135011%2Cn%3A3430070011%2Cn%3A3206555011&bbn=3430070011&ie=UTF8&qid=1394033551&rnid=3430070011", "text": "Flags", "department_url": "http://www.amazon.com/b/ref=sd_allcat_ind_saf/177-2158649-1745262?ie=UTF8&node=318135011", "description_wc": 0, "parent_url": "http://www.amazon.com/s/ref=lp_318135011_nr_n_5?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A318135011%2Cn%3A3430070011&bbn=318135011&ie=UTF8&qid=1394033543&rnid=318135011", "parent_text": "Safety Signs & Signals", "department_text": "Safety", "department_id": 148},
{"department_text": "Safety", "nr_products": "236102", "level": -1, "url": "http://www.amazon.com/s/ref=lp_3430070011_nr_n_7?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A318135011%2Cn%3A3430070011%2Cn%3A1265105011&bbn=3430070011&ie=UTF8&qid=1394033551&rnid=3430070011", "text": "Signs", "department_url": "http://www.amazon.com/b/ref=sd_allcat_ind_saf/177-2158649-1745262?ie=UTF8&node=318135011", "description_title": "Warning Signs", "parent_url": "http://www.amazon.com/s/ref=lp_318135011_nr_n_5?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A318135011%2Cn%3A3430070011&bbn=318135011&ie=UTF8&qid=1394033543&rnid=318135011", "keyword_count": {"warning": 10, "warning signs": 9, "signs": 13}, "description_wc": 323, "description_text": "Safety signs, or warning signs, such as \u201cExit,\u201d \u201cDanger,\u201d or \u201cCaution,\u201d display helpful messaging to help inform people of important circumstances in a variety of environments. Warning signs and safety signs are used in applications such as helping to direct traffic, for navigation on construction sites and in laboratories, and to display scores to alert fans at sporting events. Safety signs come in a wide array of forms, shapes, and colors, each intended for specific applications. A traditional stop sign is a warning sign that has a recognizable octagon shape with a red background and simple, clear white letters. Similarly, an exit safety sign has a familiar rectangular shape with red lettering on a white background. An exit safety sign is used to mark an area used to exit a building. An exterior traffic control system is a type of safety sign used to help direct car traffic. These warning signs have LED lighting to project color, and are made to withstand environmental conditions and provide a long life. Traffic warning signs resist rust, cracking, and corrosion. Road construction may call for a highway safety triangle kit, which is used to alert drivers of an emergency or unusual situation. Some safety signs, such as small warning signs with adhesive backing, are used in electrical applications to mark electrical wires and terminals. These small warning signs may feature numbers, letters, symbols, and industry-specific coloring. Warning signs may be made of materials, such as vinyl cloth that allow repositioning, work well on curved surfaces, and provide oil and water resistance. Warning signs can give specific, direct instruction, such as \u201cDanger/Arc Flash and Shock Hazard/Appropriate personal protection equipment required.\u201d A safety sign marked \u201cEyewash Station\u201d may be found in research, educational, or medical laboratories to indicate where emergency eyewash procedures can be performed. Two-sided standing floor warning signs with a \u201cCaution: Wet Floor\u201d imprint are commonly used in janitorial and sanitation applications.", "parent_text": "Safety Signs & Signals", "keyword_density": {"warning": "3.1", "warning signs": "5.6", "signs": "4.0"}, "department_id": 148},
{"department_text": "Safety", "nr_products": "805", "level": -1, "url": "http://www.amazon.com/s/ref=lp_3430070011_nr_n_6?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A318135011%2Cn%3A3430070011%2Cn%3A3430079011&bbn=3430070011&ie=UTF8&qid=1394033551&rnid=3430070011", "text": "Safety Mirrors", "department_url": "http://www.amazon.com/b/ref=sd_allcat_ind_saf/177-2158649-1745262?ie=UTF8&node=318135011", "description_title": "Security Mirror", "parent_url": "http://www.amazon.com/s/ref=lp_318135011_nr_n_5?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A318135011%2Cn%3A3430070011&bbn=318135011&ie=UTF8&qid=1394033543&rnid=318135011", "keyword_count": {"security mirror": 5, "security": 6, "mirror": 14}, "description_wc": 263, "description_text": "A security mirror is commonly used to help see around blind corners, over center aisle gondolas, and into hidden corners. A safety mirror is used to discourage shoplifting and empower business owners by offering security and peace of mind. A security mirror is used in a wide variety of environments such as retail stores, supermarkets, museums, office buildings, and churches. A safety mirror is similarly used in hospitals, warehouses, and factories, as well as industrial plants, loading docks, schools, pathways, and on roadways. A security mirror can also be used to provide overhead surveillance, and can be located in intersections and corridors. A security mirror mounted to the end of a long handle may be used to inspect underneath objects or in low areas. Most security mirrors have a convex shape that is curved where it meets the rim, to help provide wide visibility and depth perception. A convex mirror is commonly round in shape, but may also be rectangular or triangular. A convex mirror may have either a 180- or 360-degree viewing angle. The viewing angle of a convex mirror may also be panoramic, full dome, half dome, or quarter dome. A convex mirror can be designed for indoor or outdoor use. A convex mirror is often made of a glass or acrylic material, and can be shatter-resistant, and built to withstand harsh environments. It can have a stainless steel, metal, or hard board backing. A convex mirror comes in various diameters. A convex mirror can have mounting brackets used for installation and support, and may have a swivel assembly.", "parent_text": "Safety Signs & Signals", "keyword_density": {"security mirror": "3.8", "security": "2.3", "mirror": "5.3"}, "department_id": 148},
