{"department_text": "Industrial Supplies", "nr_products": "263322", "level": 0, "url": "http://www.amazon.com/s/ref=lp_16310091_nr_n_12?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256346011&bbn=16310161&ie=UTF8&qid=1394033546&rnid=16310161", "text": "Material Handling Products", "department_url": "http://www.amazon.com/industrial-scientific-supplies/b/ref=sd_allcat_ind_sup/177-2158649-1745262?ie=UTF8&node=16310091", "description_title": "Material Handling", "parent_url": "http://www.amazon.com/industrial-scientific-supplies/b/ref=sd_allcat_ind_sup/177-2158649-1745262?ie=UTF8&node=16310091", "keyword_count": {"material": 15, "material handling": 13}, "description_wc": 220, "description_text": "Material handling products are used for many tasks, including pulling and lifting, maneuvering, and transporting a variety of materials, depending on the application. Casters are used to support and maneuver mobile items such as carts, racks, dollies, and other material handling equipment. Cable, including cable ties, and wire rope are types of material handling equipment used for pulling and lifting. Service and utility carts are also common material handling equipment, used in a wide array of facilities. Hand trucks and hand carts are common material handling supply apparatuses. Machine tool safety accessories include material handling equipment, such as guard rail posts, barriers, joining plates, and handrails. Jacks are also common material handling equipment used for leveling work in the services and transmission industries. Drum supplies, such as pails, safety faucets, lifters, covers, and drum heaters, are found in the material handling industry. Pallets, including strappers and trucks, are material handling equipment used to nest and transport materials. Material handling equipment also includes pneumatic supplies, such as storage racks, power clamps, and air cylinder arms. HVAC material handling equipment includes blowers, fans, vents, ducting, pumps, carpet dryers, and static eliminators. Hydraulic lifting pumps and cylinders are used for all kinds of material handling applications. Material handling equipment is used in many environments including manufacturing facilities, warehouses, industrial yards, and construction sites.", "parent_text": "Industrial Supplies", "keyword_density": {"material": "6.8", "material handling": "11.8"}, "department_id": 145},
