{"department_text": "Golf", "nr_products": 99823, "level": 1, "url": "http://www.amazon.com/Golf-Sports-Outdoors/b/ref=sd_allcat_golf/177-2158649-1745262?ie=UTF8&node=3410851", "text": "Golf", "department_url": "http://www.amazon.com/Golf-Sports-Outdoors/b/ref=sd_allcat_golf/177-2158649-1745262?ie=UTF8&node=3410851", "description_title": "Golf Equipment from Amazon.com", "keyword_count": {"golf": 11, "golf equipment from amazoncom": 2, "golf equipment": 5}, "description_wc": 328, "description_text": "Feeling a cool breeze against your face as you pull back and swing at a golf ball is a relaxing, almost meditative experience. Thanks to quality golf equipment from Amazon.com, you can enjoy the rich landscape of a grassy course and maybe even hit a few eagles. Or you can leave the wildlife alone and try harder to get in on the green. Golf clubs are number one on our list of golf equipment essentials, so we offer a wide variety of clubs for your needs. If you\u2019re looking for the right iron, wood or putter, you\u2019re in luck; you can select specific drivers to make short work of your quest for the perfect club. If you\u2019re not looking for individual clubs, you can also choose from our complete sets to get everything you need to go out to the driving range. When you don\u2019t have time to drive to the range, we can help you set up a variety of training options so you can practice while you\u2019re at home. Take a break after work with our practice putting greens and try to sink a few balls before dinner. Our golf nets can be hooked up in your back yard or garage so you can swing away and keep the birds and neighbors\u2019 windows safe. Among our collection of golf equipment, you\u2019ll find a variety of swing trainers so you can build up your core muscles and hone your tempo and lag. When you finally have time to visit the course but the weather isn\u2019t behaving, we have the solution for you. Specially made golf umbrellas, golf hats, and other golf equipment can make you comfortable in any weather. Our polo and other golf shirts are breezy enough that hot, summer days won\u2019t be a problem. With quality training and golf equipment from Amazon.com, the days of evicting birds from their nests will be a thing of the past.", "parent_text": "Sports, Outdoors", "keyword_density": {"golf": "3.4", "golf equipment": "3.0", "golf equipment from amazoncom": "2.4"}, "department_id": 138},
{"department_text": "Sports Collectibles", "nr_products": 13189935, "level": 1, "url": "http://www.amazon.com/Sports-Collectibles/b/ref=sd_allcat_sprt_cllct/177-2158649-1745262?ie=UTF8&node=3250697011", "text": "Sports Collectibles", "department_url": "http://www.amazon.com/Sports-Collectibles/b/ref=sd_allcat_sprt_cllct/177-2158649-1745262?ie=UTF8&node=3250697011", "description_title": "Sports Collectibles at Amazon.com", "keyword_count": {"sports collectibles": 8, "sports": 16}, "description_wc": 291, "description_text": "Welcome to our new Sports Collectibles store featuring sports memorabilia and sports collectibles from past, current and future stars from all major sport leagues and events including: Major League Baseball (MLB), National Football League (NFL), National Basketball Association (NBA), National Hockey League (NHL), Major League Soccer (MLS), NCAA, and Olympics. If you are looking to build your collection of sports collectibles and sports memorabilia or want to find a unique gift for an avid collector that will surprise them, our new store has the unique selection of sports memorabilia and sports collectibles that you are looking for. We focus on authentic sports collectibles and sports memorabilia, such as autographs and game-used jerseys authenticated by Ace Authentic, Frameworth, Highland Mint, Icon Sports Memorabilia, James Spence Authentication, MeiGray Group, MLB Players Alumni Association, Mounted Memories, NFL Players Inc., Panini Authentic, PSA/DNA, Steiner Sports, Topps, Tristar Authentic, and Upper Deck Authenticated. For the trading card collectors, we focus on having a large selection of wax packs and boxes, factory complete sets and single cards graded by Beckett Grading Services and Professional Sports Authenticator (PSA). As we continue to grow our selection, the Amazon Sports Collectibles Store is sure to have something for everybody. Whichever teams or players are your favorite, you should be able to find them amongst our giant selection of Authentic Game Used Merchandise, Autographed Jerseys, Balls, Bats, Shoes, Photos, Helmets, Trading cards, Other Sports Memorabilia and Sports Collectibles. Our new store will also have supplies such as display cases, ball cubes and card protectors, so whether you are adding to your collection, organizing your collection, or buying something as a gift, let the new Amazon Marketplace Sports Collectibles store help you find it.", "parent_text": "Sports, Outdoors", "keyword_density": {"sports collectibles": "5.6", "sports": "5.6"}, "department_id": 137},
{"nr_products": "468354", "level": -1, "url": "http://www.amazon.com/s/ref=lp_306506011_nr_n_10?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A306506011%2Cn%3A306629011&bbn=306506011&ie=UTF8&qid=1394033578&rnid=306506011", "text": "Wiring & Connecting", "department_url": "http://www.amazon.com/industrial-scientific-supplies/b/ref=sd_allcat_ind_sup/177-2158649-1745262?ie=UTF8&node=16310091", "description_wc": 0, "parent_url": "http://www.amazon.com/s/ref=lp_16310091_nr_n_7?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A306506011&bbn=16310161&ie=UTF8&qid=1394033546&rnid=16310161", "parent_text": "Industrial Electrical", "department_text": "Industrial Supplies", "department_id": 145},
{"department_text": "Cycling", "level": 1, "url": "http://www.amazon.com/cycling-bikes-bicycles-bike-sale/b/ref=sd_allcat_bike/177-2158649-1745262?ie=UTF8&node=3403201", "text": "Cycling", "department_url": "http://www.amazon.com/cycling-bikes-bicycles-bike-sale/b/ref=sd_allcat_bike/177-2158649-1745262?ie=UTF8&node=3403201", "description_title": "Bicycles from Amazon.com", "keyword_count": {"bicycles": 6, "bicycles from amazoncom": 2}, "description_wc": 327, "description_text": "Riding your bicycle can be one of the most liberating feelings; feeling the cool rush of air on your face as you exercise is a great way to relax and enjoy the outdoors. The quality bicycles from Amazon.com are purpose-built for a variety of landscapes and riding styles, so you can commute, race, climb, and pedal your way to good health while having a blast. For adults, we have a variety of mountain, racing, hybrid, and cruising bicycles. It doesn\u2019t matter if you\u2019re training or simply pedaling through the neighborhood, our bicycles and bike accessories are ideal for casual or professional uses. For commuters, our hybrid bikes may be just the thing; they\u2019re built to deal with a variety of surfaces and road qualities. They\u2019re the most useful for general use in cities, suburbs, and dirt trails. We also have a variety of kids\u2019 bikes for your children so they can go outside and have fun exercising, too. We have bicycles for every level of rider, from little ones just learning how to balance to extreme youth BMX bikers, you\u2019ll can find the appropriate bicycles and accessories here. If you\u2019re a little late on the birthday shopping, we have a variety of speedy delivery options so you can get your packages on time. The proper protection for any sport or activity is crucial in making sure you can enjoy it for a long time to come. We have helmets for every age group and head size to protect your head from injury. Our locks can also give you peace of mind while you leave your valuable investment safely locked up as you go to work, school, or even just to grab a quick latte. Whether you\u2019re a bike commuter or a velodrome hopeful or just getting your first set of training wheels, you want to ride your bicycle! Get out in the fresh air with the bicycles from Amazon.com.", "parent_text": "Sports, Outdoors", "keyword_density": {"bicycles": "1.8", "bicycles from amazoncom": "1.8"}, "department_id": 132},
