{"department_text": "Luggage", "nr_products": 306907, "level": 1, "url": "http://www.amazon.com/Luggage-Bags-Travel-Accessories-Clothing/b/ref=sd_allcat_luggage/177-2158649-1745262?ie=UTF8&node=15743161", "text": "Luggage", "department_url": "http://www.amazon.com/Luggage-Bags-Travel-Accessories-Clothing/b/ref=sd_allcat_luggage/177-2158649-1745262?ie=UTF8&node=15743161", "description_title": "Luggage and Bags from Amazon.com", "keyword_count": {"luggage and bags": 6, "bags": 10, "amazoncom": 2, "luggage and bags from amazoncom": 1, "luggage": 7}, "description_wc": 298, "description_text": "Whether you\u2019re looking for a rolling carry-on bag for a quick plane trip or a backpack for a day hike, Amazon.com carries all the luggage and bags you need to give you more room to move around on any journey. You can find a huge variety of luggage and bags in our Luggage and Bags store, perfect for all kinds of traveling. Browse our selection of carry-on luggage to find the ideal bag to take through airport customs easily. Many of our carry-on bags even have convenient wheels and handles, so you can simply roll them through the airports, train stations, and city streets without breaking a sweat or straining your hands and shoulders. Among our luggage and bags, you\u2019ll also find every kind of backpack and laptop bag you could want for office, school, and commuting. Our laptop bags come with extra padded laptop sleeves to keep your computer and your files completely secure and safe. We even have heavy-duty, water-proof hiking backpacks that can carry everything you need for a long trek out into the wilderness or provide a simple place to store all of your spare clothes and documents on an overseas road trip. For versatile luggage and bags you can use for many different purposes, including going to the gym, travelling, school trips, and more, browse our collection of duffel bags. They come in many sizes, so you can choose one that will fit all of your gear and supplies without having to worry about bursting a zipper. Business travelers, performers, and costume enthusiasts will also appreciate the garment bags we have available to safely store special articles of clothing. Wherever you travel, you can stow your belongings safely in the quality luggage and bags from Amazon.com.", "parent_text": "Clothing, Shoes, Jewelry", "keyword_density": {"luggage and bags": "6.0", "bags": "3.4", "amazoncom": "0.7", "luggage and bags from amazoncom": "1.7", "luggage": "2.3"}, "department_id": 126},
