{"department_text": "Hunting & Fishing", "level": 1, "url": "http://www.amazon.com/Hunting-Fishing/b/ref=sd_allcat_hntfsh/177-2158649-1745262?ie=UTF8&node=706813011", "text": "Hunting & Fishing", "department_url": "http://www.amazon.com/Hunting-Fishing/b/ref=sd_allcat_hntfsh/177-2158649-1745262?ie=UTF8&node=706813011", "description_title": "The Amazon Hunting & Fishing Store", "keyword_count": {"amazon hunting fishing store": 2, "fishing": 4, "hunting": 6}, "description_wc": 154, "description_text": "The Amazon Hunting & Fishing Store is the leading online retailer of hunting equipment and fishing tackle. We carry practically everything a sportsman -- or sportswoman -- could need. From spring turkey hunting calls and camouflage to whitetail deer scents, lures, and game cameras, from elk calls, binoculars, and spotting scopes to compound bows, crossbows, arrows, and other archery accessories, we've got you covered. And, of course we carry the widest selection of hunting optics, knives, and gun accessories, no matter your hunting or shooting sport preference. On the fishing side of the business, you'll find tens of thousands of rods, reels, lures, baits, hooks, and other terminal tackle. Whatever your favorite pursuit is -- lunker largemouths, inshore gamefish, or trout on a fly, whitetail deer, bugling elk, or upland birds -- we're confident you'll find what you're looking for in the Amazon Hunting & Fishing Store. Check back often, our selection is constantly growing.", "parent_text": "Sports, Outdoors", "keyword_density": {"amazon hunting fishing store": "5.2", "fishing": "2.6", "hunting": "3.9"}, "department_id": 131},
