{"department_text": "Safety", "nr_products": "167", "level": -1, "url": "http://www.amazon.com/s/ref=lp_393317011_nr_n_4?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A318135011%2Cn%3A393317011%2Cn%3A318140011&bbn=393317011&ie=UTF8&qid=1394033581&rnid=393317011", "text": "Lab Showers", "department_url": "http://www.amazon.com/b/ref=sd_allcat_ind_saf/177-2158649-1745262?ie=UTF8&node=318135011", "description_title": "Safety Shower", "parent_url": "http://www.amazon.com/s/ref=lp_318135011_nr_n_0?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A318135011%2Cn%3A393317011&bbn=318135011&ie=UTF8&qid=1394033543&rnid=318135011", "keyword_count": {"shower": 15, "safety shower": 6, "safety": 7}, "description_wc": 253, "description_text": "A safety shower, sometimes called an emergency shower, is a unit that discharges a horizontal supply of liquid to help clear contaminants, such as corrosive or dangerous chemicals, away from a person\u2019s body. A safety shower is used in work and home environments to help protect people from contaminants that may be harmful to their health. An emergency shower, also known as a drench or deluge shower, can contain potable water, preserved water, buffered saline, or medical solution. A safety shower can be portable or plumbed in a fixed area. An emergency shower can be in an open area or housed within a self-contained shower stall with a curtain for containment and privacy. A safety shower commonly has a large handle that can be easily grasped and pulled, and may have on-off pull chains with rings. An emergency shower can be designed to draw a specific number of gallons per minute, at a number of pounds of pressure per square inch, for a maximum number of minutes. Recommended rinse times for an emergency shower vary, depending upon the type of chemical, corrosive, or irritant. An emergency shower is used in a wide variety of environments including laboratories, high-dust areas, in spraying, dipping, or dispensing operations, and in areas that work with hazardous substances. A safety shower is also used in medical, nuclear, and manufacturing facilities. A safety shower can meet Occupational Safety and Health Administration (OSHA) and American National Standards Institute (ANSI) standards for emergency eyewash and shower equipment.", "parent_text": "Emergency Response Equipment", "keyword_density": {"shower": "5.9", "safety shower": "4.7", "safety": "2.8"}, "department_id": 148},
