{"department_text": "Outdoor Gear", "nr_products": "30047", "level": 0, "url": "http://www.amazon.com/s/ref=lp_706814011_nr_n_5?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A706814011%2Cn%3A2342471011&bbn=706814011&ie=UTF8&qid=1394033583&rnid=706814011", "text": "Snowboarding", "department_url": "http://www.amazon.com/outdoor-gear/b/ref=sd_allcat_outrec/177-2158649-1745262?ie=UTF8&node=706814011", "description_title": "Snowboarding Gear from Amazon.com", "parent_url": "http://www.amazon.com/outdoor-gear/b/ref=sd_allcat_outrec/177-2158649-1745262?ie=UTF8&node=706814011", "keyword_count": {"amazoncom": 1, "snowboarding gear": 5, "gear": 6}, "description_wc": 278, "description_text": "Be ready to hit fresh powder next time it snows with all the right snowboarding gear, whether your board needs a new coat of wax or your bindings need to be tightened. Crushing it on the mountain means being prepared at home to face anything. Stock up on the snowboarding gear you need now and be the first one out there every time. In all different sizes, styles, and colors, Amazon.com has all the gear and tools your need. Whether you\u2019re looking for a freestyle or free ride board, men\u2019s or women\u2019s boots, or a new pair of bindings, check out our Snowboarding Gear Shop to find the latest snowboard, boots, bindings, and stomp pads that fit your personality and your budget. With top brands like DC, Nike, Columbia, and Santa Cruz, rest assured knowing you\u2019re getting high-quality products. Made to last in adverse conditions and treatment, protective snowboarding gear can is crucial to keep you safe on the mountain. You can find all the helmets, goggles, and protective clothing to protect you and ensure your performance isn\u2019t hampered by conditions or injury. Check out our selection of helmets with sturdy straps to protect yourself from falling debris, ice, and wipe-outs. The right pair of goggles can protect your eyes from the wind, ice crystals, snow glare, and keep your vision clear from fogging up. Keep insulated from head to two with waterproof jackets and pants, gloves, hats, face masks, and socks. With our wide selection of snowboarding gear, we\u2019ll have what you need, so you\u2019ll be able to perform well and stay comfortable and safe on the mountain.", "parent_text": "Outdoor Gear", "keyword_density": {"amazoncom": "0.4", "snowboarding gear": "3.6", "gear": "2.2"}, "department_id": 130},
