{"department_text": "Hunting & Fishing", "nr_products": "141468", "level": 0, "url": "http://www.amazon.com/s/ref=lp_706813011_nr_n_2?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A706813011%2Cn%3A3408951&bbn=706813011&ie=UTF8&qid=1394033583&rnid=706813011", "text": "Fishing", "department_url": "http://www.amazon.com/Hunting-Fishing/b/ref=sd_allcat_hntfsh/177-2158649-1745262?ie=UTF8&node=706813011", "description_title": "Fishing Tackle from Amazon.com", "parent_url": "http://www.amazon.com/Hunting-Fishing/b/ref=sd_allcat_hntfsh/177-2158649-1745262?ie=UTF8&node=706813011", "keyword_count": {"fishing tackle": 7, "amazoncom": 3, "fishing": 11}, "description_wc": 352, "description_text": "Make your next catch a big one. With top-of-the-line fishing tackle (pun intended!), accessories, and clothing, it can make all the difference, whether you\u2019re out there on the water facing a lunker largemouth or dreamily flyfishing in a river. If you\u2019re gearing up for this weekend\u2019s fishing trip or planning the season for a beginner fisherman, the Fishing Tackle Store at Amazon.com will be your best online resource for all things fishy. We feature fishing tackle from top brands like Zebco, Shimano, Shakespeare, Abu Garcia, Como, and Okuma so you can be secure in finding quality products. Whatever type of fishing tackle you are looking for, find it on Amazon.com. A fisherman\u2019s rod and reel are the most important piece of equipment he or she can have so make sure you\u2019re getting the correct height, material, and shape you need. Reel and rod combination set? Telescoping pole? Multi-disk drag? Six ball bearings? Anti-reverse clutch? You can find all the customer reviews and product descriptions to help you research now and to save you time and money later on down the road, while improving your performance. Accompany your new rod with the best fishing tackles, lures, and baits to entice any type of fish. Our large assortment will have you ready with plastic fish, bright feathers, crystal shrimp, and anything else you can imagine. For fishermen ready for the next level, we offer a wide variety of specialty fishing tackle for all the big fish you want and high-tech gadgets you can carry. Handheld fish finders will keep you one step ahead of the game, while small digital scales make it easier to weigh your catch on the spot. Protect yourself from the elements with specialty fishing clothing\u2014flyfishing vests, chest waders, hip boots, hats with sunshields, polarized sunglasses\u2014and other accessories when out on the water. Don\u2019t let that trophy fish swim away ever again. With a little help from Amazon.com\u2019s Fishing Tackle Store, you can catch everything you need to make a big day of fish tales.", "parent_text": "Hunting & Fishing", "keyword_density": {"fishing tackle": "4.0", "amazoncom": "0.9", "fishing": "3.1"}, "department_id": 131},
