{"department_text": "Outdoor Gear", "nr_products": "33629", "level": 0, "url": "http://www.amazon.com/s/ref=lp_706814011_nr_n_4?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A706814011%2Cn%3A2342470011&bbn=706814011&ie=UTF8&qid=1394033583&rnid=706814011", "text": "Skiing", "department_url": "http://www.amazon.com/outdoor-gear/b/ref=sd_allcat_outrec/177-2158649-1745262?ie=UTF8&node=706814011", "description_title": "Ski Gear from Amazon.com", "parent_url": "http://www.amazon.com/outdoor-gear/b/ref=sd_allcat_outrec/177-2158649-1745262?ie=UTF8&node=706814011", "keyword_count": {"ski gear": 5, "ski": 11, "ski gear from amazoncom": 2, "gear": 10}, "description_wc": 294, "description_text": "Whether you\u2019re ready to hit the slopes this weekend or are stocking up for next season\u2019s snow, having the right ski gear makes all the difference in your performance on the mountain. You can keep warm, safe, and comfortable while you take on that fresh powder or those icy moguls with the ski gear from Amazon.com Downhill, cross-country, telemark, or backcountry; whatever type of skiing you are into, we have the gear for it. Check out our Ski Gear store to find the latest skis, poles, bindings, and boots that fit your ski preference, style, and budget. We feature top brands like Atomic, Black Diamond, and Thule, so you can plan your ski trips in excitement and anticipation, knowing you are getting high-quality products. You\u2019ll find all the gear for skiing that you need to keep warm, comfortable, safe, and swooshing down the slopes. Stay safe on the slopes with properly fitting, comfortable helmets for kids and adult to protect your head from tree debris, ice, and falls. You can also find the right pair of goggles to shield your eyes from sun glare, ice crystals without the dreaded goggle fog-up. Find all the gear you need to stay warm and insulated: tactical hoods, waterproof jackets, pants, beanies, and long johns so you don\u2019t go numb halfway down the mountain. Quickly search and filter your results by featured brands, average customer review, condition, and price to find the best gear. Is fresh powder predicted soon? Have your ski gear delivered straight to your door with a variety of affordable and easy shipping options. Make your next ski trip great with the right ski gear from Amazon.com, your 24/7 online gear shop. Always open for your convenience.", "parent_text": "Outdoor Gear", "keyword_density": {"ski gear": "3.4", "ski gear from amazoncom": "2.7", "ski": "3.7", "gear": "3.4"}, "department_id": 130},
