{"department_text": "Exercise & Fitness", "nr_products": "859", "level": -1, "url": "http://www.amazon.com/s/ref=sr_nr_n_1?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A3407731%2Cn%3A3408061%2Cn%3A679351011&bbn=3408061&ie=UTF8&qid=1394033590&rnid=3408061", "text": "Women's", "department_url": "http://www.amazon.com/Exercise-Fitness-Sports-Outdoors/b/ref=sd_allcat_ef/177-2158649-1745262?ie=UTF8&node=3407731", "description_title": "Women\u2019s Cross-Training Shoes from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_3407731_nr_n_11?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A3407731%2Cn%3A3408061&bbn=3407731&ie=UTF8&qid=1394033583&rnid=3407731", "keyword_count": {"training": 7, "amazoncom": 2, "shoes": 9, "women s cross training shoes": 6}, "description_wc": 386, "description_text": "Whether you\u2019re looking for a pair of vibrant kicks for your next Zumba class, in search of a supportive pair of aerobics shoes, or need a lightweight pair of outdoor running shoes, Amazon.com offers a wide range of women\u2019s cross-training shoes in a variety of colors, styles, brands, sizes, and materials. To help you find the best women\u2019s cross-training shoes for toning your muscles and to keep you supported while you train, our selection features kicks optimized for dancing, biking, running, and more. When you need stability and support, we have a range of options to help you train in comfort. Whether you have high arches and need a neutral shoe to help you avoid supination, or if you have medium or low arches and need stability styles to help you avoid pronation, we have those too. From classic black and white shades that give your arches and ankles support while you move to neon reds with built-in reflective elements and breathable mesh uppers, you can search our selection of women\u2019s cross-training shoes using our handy color filters. With quality brands like ASICS, New Balance, Reebok, RYKA, and more, you can shop for long-lasting women\u2019s cross-training shoes right from home. Our sizing filters include sizes all the way from size three up to size 16, and we even include shoe widths so you can find just the right fit for your feet. If you\u2019re in search of shoes to help tone certain muscle groups while you walk or moisture-wicking lining to keep your feet dry during outdoor training sessions, we can help you find the women\u2019s cross-training shoes you need. Our handy search toolbar and filters can help you quickly narrow your search. Our wallet-friendly shopping options include price, discount, and even customer review filters, so you can find out about other shoppers\u2019 experiences. Plus, our free shipping and free returns on eligible items means you can try on at home and find the right fits, affordably and conveniently. Whether you\u2019re looking to break a major sweat in dance class or get your heart pumping on the bike, Amazon.com offers a wide selection of women\u2019s cross-training shoes to help you build muscle and keep your feet comfortable.", "parent_text": "Footwear", "keyword_density": {"women s cross training shoes": "7.8", "training": "1.8", "amazoncom": "0.5", "shoes": "2.3"}, "department_id": 129},
