{"department_text": "Outdoor Gear", "nr_products": "418", "level": -1, "url": "http://www.amazon.com/s/ref=lp_2342470011_nr_n_9?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A2204518011%2Cn%3A2342470011%2Cn%3A491442011&bbn=2342470011&ie=UTF8&qid=1394033592&rnid=2342470011", "text": "Ski & Snowboard Racks", "department_url": "http://www.amazon.com/outdoor-gear/b/ref=sd_allcat_outrec/177-2158649-1745262?ie=UTF8&node=706814011", "description_title": "Ski Car Racks from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_706814011_nr_n_4?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A706814011%2Cn%3A2342470011&bbn=706814011&ie=UTF8&qid=1394033583&rnid=706814011", "keyword_count": {"ski car": 3, "car": 7, "amazoncom": 3, "ski car racks": 2, "ski": 7, "racks": 4}, "description_wc": 314, "description_text": "When the season changes, it's time to start thinking about winter sports and the outdoors, and how the products from Amazon.com can help you get ready. Our ski car racks let you travel with your equipment in a safe way. From racks to roof boxes, we ensure that anyone can transport their skis safely on their vacation. Looking for a wide range of ski car racks? Our products include roof rack bars, roof boxes, whispbar kits rail grabs and fitting kits. These products will help you keep your ski gear attached securely to the roof of your vehicle. With the right tools, you will never worry that your equipment might accidentally slip or slide off the car. We pride ourselves on carrying the biggest selection of equipment and gear for outdoor lovers. You might spend days visiting sporting good stores in your city without finding exactly what you need. With Amazon.com, you can find the right ski car rack or roof box from trusted brands like Thule and Yakima. It is important to find the right rack to hold your ski gear when space is limited in your vehicle. Instead of sacrificing space inside your car, you can simply attach the rack to the roof and use it to transport your equipment. Rack bars will hold your ski equipment securely on the roof of your car. Maybe you need something that offers more protection for your gear. We also provide roof boxes that attach to the top of your vehicle and keep your items protected. Some roof boxes even come with locks so you can store your sporting gear securely. Windsurfing equipment is expensive, and you want to protect the investment that you make in your hobby. Windsurfing racks and boxes offer the protection and security that you need. Shop the wide selection of windsurfing equipment and gear that we provide on Amazon.com.", "parent_text": "Skiing", "keyword_density": {"ski car": "1.9", "car": "2.2", "amazoncom": "1.0", "ski car racks": "1.9", "ski": "2.2", "racks": "1.3"}, "department_id": 130},
