{"department_text": "Outdoor Gear", "nr_products": "1073", "level": -1, "url": "http://www.amazon.com/s/ref=lp_2342470011_nr_n_3?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A2204518011%2Cn%3A2342470011%2Cn%3A2204523011&bbn=2342470011&ie=UTF8&qid=1394033592&rnid=2342470011", "text": "Backcountry Equipment", "department_url": "http://www.amazon.com/outdoor-gear/b/ref=sd_allcat_outrec/177-2158649-1745262?ie=UTF8&node=706814011", "description_title": "Backcountry Gear from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_706814011_nr_n_4?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A706814011%2Cn%3A2342470011&bbn=706814011&ie=UTF8&qid=1394033583&rnid=706814011", "keyword_count": {"amazoncom": 2, "backcountry": 5, "backcountry gear": 4}, "description_wc": 332, "description_text": "Backcountry skiing can be invigorating and challenging. If you like to rough it in the wild, you need a special arrangement of tools and supplies to keep you and your buddies safe. Amazon.com carries many different kinds of backcountry gear so you can be fully equipped the next time you hit the trail. We have everything you need to prepare yourself for your next expedition, including backcountry gear made for avalanche safety. We have a variety of beacons and transceivers to choose from, made from reliable and sturdy materials so you can find others or be found in the event of an avalanche. The displays can tell you the distance to the buried skier and the relative position of the skier within the snow. We carry beacons and transceivers from such trusted brands as Pieps, Ortovox, and Mammut. We also carry a wide variety of quickly assembling and disassembling snow probes to help you in your search. We also have a wide variety of backcountry gear to help you get up to the right slope. Our attachable cleats will give you the traction to climb even packed-down, slick snow to get you to your desired altitude. If you\u2019re climbing in your skis, we also have many climbing skins to make your trek a little easier. Climbing skins attach to the bottom of your skis so they can slide forward easily, but provide friction if they slide backwards, making it easier to find traction when you\u2019re climbing up slopes. If you\u2019re looking for a sturdy and reliable snow shovel, we carry those, too. Choose from lightweight folding models that are easy to carry with you, or heavy-duty snow shovels that can really move some snow. We even have models that come with saws or have saw teeth built into the shovel design to make this the ultimate, all-purpose survival tool. Find all the backcountry gear you need to keep you and your ski partners safe at Amazon.com.", "parent_text": "Skiing", "keyword_density": {"amazoncom": "0.6", "backcountry": "1.5", "backcountry gear": "2.4"}, "department_id": 130},
{"department_text": "Outdoor Gear", "nr_products": "1026", "level": -1, "url": "http://www.amazon.com/s/ref=lp_2342470011_nr_n_1?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A2204518011%2Cn%3A2342470011%2Cn%3A2342473011&bbn=2342470011&ie=UTF8&qid=1394033592&rnid=2342470011", "text": "Cross-Country Skiing", "department_url": "http://www.amazon.com/outdoor-gear/b/ref=sd_allcat_outrec/177-2158649-1745262?ie=UTF8&node=706814011", "description_title": "Cross-Country Skiing from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_706814011_nr_n_4?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A706814011%2Cn%3A2342470011&bbn=706814011&ie=UTF8&qid=1394033583&rnid=706814011", "keyword_count": {"amazoncom": 2, "skiing": 8, "cross country skiing": 7}, "description_wc": 325, "description_text": "Cross-country skiing originated in what is now Scandinavia during prehistoric times as a way for people to navigate large snow fields quickly and safely, and even as a method of hunting large game. As the necessity of skiing gave way to newer modes of transportation, more and more people started cross-country skiing as a relaxing and scenic hobby. Today, the tradition continues, and the popularity of the sport is greater than ever. Much like snowshoeing, the difficult of cross-country skiing is determined by the terrain. Beginners can enjoy a relatively mellow day of gliding over flat land without too much experience or practice, while old pros can challenge themselves to conquer hillier, more difficult areas. No matter how advanced you are, it\u2019s important to have equipment that matches your skill level. At Amazon.com, you\u2019ll find cross-country skiing gear for newcomers, intermediate athletes, and experts alike. We offer cross-country skiing equipment from popular brands like Salomon, Fischer, and Alpina, so no matter what you prefer, there\u2019s a set of skis to fit your style and budget. Shopping online with Amazon.com makes it easy to compare similar products and to choose a pair of skis with all the features you want. Detailed product descriptions often have information about important specifications like width, camber, sidecut, and flex to help you make the best decision for your needs. You can find cross-country skiing poles in the perfect length and material quickly and easily. Are you looking for 145 centimeter carbon fiber poles from Fischer? Simply choose the specifications you\u2019re interested in, and we\u2019ll display products that fit your criteria. Our search tools will help you find boots and bindings, as well. Cross-country skiing is one of the world\u2019s favorite ways to enjoy the scenic beauty of winter time. Glide through a snowy forest peacefully, and take in the sights and sounds of nature as you go.", "parent_text": "Skiing", "keyword_density": {"amazoncom": "0.6", "cross country skiing": "6.5", "skiing": "2.5"}, "department_id": 130},
