{"department_text": "Hunting & Fishing", "nr_products": "7734", "level": -1, "url": "http://www.amazon.com/s/ref=sr_nr_n_4?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A706813011%2Cn%3A3294115011%2Cn%3A3395161&bbn=3294115011&ie=UTF8&qid=1394033591&rnid=3294115011", "text": "Airsoft Guns & Rifles", "department_url": "http://www.amazon.com/Hunting-Fishing/b/ref=sd_allcat_hntfsh/177-2158649-1745262?ie=UTF8&node=706813011", "description_title": "Airsoft Guns from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_706813011_nr_n_0?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A706813011%2Cn%3A3294115011&bbn=706813011&ie=UTF8&qid=1394033583&rnid=706813011", "keyword_count": {"airsoft guns": 5, "amazoncom": 3, "airsoft": 7, "guns": 11}, "description_wc": 317, "description_text": "Airsoft guns are just what you need if you've been planning to improve your accuracy or power up your pellet playtime. Whether you're heading out to the shooting range or having a pellet-popping party to celebrate a special event, Amazon's airsoft gun collection is sure to have just what you've been looking for. Amazon.com offers a wide selection of guns, including pistols, rifles, and shotguns. Whether you are just hoping to shoot a few pellets for a good time with your friends or interested in competing professionally in a shooting sport, these products offer the low-power accuracy you need. We are pleased to offer an assortment of airsoft guns to meet your requirements. Whether you're better with handguns, full-size guns, revolvers, pump guns, or air bazookas, there's something for you at Amazon. We are proud to offer everything from automatic electric guns, capable of spraying BBs at 300 rounds a second, to single-shot bolt-action sniper rifles. Recreate WWII battles such as Carentan or the assault on Brecourt manor using classic-looking weapons, or practice modern-day assaults with the latest battlefield assault rifle lookalikes and SMGs. Whatever genre you like to play, you'll find something to love 