{"department_text": "Hunting & Fishing", "nr_products": "14523", "level": -1, "url": "http://www.amazon.com/s/ref=lp_3412851_nr_n_5?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A706813011%2Cn%3A3412851%2Cn%3A4200781&bbn=3412851&ie=UTF8&qid=1394033591&rnid=3412851", "text": "Gun Accessories", "department_url": "http://www.amazon.com/Hunting-Fishing/b/ref=sd_allcat_hntfsh/177-2158649-1745262?ie=UTF8&node=706813011", "description_title": "Gun Parts from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_706813011_nr_n_3?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A706813011%2Cn%3A3412851&bbn=706813011&ie=UTF8&qid=1394033583&rnid=706813011", "keyword_count": {"gun": 9, "gun parts": 7}, "description_wc": 316, "description_text": "Gun parts and accessories designed for accuracy can help you achieve greater precision and consistency at the range, while convenient accessories make it easier to transport, set up, and use your firearms. We offer a range of gun parts designed to make your firearms easier and safer to handle. Grips, stocks, and carrying accessories can increase usability, while also enhancing the overall look of your rifle or shotgun. Ergonomic foregrips help even out the load while walking and provide crucial stability when aiming. Stocks with enhanced grip and additional rail mount positions provide a greater degree of utility. For pistols, gun parts like magazine extensions can improve grip and stability. You can save time preparing to visit the range with convenient gun parts and accessories like magazine loaders for rifles and automatic pistols, and speed loaders for revolvers. Your thumbs will thank you after you load a few dozen rounds with a loader instead of having to insert each round one by one. We offer other gun parts designed for comfort and convenience, such as recoil pads, ammo holders, and shooting rests. No matter what style of shooter you are, you can find gun parts to enhance your experience at the range. Precision long-distance shooters will find a range of monopods and bipods for enhanced accuracy. Adjustable models can be fine-tuned to suit anybody\u2019s posture and grip, to help them achieve tighter groups, and to achieve more consistent results. Many bipods attach directly to picatinny rails, so you can install or remove them quickly and easily for different kinds of shooting. If your rifle or shotgun isn\u2019t equipped with a rail, you can upgrade your stock with a unit that has built-in mounting brackets. Make it easier and faster to set up at the range, and work to improve your accuracy with gun parts and accessories to enhance performance and convenience.", "parent_text": "Hunting", "keyword_density": {"gun": "2.8", "gun parts": "4.4"}, "department_id": 131},
