{"department_text": "Hunting & Fishing", "nr_products": "1235", "level": -1, "url": "http://www.amazon.com/s/ref=lp_3412851_nr_n_3?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A706813011%2Cn%3A3412851%2Cn%3A3413551&bbn=3412851&ie=UTF8&qid=1394033591&rnid=3412851", "text": "Game & Trail Cameras", "department_url": "http://www.amazon.com/Hunting-Fishing/b/ref=sd_allcat_hntfsh/177-2158649-1745262?ie=UTF8&node=706813011", "description_title": "Hunting Game Cameras from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_706813011_nr_n_3?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A706813011%2Cn%3A3412851&bbn=706813011&ie=UTF8&qid=1394033583&rnid=706813011", "keyword_count": {"hunting": 7, "game cameras": 4, "cameras": 6, "amazoncom": 2, "hunting game": 3, "game": 6, "hunting game cameras": 2}, "description_wc": 236, "description_text": "People have engaged in hunting as both a hobby and a way to find food for thousands of years. Whether you're new to the pastime or an experienced hunter, you'll find that hunting game cameras enable you to hunt more efficiently and effectively than you could on your own. Today's modern technology has led to significant advances in hunting, and Amazon.com offers some of the top products and brands designed to help you save time and increase your success rate. Need to set up a hunting game camera that meets your needs? Whether you want to catch a glimpse of that nocturnal trophy deer, or the critters roaming your backyard at night, we have the game cameras you need to spot your prey. We offer a huge selection of game cameras from manufacturers like Bushnell and Moultrie. Looking to plan your hunting expeditions more effectively? Consider using a game camera. These small, wireless cameras can be mounted inconspicuously in trees, along trails, or in any other location inhabited by wildlife. We offer a selection of cameras with added features like audio output, infrared motion sensors, or extended battery life from brands like BuckEye Cam and Stealth that will provide you with better results. When done responsibly, hunting can be a rewarding and enriching pastime. When you are looking to up your hunt, turn to Amazon.com for a full range of hunting game cameras.", "parent_text": "Hunting", "keyword_density": {"hunting": "3.0", "game cameras": "3.4", "cameras": "2.5", "amazoncom": "0.8", "hunting game": "2.5", "game": "2.5", "hunting game cameras": "2.5"}, "department_id": 131},
{"department_text": "Hunting & Fishing", "nr_products": "1037", "level": -1, "url": "http://www.amazon.com/s/ref=lp_3412851_nr_n_11?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A706813011%2Cn%3A3412851%2Cn%3A13280261&bbn=3412851&ie=UTF8&qid=1394033591&rnid=3412851", "text": "Hunting Dog Equipment", "department_url": "http://www.amazon.com/Hunting-Fishing/b/ref=sd_allcat_hntfsh/177-2158649-1745262?ie=UTF8&node=706813011", "description_title": "Hunting Dog Equipment from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_706813011_nr_n_3?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A706813011%2Cn%3A3412851&bbn=706813011&ie=UTF8&qid=1394033583&rnid=706813011", "keyword_count": {"hunting dog equipment": 2, "hunting": 7, "dog": 12, "equipment": 3, "amazoncom": 2, "hunting dog": 5, "hunting dog equipment from amazoncom": 1}, "description_wc": 226, "description_text": "Sitting in the woods to hunt can be a long and daunting task, but all hunters know that the right supplies can help their hunting dogs track animals more quickly. On Amazon.com, you will find the hunting dog equipment that meets your needs. Training your new hunting dog can be a lot of work, but with items like a yard-training collar from our Dog Hunting Equipment Store, you'll find it much easier. Our store also has training whistles and advanced collars that will allow your dog to explore further without running away. We even have training pheasants that you can use to train your dog to fetch animals once they've fallen. If you're hiking a long distance, you might need to bring some additional supplies with you for the trip. Bowls for water, dog food, and other items can be placed in saddle bags that are especially designed for dogs. This way, your hunting dog can carry his own supplies, making it easier for you to get where you want to go without the extra weight. To keep your dog safe, you should also look into the safety vests we offer to keep him visible. Hunting can be a bonding experience for you and your compagnion. We hope you have an exciting trip with your dog with hunting dog equipment from Amazon.com.", "parent_text": "Hunting", "keyword_density": {"hunting dog equipment": "2.7", "hunting": "3.1", "dog": "5.3", "equipment": "1.3", "amazoncom": "0.9", "hunting dog": "4.4", "hunting dog equipment from amazoncom": "2.2"}, "department_id": 131},
