{"department_text": "Hunting & Fishing", "nr_products": "7460", "level": -1, "url": "http://www.amazon.com/s/ref=lp_3395321_nr_n_0?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A706813011%2Cn%3A3395321%2Cn%3A3291168011&bbn=3395321&ie=UTF8&qid=1394033591&rnid=3395321", "text": "Accessories", "department_url": "http://www.amazon.com/Hunting-Fishing/b/ref=sd_allcat_hntfsh/177-2158649-1745262?ie=UTF8&node=706813011", "description_title": "Archery Accessories from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_706813011_nr_n_1?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A706813011%2Cn%3A3395321&bbn=706813011&ie=UTF8&qid=1394033583&rnid=706813011", "keyword_count": {"archery": 7, "archery accessories": 6, "accessories": 7, "archery accessories from amazoncom": 2}, "description_wc": 301, "description_text": "Historically used for hunting and combat, archery is the art of propelling arrows with the use of a bow. It\u2019s also a popular recreational activity. Now you can take aim and hit the bull\u2019s-eye every time with the right archery accessories from Amazon.com. Almost as important as the bow and arrows themselves, archery accessories will help you stay on target with practicing and training, whether you\u2019re on your way to a national tournament or a bow hunt in the woods. From bow maintenance accessories to replacement bowstrings to protective gear, we offer a wide range of gear so you can outfit yourself or your budding bowman. As your bow ages, bow maintenance and repairs can help increase the longevity of your investment, while improving its accuracy and performance. Archery accessories like string wax, whiskers, and other lubricants can help smooth your bowstring and reduce noise. We also carry a wide selection of replacement bowstrings for the type of bow and weight you might have, from recurve to longbow to compound. Other archery accessories like kisser buttons and nocking points can help increase the accuracy of your shooting. Protective archery accessories like arm guards, finger tabs, and gloves can help keep your body safe from snapping strings. A combination of the three helps shield your vulnerable skin and reduce the risk of injury. When arm guards are worn on the forearm facing the bow, they prevent snap-back from strings. Sturdy and durable finger tabs make it easier to hold the force and weight of a draw for as long as you need to aim and shoot. Full and partial gloves help reinforce your grip while shielding more skin than finger tabs. When you select archery accessories from Amazon.com, you will \u201calways have an arrow in your quiver.\u201d", "parent_text": "Archery", "keyword_density": {"archery": "2.3", "archery accessories": "4.0", "accessories": "2.3", "archery accessories from amazoncom": "2.7"}, "department_id": 131},
