{"department_text": "Hunting & Fishing", "nr_products": "7571", "level": -1, "url": "http://www.amazon.com/s/ref=lp_3222111011_nr_n_9?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A706813011%2Cn%3A3222111011%2Cn%3A3222119011&bbn=3222111011&ie=UTF8&qid=1394033590&rnid=3222111011", "text": "Tactical Knives", "department_url": "http://www.amazon.com/Hunting-Fishing/b/ref=sd_allcat_hntfsh/177-2158649-1745262?ie=UTF8&node=706813011", "description_title": "Tactical Knives from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_706813011_nr_n_4?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A706813011%2Cn%3A3222111011&bbn=706813011&ie=UTF8&qid=1394033583&rnid=706813011", "keyword_count": {"tactical knives from amazoncom": 1, "tactical knives": 4, "amazoncom": 2, "knives": 12, "tactical": 5}, "description_wc": 327, "description_text": "You never know when you may need a good knife. Whether you're cutting rope at a campsite, cutting straps for horse tack or opening a package, Amazon.com has a wide selection of tactical knives available to fit those needs. Our tactical knives come in a variety of sizes. There are small 2-inch folding tanto knives that you can carry in a pocket or a bag, as well as large 18-inch military machetes that can be strapped to a backpack. The variety allows you to buy a knife that best suits its intended use. Smaller knives may be most appropriate for general use around the home or campsite, while larger knives such as the machete might be more suited for long hikes through the wilderness or clearing unkempt yards. Tactical knives also come in a variety of styles. Folding knives are easiest to carry, with the blade safely secured within the knife's handle. Some folding knives even come with a convenient opening hole placed on the blade to allow for single-handed opening. Boot knives are slightly longer and allow you to keep the knife within easy reach while concealed from view. Larger hunting knives can be strapped onto a belt for quick unconcealed access, allowing you to keep a blade close by on hunting, camping or hiking trips. We take pride in making sure that whatever your needs are in a tactical knife, we carry a blade to cover them. We also carry knife accessories. There are polishing cloths available that can remove scuff marks, scratches, stains or corrosion from the knife blade. You'll also find sheathes to fit your knives, whether you're carrying a boot knife, bowie knife or machete. When you need a knife, you're likely to need it immediately. With tactical knives from Amazon.com, you can choose a knife that you'll be able to keep at your side continuously, ready for use whenever the need arises.", "parent_text": "Tactical & Duty", "keyword_density": {"tactical knives from amazoncom": "1.2", "tactical knives": "2.4", "amazoncom": "0.6", "knives": "3.7", "tactical": "1.5"}, "department_id": 131},
