{"department_text": "Cycling", "nr_products": "1452", "level": 0, "url": "http://www.amazon.com/s/ref=lp_3403201_nr_n_10?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A3403201%2Cn%3A3404251&bbn=3403201&ie=UTF8&qid=1394033582&rnid=3403201", "text": "Footwear", "department_url": "http://www.amazon.com/cycling-bikes-bicycles-bike-sale/b/ref=sd_allcat_bike/177-2158649-1745262?ie=UTF8&node=3403201", "description_title": "Cycling Shoes from Amazon.com", "parent_url": "http://www.amazon.com/cycling-bikes-bicycles-bike-sale/b/ref=sd_allcat_bike/177-2158649-1745262?ie=UTF8&node=3403201", "keyword_count": {"amazoncom": 2, "cycling": 7, "shoes": 11, "cycling shoes": 6, "cycling shoes from amazoncom": 1}, "description_wc": 321, "description_text": "Riding a bike with your boots or sneakers isn\u2019t ideal. Boots are too heavy and bulky, so they end up getting scuffed against the sides of your bicycle, and sneakers don\u2019t offer the right support. Amazon.com offers a variety of cycling shoes to make sure you have the right equipment to keep the power in your pedal. Cycling shoes have the benefit of stiffer soles, so they\u2019re easy to slide into foot holsters. They also enhance the comfort of your feet on long rides because they don\u2019t bend as much and don\u2019t put all of the pressure on the balls of your feet. Many of our models even lock onto special pedals as well, so they\u2019re ideal for longer trips and adventures. We also offer many cycling shoes that are purpose-built for specific applications. Shoes for road bikes are stiffer than most and offer lightweight, breathable designs so that when you\u2019re pedaling down the raceway, your feet can stay cool. Mountain bike cycling shoes are not quite as stiff, but they still offer much more support than regular sneakers. They also come with enough traction, so if you decide to get off of your bike in the middle of the woods, they still offer support and balance for a short hike. Casual cycling shoes are great all-around shoes. They aren\u2019t quite as stiff as mountain bike shoes, but they\u2019re enough to make your commute much more comfortable on your feet. Because they\u2019re built to be general-use shoes, they\u2019re also ideal for walking around streets, offices, and coffee shops between bike trips. That way you won\u2019t have to bring an extra pair of shoes to work when you commute. Every sport needs the proper equipment, and bicycling is no different. When you select cycling shoes from Amazon.com, you can see the difference they make to your ride.", "parent_text": "Cycling", "keyword_density": {"amazoncom": "0.6", "cycling": "2.2", "shoes": "3.4", "cycling shoes": "3.7", "cycling shoes from amazoncom": "1.2"}, "department_id": 132},
