{"department_text": "Cycling", "nr_products": "16966", "level": 0, "url": "http://www.amazon.com/s/ref=lp_3403201_nr_n_17?rh=n%3A3375251%2Cn%3A%213375301%2Cn%3A3403201%2Cn%3A6389526011&bbn=3403201&ie=UTF8&qid=1394033582&rnid=3403201", "text": "Bike Trainers & Accessories", "department_url": "http://www.amazon.com/cycling-bikes-bicycles-bike-sale/b/ref=sd_allcat_bike/177-2158649-1745262?ie=UTF8&node=3403201", "description_title": "Bicycle Trainers from Amazon.com", "parent_url": "http://www.amazon.com/cycling-bikes-bicycles-bike-sale/b/ref=sd_allcat_bike/177-2158649-1745262?ie=UTF8&node=3403201", "keyword_count": {"amazoncom": 2, "bicycle trainers": 5, "bicycle trainers from amazoncom": 1, "trainers": 8}, "description_wc": 285, "description_text": "When it comes to cycling, there\u2019s always room for more conditioning. Since your body is your prime tool for getting where you need to be, you want it in tip-top shape. Whether you\u2019re training for ironman events or you\u2019d just like to fit in a long ride while watching a movie, you can find indoor stationary bikes, equipment, and bicycle trainers that meet your needs at Amazon.com. To help you sustain the best in fitness, we offer a variety of bicycle trainers like resistance trainers, rollers, and trainer accessories from quality brands like CycleOps, Kinetic by Kurt, Tacx, and more. Risers, rings, and blocks with multiple levels allow you to add resistance to your training so you\u2019re pedaling at an optimal level. Whether you\u2019re training indoors in the off season or you want to warm up your muscles pre-race, you can find a wide variety of bicycle trainers for your needs from among our selection. Wind trainers create resistance using the air, so they can add a bit of noise to your routine. Magnetic trainers use magnets and fluid bicycle trainers use chambers filled with liquid to create resistance, so both are less noisy but can be pricier. Depending on your requirements, you might choose a cutting-edge fluid trainer or you might find that a traditional wind trainer suits your needs. To help you budget, we offer convenient price and discount filters so you can zoom away with the power you need. Pushing your limits doesn\u2019t mean you have to navigate busy city streets or torrential winds to get in shape. When you choose bicycle trainers from Amazon.com, we\u2019ll help you gear up with ease.", "parent_text": "Cycling", "keyword_density": {"amazoncom": "0.7", "bicycle trainers": "3.5", "bicycle trainers from amazoncom": "1.4", "trainers": "2.8"}, "department_id": 132},
