{"department_text": "Toys & Games", "level": 1, "url": "http://www.amazon.com/toys/b/ref=sd_allcat_tg/177-2158649-1745262?ie=UTF8&node=165793011", "text": "Toys & Games", "department_url": "http://www.amazon.com/toys/b/ref=sd_allcat_tg/177-2158649-1745262?ie=UTF8&node=165793011", "description_title": "Amazon Toys: More Than Your Average Toy Store", "keyword_count": {"toy store": 2, "toy": 10, "amazon": 1, "store": 6, "toys": 7}, "description_wc": 237, "description_text": "Amazon's Toys & Games Store features thousands of products, including dolls, action figures, games and puzzles, hobbies, models and trains, and much more. You can shop by age, favorite brands, new products, and best sellers. The Preschool Store features learning and educational toys, activity toys, ride-ons, kitchens, and more for the infant or toddler in your life. The Boys' Toy Store showcases all the best in action figures, hobbies, construction, blasters, and outdoor play. The Girls' Toy Store is perfect if you're looking for dolls, plush, dollhouses, and pretend play. Our Games & Puzzles Store showcases the latest in specialty board games, card games, jigsaw puzzles, and more. For the hobby enthusiast we carry everything needed for model building, trains, radio-control vehicles, rocketry, and more. For everyday savings on a wide selection of toys, games, and hobby items, visit our Outlet Store . Our new releases section features the latest products added to our selection, while our best sellers showcase toys and games that are most popular with our customers. Looking for toys and games from your favorite brands in one location? Our featured-brands section showcases entire product selections from top brands, including LEGO , Mattel , Hasbro , Fisher-Price , LeapFrog , and Melissa & Doug , as well as a huge selection of specialty toy brands such as Plan Toys , Bruder , Playmobil , Sprig , Hape , and much more.", "parent_text": "Toys, Kids, Baby", "keyword_density": {"toy store": "1.8", "toy": "4.4", "amazon": "0.4", "store": "2.7", "toys": "3.1"}, "department_id": 114},
{"department_text": "Baby Clothing", "nr_products": 71952, "level": 1, "url": "http://www.amazon.com/l/2402554011/ref=sd_allcat_bc/177-2158649-1745262", "text": "Baby Clothing", "department_url": "http://www.amazon.com/l/2402554011/ref=sd_allcat_bc/177-2158649-1745262", "description_title": "Baby Clothes from Amazon.com", "keyword_count": {"baby clothes": 7, "baby": 11, "amazoncom": 4, "baby clothes from amazoncom": 1}, "description_wc": 307, "description_text": "Dressing up your little one should offer convenience and comfort, so Amazon.com has combed the wide world of baby clothes to offer soft, playful, and totally kid-friendly threads worth loving. From bodysuits and rompers to dresses and suits sets, we offer baby clothes for all sorts of little ones. With our easy-to-browse search categories for baby girls, baby boys, and unisex baby clothes, choosing the right wardrobe for your mini marvel is quick and painless. You can narrow your search by size, silhouette style, and even by price. And because we know that comfort and convenience is premium for baby, we've gathered quality baby clothes from name brands like Absorba, Zutano, Calvin Klein, and many more. We feature handy baby clothes categories so you can choose from sets or separates. You can doll up your little lady with dress sets that come complete with diaper covers and crochet headbands, or you can sharpen your little man's look with a one-piece romper complete with pull-on elastic waistband pants. And because you might want to take your little one to the pool for some summer fun, we've even got swim sets complete with diaper seams. From ruffles to rough-and-tumble, Amazon.com offers baby clothing suited for your preferences, whether it's a twirl-worthy tutu, an adventure-ready tee, a novelty bodysuit, a classic puff-sleeve top, or an organic fabric. If your baby clothes don't exactly fit your needs, you can easily return them with our free shipping and free returns on eligible items. Lap necks, snap closures, and elastic waistbands all add ease to your life?shopping at Amazon.com offers another convenience. Thanks to the wide selection of baby clothes from Amazon.com, snapping a little one into comfort is as easy as the click of a button.", "parent_text": "Toys, Kids, Baby", "keyword_density": {"baby clothes": "4.6", "baby": "3.6", "amazoncom": "1.3", "baby clothes from amazoncom": "1.3"}, "department_id": 117},
{"level": 1, "url": "http://www.amazon.com/clothing-accessories-men-women-kids/b/ref=sd_allcat_apr/177-2158649-1745262?ie=UTF8&node=1036592", "text": "Clothing", "department_url": "http://www.amazon.com/clothing-accessories-men-women-kids/b/ref=sd_allcat_apr/177-2158649-1745262?ie=UTF8&node=1036592", "description_wc": 0, "parent_text": "Clothing, Shoes, Jewelry", "department_text": "Clothing", "department_id": 122},
{"department_text": "Video Games for Kids", "nr_products": 41447, "level": 1, "url": "http://www.amazon.com/Kids-Family/b/ref=sd_allcat_cvg/177-2158649-1745262?ie=UTF8&node=471306", "text": "Video Games for Kids", "department_url": "http://www.amazon.com/Kids-Family/b/ref=sd_allcat_cvg/177-2158649-1745262?ie=UTF8&node=471306", "description_title": "Family Friendly Games from Amazon.com", "keyword_count": {"amazoncom": 4, "games": 7, "friendly": 2, "family": 4}, "description_wc": 270, "description_text": "Apps for Android Bring your family together for some wholesome, good-natured fun with kid-friendly video games. Host monthly teen video game nights and begin a hip, new routine that your gadget-loving family will treasure. Not only do children\u2019s games provide entertainment, but they also teach and inspire, which is why Amazon.com makes it decidedly easy to search for products that appeal to everyone. Want to surprise the kids with the newest and the best? Amazon.com carries a huge collection of games for the handheld PlayStation Vita and Nintendo 3DS, including Super Mario Bros. 2, Angry Birds Trilogy, the Legend of Zelda, Disney Epic Mickey 2, and LittleBigPlanet Karting . These games will encourage children to think with their heads and not just their fingers. We pride ourselves in providing quality entertainment for gamers of all ages and a user-friendly search layout that any family member can navigate. Looking for age-appropriate titles for the wee gamers in your life? Amazon.com\u2019s games for children include releases for the Wii, PlayStation 3, Xbox 360, and PC and Mac. For on-the-go play, Disney Apps for Android , such as Where\u2019s My Perry? and Where\u2019s My Water?, offer a portable and simple gaming experience that will keep your children busy. Shake up your normal routine by searching for best sellers and pre-orders the entire family can enjoy. Imaginative and educational children\u2019s games inspire kids to dream big and think big. Make the most of this learning opportunity and help young minds flourish with video games that entertain and inform from Amazon.com.", "parent_text": "Toys, Kids, Baby", "keyword_density": {"amazoncom": "1.5", "games": "2.6", "friendly": "0.7", "family": "1.5"}, "department_id": 118},
