{"department_text": "Wine", "nr_products": 11918, "level": 1, "url": "http://www.amazon.com/Wine-Red-White-Sparkling-Dessert-Rose/b/ref=sd_allcat_wine/177-2158649-1745262?ie=UTF8&node=2983386011", "text": "Wine", "department_url": "http://www.amazon.com/Wine-Red-White-Sparkling-Dessert-Rose/b/ref=sd_allcat_wine/177-2158649-1745262?ie=UTF8&node=2983386011", "description_title": "Wine", "keyword_count": {"wine": 48}, "description_wc": 388, "description_text": "Amazon Wine is an ideal place to buy wine online, offering a vast selection of wines from iconic brands to enthusiast favorites. Learn about wine by hearing directly from the winemaker about winemaking techniques, wine tasting notes, vineyard details, and wine pairing suggestions. Become a wine connoisseur of your own right by discovering the best wine for your taste preferences, whether it\u2019s dry wines or sweet wines, and by reading wine reviews by other customers. Use our simple filters to sort by type, such as red wine, white wine, ros\u00e8 wine, sparkling wine, and dessert wine. Also, narrow down your choices by wine rating or price, to help you buy the perfect wine for any occasion, whether you are looking for a fine wine or an everyday wine. Examine wine labels online to help you make perfect food and wine pairings or just read wine quotes directly from the winemaker. In our wine store, you can browse through different regions to discover wines from California, Washington, Oregon, and more. Featured wine country regions include Napa Valley, Sonoma, Paso Robles, Walla Walla, Red Mountain, and Willamette Valley. Wine gifts are a popular crowd pleaser during the holidays, and Amazon\u2019s wide selection of wine bottles and gift accessories can help you create wonderful combinations for wine gift baskets that will be loved by friends and family members alike. Or you can choose a unique wine bottle from your favorite vintage to stock your loved ones wine cellars and wine racks. You can also browse our selection of wine glasses, wine openers, wine books, glass markers and more to add something extra special. If you\u2019re an aficionado of red wines, we have just the selection for you, from dry red wine to sweet red wine across multiple varieties. Browse through many varieties of red wines, such as Cabernet Sauvignon, Pinot Noir, Merlot, Malbec, Sangiovese, Syrah, Zinfandel, Cabernet Franc, Tempranillo, and Greneche. Or, if you can\u2019t get enough of delicious white wines, we have a broad selection to choose from whether you prefer a dry white wine or sweet white wine. Browse through many varieties of white wines, such as Chardonnay, Moscato, Pinot Grigio, Pinot Gris, Riesling, Sauvignon Blanc, Semillon, and Viognier. We\u2019ve got great sparkling wine and dessert wine, too, which are perfect for special occasions.", "parent_text": "Beauty, Health, Grocery", "keyword_density": {"wine": "12.4"}, "department_id": 111},
