{"department_text": "Grocery & Gourmet Food", "nr_products": "83733", "level": 0, "url": "http://www.amazon.com/s/ref=lp_16310101_nr_n_6?rh=n%3A16310101%2Cn%3A%2116310211%2Cn%3A16322721&bbn=16310211&ie=UTF8&qid=1394033619&rnid=16310211", "text": "Snack Foods", "department_url": "http://www.amazon.com/grocery-breakfast-foods-snacks-organic/b/ref=sd_allcat_gro/177-2158649-1745262?ie=UTF8&node=16310101", "description_title": "Snack Foods from Amazon.com", "parent_url": "http://www.amazon.com/grocery-breakfast-foods-snacks-organic/b/ref=sd_allcat_gro/177-2158649-1745262?ie=UTF8&node=16310101", "keyword_count": {"snack foods from amazoncom": 1, "amazoncom": 2, "snack": 11, "foods": 7, "snack foods": 6}, "description_wc": 363, "description_text": "From offering hungry partygoers bite-sized bites for those between-conversation pauses to giving little ones healthy options while out at the park or the zoo, snack foods can feed everyone. When you\u2019re in a pinch between lunch and dinner and need something to tide you over, you can grab everything from healthy fruit snacks to sweet cookies and savory and salty chips. Amazon.com offers a wide selection of snack foods to give you a little pick-me up when you need it most. Whether you\u2019re not in the mood to cook or are out and need to boost your blood sugar, you can choose snack foods in a whole variety of flavors and types. Our selection includes everything from applesauce, fruit cups, breadsticks, chips and crisps, cookies, crackers, dried fruit and raisins, fruit leather, fruit snacks, granola and trail mix bars, ice cream cones and toppings, jerky and dried meats, nuts and seeds, party mix, popcorn, pork rinds, pretzels, pudding and gelatin, puffed snacks, rice cakes, rice crackers, salsas, dips, and spreads, trail mix, wasabi peas, and more. When you crave snack foods but have special dietary needs, you might prefer a variety of specialty options. We offer everything from gluten-free, kosher, low-fat, sugar-free, vegan, nonfat, vegetarian, certified organic, and many more options. With quality brands like Nature Valley, Frito-Lay, Navitas Naturals, Popchips and Annie's Homegrown, you can shop for crispy, crunchy, and delicious options right from home. We even offer Subscribe & Save options to help you save 15% on eligible purchases, give you free shipping, and provide you with regularly scheduled deliveries of your favorite snack foods. As if our wide selection wasn\u2019t enough, our Recipe Center can help you discover quick and tasty recipes for dinner, desserts, snacks, and more. Plus, you can expand your search and browse our selection of beverages, coffee, breakfast foods, baking products, snacks, candy, baby food, pantry staples, gifts, and fresh flowers, and check off everything on your list thanks to our selection of groceries under $10. With snack foods from Amazon.com, you can bite into sweet, savory, and completely delicious pick-me ups of your choice.", "parent_text": "Grocery & Gourmet Food", "keyword_density": {"snack foods from amazoncom": "1.1", "snack": "3.0", "amazoncom": "0.6", "foods": "1.9", "snack foods": "3.3"}, "department_id": 108},
