{"department_text": "Baby", "nr_products": "71815", "level": 0, "url": "http://www.amazon.com/s/ref=sr_nr_n_0?rh=n%3A165796011%2Cn%3A%21165797011%2Cn%3A2402554011&bbn=165797011&ie=UTF8&qid=1394033618&rnid=165797011", "text": "Apparel & Accessories", "department_url": "http://www.amazon.com/baby-car-seats-strollers-bedding/b/ref=sd_allcat_ba/177-2158649-1745262?ie=UTF8&node=165796011", "description_title": "Baby Clothes from Amazon.com", "parent_url": "http://www.amazon.com/baby-car-seats-strollers-bedding/b/ref=sd_allcat_ba/177-2158649-1745262?ie=UTF8&node=165796011", "keyword_count": {"baby clothes": 7, "baby": 11, "amazoncom": 4, "baby clothes from amazoncom": 1}, "description_wc": 307, "description_text": "Dressing up your little one should offer convenience and comfort, so Amazon.com has combed the wide world of baby clothes to offer soft, playful, and totally kid-friendly threads worth loving. From bodysuits and rompers to dresses and suits sets, we offer baby clothes for all sorts of little ones. With our easy-to-browse search categories for baby girls, baby boys, and unisex baby clothes, choosing the right wardrobe for your mini marvel is quick and painless. You can narrow your search by size, silhouette style, and even by price. And because we know that comfort and convenience is premium for baby, we've gathered quality baby clothes from name brands like Absorba, Zutano, Calvin Klein, and many more. We feature handy baby clothes categories so you can choose from sets or separates. You can doll up your little lady with dress sets that come complete with diaper covers and crochet headbands, or you can sharpen your little man's look with a one-piece romper complete with pull-on elastic waistband pants. And because you might want to take your little one to the pool for some summer fun, we've even got swim sets complete with diaper seams. From ruffles to rough-and-tumble, Amazon.com offers baby clothing suited for your preferences, whether it's a twirl-worthy tutu, an adventure-ready tee, a novelty bodysuit, a classic puff-sleeve top, or an organic fabric. If your baby clothes don't exactly fit your needs, you can easily return them with our free shipping and free returns on eligible items. Lap necks, snap closures, and elastic waistbands all add ease to your life?shopping at Amazon.com offers another convenience. Thanks to the wide selection of baby clothes from Amazon.com, snapping a little one into comfort is as easy as the click of a button.", "parent_text": "Baby", "keyword_density": {"baby clothes": "4.6", "baby": "3.6", "amazoncom": "1.3", "baby clothes from amazoncom": "1.3"}, "department_id": 115},
