{"department_text": "Fine Art", "level": 1, "url": "http://www.amazon.com/b/ref=sd_allcat_fine_art/177-2158649-1745262?ie=UTF8&node=6685269011", "text": "Fine Art", "department_url": "http://www.amazon.com/b/ref=sd_allcat_fine_art/177-2158649-1745262?ie=UTF8&node=6685269011", "description_title": "Fine Art at Amazon.com", "keyword_count": {"art": 22, "fine art": 5}, "description_wc": 152, "description_text": "Welcome to our new Fine Art store featuring paintings, drawings, mixed media works, photography and art prints. From new artists to famous artists the Fine Art store features artworks and paintings for sale from a multitude of periods and styles including: Pop art, Abstract art, Modern art, Contemporary art, and much more. We focus on highlighting a wide variety of artists, painters, Contemporary artists, Renaissance artists, Modern and Post-Modern artists; find an artist that fits your style in our Fine Arts store. The Fine Arts store features many types of artwork including: canvas prints, abstract paintings, oil paintings, drawings, photography, mixed media works, and collages to add to your home, art gallery, professional workspace or other. As we continue to grow our collections of artworks, the Fine Arts store is sure to have something for everybody whether you are an experienced collector or looking to find your first piece of art.", "parent_text": "Home, Garden, Tools", "keyword_density": {"art": "14.5", "fine art": "6.6"}, "department_id": 94},
