{"department_text": "Patio, Lawn & Garden", "level": 1, "url": "http://www.amazon.com/Patio-Lawn-Garden/b/ref=sd_allcat_lp/177-2158649-1745262?ie=UTF8&node=2972638011", "text": "Patio, Lawn & Garden", "department_url": "http://www.amazon.com/Patio-Lawn-Garden/b/ref=sd_allcat_lp/177-2158649-1745262?ie=UTF8&node=2972638011", "description_title": "Lawn Equipment from Amazon.com", "keyword_count": {"lawn equipment from amazoncom": 1, "lawn": 7, "lawn equipment": 5, "amazoncom": 4}, "description_wc": 313, "description_text": "No matter what the weather is like, your garden and lawn is a great place to relax and take a break from your busy life. Amazon.com carries all sort of lawn equipment to make sure that the time you spend in your front or back yard is as comfortable and inviting as possible. We have a wide variety of lawn equipment to help you with any landscaping and gardening chores. Mowers, trimmers and blowers can make keeping lawns neat and tidy, conveying an extremely welcoming and open environment. Useful watering tools, like heavy-duty hoses and spray nozzles are essential for making sure that all of your garden flowers and veggies get the moisture they need. We also have lawn equipment to help with your gardening, such as pruning shears, spades and germination trays. Once you\u2019ve polished and perfected your front and back yard, it\u2019s time to host a barbeque, and Amazon.com carries everything you need to throw a great outdoor party. You can find propane, natural gas, and charcoal burning grills easily among our outdoor cooking supplies. For serious eats, try special smokers and fryers built especially for outdoor use to give your barbeque unique and unforgettable flavor. We also have the tongs, spatulas, grill scrapers and other outdoor cooking accessories to make grilling fun. Take advantage of the selection of lawn equipment Amazon.com has to help you entertain for your outdoor party. Patio chairs, swinging benches and even hammocks can make it easy to relax and enjoy the peace of your garden. When it gets cold, we have many different styles of outdoor heaters to keep you and your guests warm and cozy. When it gets warmer outside, our pool supplies will help you cool down and keep you ready for a season of wet summer fun. Prepare for the changing seasons with the diverse lawn equipment from Amazon.com.", "parent_text": "Home, Garden, Tools", "keyword_density": {"lawn equipment": "3.2", "lawn": "2.2", "lawn equipment from amazoncom": "1.3", "amazoncom": "1.3"}, "department_id": 93},
{"department_text": "Home Improvement", "nr_products": 6049718, "level": 1, "url": "http://www.amazon.com/Tools-and-Home-Improvement/b/ref=sd_allcat_hi2/177-2158649-1745262?ie=UTF8&node=228013", "text": "Home Improvement", "department_url": "http://www.amazon.com/Tools-and-Home-Improvement/b/ref=sd_allcat_hi2/177-2158649-1745262?ie=UTF8&node=228013", "description_title": "Tools & Home Improvement", "keyword_count": {"home": 6, "tools": 7, "home improvement": 3}, "description_wc": 372, "description_text": "Amazon.com's Tools and Home Improvement Store is an ideal spot for campers, carpenters, contractors, craft enthusiasts, electricians, home-owners, plumbers, tree-trimmers, woodworkers, and those who just want to restock or expand their tool collection or start some serious home repairs. If you've decided to remodel a living room or bathroom, for example, all the necessary fixtures are here, including ceiling fans, ENERGY STAR qualified lighting, lamps, light fixtures, recessed lighting, switches and outlets, and other illuminating items, as well as bathroom faucets, bathroom sinks, bidets, showerheads, toilets, toilet parts, water heaters, and water pumps. If your home repair involves becoming a bit more social there are door chimes and bells for any tastes, and as more people might be stopping by it's not a bad idea to stock up on paint, paint brushes, paint sprayers, solvents, stain, wall stickers and murals, and wallpaper. And to reach the right places, don\u2019t forget ladders and stepladders. Without the proper tools, however, it's probable that most projects aren't going to get done, or at least not be done well. Both tool newbies and hard-core contractors (and every tool collector in-between) can find the right hand tools and power tools here, helpful products such as drills, flashlights, routers, saws, and woodworking tools. To ensure the tools don\u2019t take over a room or garage, a tool organizer is a necessity. Once the project is done, don't forget to put on the finishing touches, the doorknobs and lock sets, garage doors, house numbers, mailboxes, and shelving. To make sure that your work stands strong and safe, remember to get fire safety products, other safety and security products, padlocks and hasps, safes, and security systems. No matter what home improvements or tool-related venture you're taking on, Amazon.com has the trustworthy brands delivering the helpful products you'll want, brands like 3M, Adesso, American Standard, Bosch, Bulbrite, Culligan, DEWALT, Dale Tiffany, Dremel, Elegant Lighting, Filtrete, Honeywell, InSinkErator, Kidde, Kohler, Kwikset, Leviton, Pfister, Roommates, and more. You'll also find a wide range of deals and special offers on tools and home improvement products in the Value Center. Now, all that's needed is deciding where to start.", "parent_text": "Home, Garden, Tools", "keyword_density": {"home": "1.6", "tools": "1.9", "home improvement": "1.6"}, "department_id": 98},
{"department_text": "Pet Supplies", "level": 1, "url": "http://www.amazon.com/pet-supplies-dog-cat-food-bed-toy/b/ref=sd_allcat_ps/177-2158649-1745262?ie=UTF8&node=2619533011", "text": "Pet Supplies", "department_url": "http://www.amazon.com/pet-supplies-dog-cat-food-bed-toy/b/ref=sd_allcat_ps/177-2158649-1745262?ie=UTF8&node=2619533011", "description_title": "Pet Supplies from Amazon.com", "keyword_count": {"pet": 20, "pet supplies": 6, "pet supplies from amazoncom": 1, "supplies": 7}, "description_wc": 343, "description_text": "Puppies, rabbits, kittens, parrots, rodents, lizards, fish, and other pets all have one thing in common: their humans love them. If you\u2019re bringing home a new pet, or if you\u2019re browsing for something new for an old family friend, we have all the pet supplies you need to ensure your pet\u2019s health and longevity. We have all the pet supplies and food you could need to ensure your critter\u2019s health. If your new little family member eats pellets, kibble, flakes, or veggies, we have what they love. We carry pet food from some of the most trusted names in pet nutrition, including Purina, Kaytee, Fancy Feast, and much more. Nutrition for pets is just as important as it is for us humans; their attitude and energy levels can drastically improve when they\u2019re getting the right vitamins, minerals, and proteins they need. The next step is to ensure your pet\u2019s hygiene. We carry cage liners for a variety of small pets and birds. They\u2019re much easier to deal with than traditional shredded newspaper and sawdust options, because these pet supplies are built to be especially absorptive. We also have kitty litter for cats, training supplies for dogs, and a wide variety of filters for fish. Whether your pet scurries, swims or squawks, make sure they have a clean environment to thrive in. Once you\u2019ve taken care of all the necessary pet supplies, it\u2019s time to get down to the fun part. Pet toys can make spending time with your furry, scaly, or feathered friend even more enjoyable than it already is. There are a variety of toys to enrich caged pets, and there are also balls, climbing structures, and chew toys for larger animals. If you filter your search for pet supplies by price, you can see the most affordable pet toys first, so you can afford to treat your pet to some extra love. Live your life to the fullest, and ensure your pets can do the same with the pet supplies from Amazon.com.", "parent_text": "Home, Garden, Tools", "keyword_density": {"pet": "5.8", "pet supplies": "3.5", "pet supplies from amazoncom": "1.2", "supplies": "2.0"}, "department_id": 96},
{"department_text": "Furniture & D\u00e9cor", "nr_products": 4273134, "level": 1, "url": "http://www.amazon.com/furniture-decor-rugs-lamps-beds-tv-stands/b/ref=sd_allcat_fd/177-2158649-1745262?ie=UTF8&node=1057794", "text": "Furniture & D\u00e9cor", "department_url": "http://www.amazon.com/furniture-decor-rugs-lamps-beds-tv-stands/b/ref=sd_allcat_fd/177-2158649-1745262?ie=UTF8&node=1057794", "description_title": "Furniture at Amazon.com", "keyword_count": {"furniture": 12}, "description_wc": 392, "description_text": "Amazon's Furniture & D\u00e9cor Store showcases an enormous array of styles for any room in the home. Furniture is what defines our living spaces and d\u00e9cor is what completes a home\u2019s atmosphere. It\u2019s so important that the pieces you choose serve your needs and work with your budget. To that end, we\u2019ve featured the main categories front and center: Bedroom Furniture , Mattresses , Living Room Furniture , Office Furniture , Home Entertainment Furniture , Dining Room Furniture , Kids\u2019 Furniture, and Rugs and Frames. Bedroom Furniture includes all the key pieces, plus the extras. We have Beds, Mattresses, Headboards, Dressers, Nightstands, Armoires, Bedding, Vanities, and complete Bedroom Sets. Whether you\u2019re outfitting the master bedroom, the kids\u2019 rooms, or the guestroom, all your bedroom furniture needs are covered here. Refine your search by material, color, price, brand name, and customer reviews. We make it easy to zero in on exactly what you want. We can help you furnish the Living Room and Home Office with form, function, and your wallet in mind. Amazon offers Sofas & Couches, Chairs, Ottomans, Tables, and complete Living Room Sets. With a click, you can choose by style, such as Casual, Contemporary, International, or Traditional. Refine by material, like wood, metal, fabric, leather, and more. The home office department contains Desks, Office Chairs, Bookcases and Cabinets, and much, much more to help you organize and become a master of efficiency. Form, Function, Efficiency\u2014these are all very worth striving for, but it\u2019s really the Home D\u00e9cor that gives a room its inviting atmosphere. We offer picture frames, area rugs, candles, clocks, curtains, decorative pillows, vases, and so much more to give a home your own personal touch and welcoming warmth. Kids\u2019 Furniture and Home Entertainment Furniture add fun and flair. Find dressers and bunk beds, desks and chairs, plus bookcases, cabinets and shelves, all sized to suit the wee ones. When the family\u2019s ready for home entertainment, it\u2019s great to have rooms set and ready with Television Stands, Audio-Video Shelving, Game Tables, Entertainment Armoires, and more. Your home is your nest and your launching pad. Your place for nourishment, rest, fun, and togetherness. Amazon wants it to be easy to shop for and find what you and your family need to create a comfortable and loving home.", "parent_text": "Home, Garden, Tools", "keyword_density": {"furniture": "3.1"}, "department_id": 90},
