{"department_text": "Arts, Crafts & Sewing", "nr_products": "29907", "level": 0, "url": "http://www.amazon.com/s/ref=lp_2617941011_nr_n_18?rh=n%3A2617941011%2Cn%3A%212617942011%2Cn%3A723469011&bbn=2617942011&ie=UTF8&qid=1394033636&rnid=2617942011", "text": "Party Decorations & Supplies", "department_url": "http://www.amazon.com/Arts-Crafts-Sewing/b/ref=sd_allcat_sch/177-2158649-1745262?ie=UTF8&node=2617941011", "description_title": "Party Decoration Supplies from Amazon.com", "parent_url": "http://www.amazon.com/Arts-Crafts-Sewing/b/ref=sd_allcat_sch/177-2158649-1745262?ie=UTF8&node=2617941011", "keyword_count": {"decoration": 6, "party": 8, "party decoration supplies": 5, "amazoncom": 2, "party decoration supplies from amazoncom": 1}, "description_wc": 322, "description_text": "When the invitations have been sent, the gifts prepared, and everything else under way, you can add vibrant and colorful party decoration supplies from Amazon.com to set a fun and joyful mood. From decorating kits and polka dot balloons to protective table covers and fantastic centerpieces, we have a wide variety of party decoration supplies to choose from. You're sure to find something that fits the theme and occasion of your next big event among our selection of banners and pennants. Our banners come with a variety of messages, including happy birthday, happy anniversary, bridal shower, and much more to match any party. Great for themed parties, birthdays, and kid celebrations, our strings of pennants come with pirate flags, heraldic symbols, and more. The iconic piece of anyone\u2019s party decoration supplies, everybody knows it isn't a party without balloons, and we have as many as you need to fill your rooms. Regular helium-quality balloons can be filled to stay afloat, blown up and taped to other decorations, or scattered around on the floor for kids to play with. We also have Mylar balloons that come in all sorts of fun sizes and shapes, including cartoon characters, animals, babies, pirate ships, and more. Your headquarters for party decoration supplies, you can find all the photo banners, inflatables, signs, streams, and more you need. Choose from table covers in many vibrant colors and with fantastic designs, such as tribal Hawaiian themes, movie characters, American flags, karate-fighters, and others. Our centerpieces make great eye-catching displays that can complete the festive look of your tables. Some are easily folded open to display beautiful designs, while others provide a sturdy base to hold candles and other accessories. Or try making your own by twisting balloons together for a unique and personal touch. Make sure your party is one to remember with Amazon.com\u2019s huge assortment of party decoration supplies and ideas.", "parent_text": "Arts, Crafts & Sewing", "keyword_density": {"decoration": "1.9", "party": "2.5", "party decoration supplies": "4.7", "amazoncom": "0.6", "party decoration supplies from amazoncom": "1.6"}, "department_id": 95},
