{"department_text": "Power & Hand Tools", "nr_products": 1027881, "level": 1, "url": "http://www.amazon.com/Power-Tools-and-Hand-Tools/b/ref=sd_allcat_hi/177-2158649-1745262?ie=UTF8&node=328182011", "text": "Power & Hand Tools", "department_url": "http://www.amazon.com/Power-Tools-and-Hand-Tools/b/ref=sd_allcat_hi/177-2158649-1745262?ie=UTF8&node=328182011", "description_title": "Power & Hand Tools", "keyword_count": {"tools": 20, "power hand tools": 2, "hand tools": 4, "power": 6, "hand": 6}, "description_wc": 415, "description_text": "Contractors, woodworkers, dry-wallers, builders, plumbers, roofers, and DIY enthusiasts all share one thing: they know that the right tool helps to get a job done right the first time. Having reliable tools held or plugged in creates an environment where work gets done quickly and safely and lets you attempt everything from simply hammering a nail to building a house. And having the right tool means picking out a tool from the right brand, a brand that understands your tool needs. At Amazon.com's Power & Hand Tools Store we have an unbeatable selection of power and hand tool brands, a list that includes top brands such as Bear Grylls Survival Knives, Black & Decker, Bosch, Delta, Denali, DEWALT, Dremel, Fein, Festool, Fluke, Hitachi, JET, Leatherman, Makita, Milwaukee, Porter-Cable, Rockwell Jawhorse, Stanley, and more. These brands have become trusted over time because of their expertise in a wide variety of power and hand tools. Within this long list of brands, you'll be able to find tools for all tasks, starting with the essential power tools for big projects, tools like drills, grinders, rotary tools, routers, saws, sanders, and shears and cordless drills, cordless saws, cordless impact drivers, cordless screwdrivers, and cordless nailers and staplers, and then moving into air tools such as air compressors, nailers, staplers, power sprayers, impact wrenches, sanders, and grinders. And if you're building a bookshelf or doing fine woodworking, you'll want to be sure you have the proper woodworking tools: measuring and layout tools, cutting tools, shaping tools, assembly, finishing tools, and project planning tools. You'll want to stock up on hand tools, multitools, knives, clamps, and wrenches because they come in handy in such a wide range of spots--job sites, camping, around-the-house emergencies, and more. While Amazon.com's Power & Hand Tools Store is focused on tools, tools can't work alone without the right accessories and support and safety products. Round out your workshop and tool collection with batteries, calipers, chargers, chalk lines, clamps, drill bits, dust collectors and air cleaners, ear protection, eye protection, fire extinguishers, gloves, jigs, hardhats, kneepads, levels, line lasers, marking tools, measuring wheels, mobile bases, router bits, rulers, saw blades, scanners and testers, stands, tape measures, tool storage, welding helmets, and workbenches. You'll also find a wide range of deals and special offers on building materials and supplies in the Value Center. Before long, you'll have the right tool and accessory any time you want it.", "parent_text": "Home, Garden, Tools", "keyword_density": {"hand tools": "1.9", "power hand tools": "1.4", "tools": "4.8", "power": "1.4", "hand": "1.4"}, "department_id": 99},
