{"department_text": "Furniture & D\u00e9cor", "nr_products": "44225", "level": -1, "url": "http://www.amazon.com/s/ref=lp_1063278_nr_n_1?rh=n%3A1055398%2Cn%3A%211063498%2Cn%3A1063278%2Cn%3A14087321&bbn=1063278&ie=UTF8&qid=1394033648&rnid=1063278", "text": "Artificial Flora", "department_url": "http://www.amazon.com/furniture-decor-rugs-lamps-beds-tv-stands/b/ref=sd_allcat_fd/177-2158649-1745262?ie=UTF8&node=1057794", "description_title": "Silk Flowers from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_1057794_nr_n_1?rh=n%3A1055398%2Cn%3A%2113900811%2Cn%3A%211063496%2Cn%3A%21251263011%2Cn%3A1057794%2Cn%3A1063278&bbn=1057794&ie=UTF8&qid=1394033642&rnid=1057794", "keyword_count": {"amazoncom": 2, "silk": 8, "flowers": 8, "silk flowers": 5}, "description_wc": 322, "description_text": "If you miss the colorful array of flowers that bloom in April and May, or you simply want some low-maintenance floral decorations, silk flowers can give your space a burst of color and texture. You don\u2019t need a green thumb to enjoy these flowers, as they won\u2019t wilt or shrivel up from lack of water or sun. Silk flowers make perfect decorations for offices and rooms without much natural lighting. At Amazon.com, you can find your favorite silk flowers in a variety of styles and types. You\u2019ll find bouquets of red roses that will never wilt to give a lasting token to the ones you love. We also offer daisies, chrysanthemums, geraniums, daffodils, and many other flowers to make it feel like spring all year long. We even have silk orchids to bring delicate color and texture to your office desk or your kitchen windowsill. Flower petals are the perfect accessory to set the mood for a special evening. Sprinkle silk rose petals over your dining room table before you light your candles for a romantic dinner. They\u2019re also ideal for weddings, anniversaries, and sprinkling on the edge of your bathtub or hot tub. Filter your search by price to see the most affordable silk flower options first. It could save you time and money in your hunt for the perfect wedding or party decorations. Not every d\u00e9cor needs to evoke a romantic getaway. Add fresh green and a peaceful ambiance of the outdoors with artificial trees and shrubs. You can find fun shapes of topiary to create a whimsical atmosphere for garden parties. We also have a number of hanging silk flowers in pots, like purple wisteria, when floor space is scarce or you want to accent archways and other architectural features. Enjoy the long-lasting beauty of silk flowers and add a touch of nature to your home or office with help from Amazon.com.", "parent_text": "Home D\u00e9cor", "keyword_density": {"amazoncom": "0.6", "silk": "2.5", "flowers": "2.5", "silk flowers": "3.1"}, "department_id": 90},
