{"department_text": "Power & Hand Tools", "nr_products": "78", "level": -1, "url": "http://www.amazon.com/s/ref=lp_128061011_nr_n_12?rh=n%3A2972638011%2Cn%3A%213238155011%2Cn%3A3610851%2Cn%3A128061011%2Cn%3A3480687011&bbn=128061011&ie=UTF8&qid=1394033655&rnid=128061011", "text": "Manual Lawn Aerators", "department_url": "http://www.amazon.com/Power-Tools-and-Hand-Tools/b/ref=sd_allcat_hi/177-2158649-1745262?ie=UTF8&node=328182011", "description_title": "Lawn Aerators from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_328182011_nr_n_0?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A328182011%2Cn%3A128061011&bbn=328182011&ie=UTF8&qid=1394033645&rnid=328182011", "keyword_count": {"lawn aerators from amazoncom": 1, "lawn": 14, "lawn aerators": 6, "amazoncom": 3, "aerators": 10}, "description_wc": 283, "description_text": "Easy to use and extremely beneficial to any yard, lawn aerators are used to reduce soil compaction while controlling lawn thatch. Lawn aeration greatly enhances the lush look of your lawn by improving soil drainage and encouraging micro flora, micro fauna, and worms to prosper. From spiked aerator shoes to manual coring steppers to push lawn aerators with containers, find the most convenient model with Amazon.com\u2019s large selection of lawn aerators. Good for your lawn, good for you, and good for your budget; you can make caring for your lawn care much easier with the perfect aerator. There are two main types of lawn aerators available on Amazon.com: core or plug aerators and spike aerators. Core or plug aerators have hollow tines that pull out plugs from the soil and leave it on top. These are the best type for any serious aeration, and are available in handheld and push models. Spike aerators use wedge-shaped spikes to simply punch holes in the ground, and are available in shoe, handheld, and push models. Help your lawn look its best with regular aeration to promote healthy growth, strengthen tolerances to heat and drought, and use less water and fertilizer. We also carry a variety of other lawn and garden tools and supplies, to make time spent in the dirt as enjoyable and easy as possible. Protect your knees while working with cushioned knee pads. Easily groom and maintain rose bushes with strong and sharp pruning shears. Or gift new homeowners with an extensive gardening tool set that can include handy lawn aerators, spades, trowels, and more. With regular maintenance and lawn aerators from Amazon.com, your lawn can be the talk of the neighborhood.", "parent_text": "Gardening Tools", "keyword_density": {"lawn aerators from amazoncom": "1.4", "lawn": "4.9", "lawn aerators": "4.2", "amazoncom": "1.1", "aerators": "3.5"}, "department_id": 99},
