{"department_text": "Kitchen & Dining", "nr_products": "53115", "level": 0, "url": "http://www.amazon.com/s/ref=lp_284507_nr_n_10?rh=n%3A1055398%2Cn%3A%211063498%2Cn%3A284507%2Cn%3A289851&bbn=284507&ie=UTF8&qid=1394033642&rnid=284507", "text": "Kitchen Knives & Cutlery Accessories", "department_url": "http://www.amazon.com/kitchen-dining-small-appliances-cookware/b/ref=sd_allcat_ki/177-2158649-1745262?ie=UTF8&node=284507", "description_title": "Kitchen Knives from Amazon.com", "parent_url": "http://www.amazon.com/kitchen-dining-small-appliances-cookware/b/ref=sd_allcat_ki/177-2158649-1745262?ie=UTF8&node=284507", "keyword_count": {"knives": 9, "amazoncom": 2, "kitchen knives": 4, "kitchen": 7}, "description_wc": 277, "description_text": "Preparing food is much easier when you have a good set of kitchen knives to tackle the chopping, slicing, and dicing. From sushi to steaks, each food has a particular knife that it works best with. Whether you are looking for a complete set of knives to handle all of your food prep needs or a specialty knife, such as a Santoku knife, to help you focus on perfecting a particular style of cuisine, you can find all your cutlery at Amazon.com. Looking for a set of kitchen knives that includes a chef knife, bread knife, and more? We pride ourselves on offering plenty of knife sets from manufacturers such as Chicago Cutlery, Wusthof, and Ginsu. Each set comes with a wood, plastic, or metal knife block that keeps your knives safe and organized. In addition to kitchen knives, you can find plenty of kitchen accessories that help you keep your knives in good shape, so they continue to work as well as the first day you bought them. Knife sharpeners from manufacturers such as Presto and Fiskars can keep your blades keen and ready for action. Magnetic knife bars from MIU France and Norpro help you keep your knives close at hand, and no kitchen is complete without a set of cutting boards from OXO, Totally Bamboo, or Farberware to chop, cut, and slice on. A good set of kitchen knives is a must-have for any home cook, and you can increase your cooking skills quickly when you've got the right tools for each job. Show off your handiness in the kitchen with a new set of knives or a specialty knife from Amazon.com.", "parent_text": "Kitchen & Dining", "keyword_density": {"kitchen knives": "2.9", "amazoncom": "0.7", "knives": "3.2", "kitchen": "2.5"}, "department_id": 89},
