{"department_text": "Appliances", "nr_products": "72127", "level": 0, "url": "http://www.amazon.com/s/ref=lp_2619525011_nr_n_22?rh=n%3A2619525011%2Cn%3A%212619526011%2Cn%3A289913&bbn=2619526011&ie=UTF8&qid=1394033638&rnid=2619526011", "text": "Small Appliances", "department_url": "http://www.amazon.com/Appliances/b/ref=sd_allcat_ha/177-2158649-1745262?ie=UTF8&node=2619525011", "description_title": "Kitchen Appliances from Amazon.com", "parent_url": "http://www.amazon.com/Appliances/b/ref=sd_allcat_ha/177-2158649-1745262?ie=UTF8&node=2619525011", "keyword_count": {"kitchen appliances": 3, "appliances": 6}, "description_wc": 278, "description_text": "Having the right kitchen appliances, whether they are large or small, helps you make the meals that fill your family's bellies and gives you a reason to gather around the table to talk about your day. There are kitchen appliances to fill every cooking need you may have. Looking for a way to prepare your ingredients? These products will help you mix, chop, and dice. Our preparation appliances include mixers, food processors, and toasters, and we carry a wide range of small kitchen appliances to help you turn raw ingredients into dish-ready concoctions. Looking for a way to cook your main dish? These products will help you fully cook your main dish, so it is hot and ready at dinner time. Our cooking appliances include contact grills, slow cookers, ovens, and microwaves. We carry a selection of items that will make your dinner a success.Looking for a way to satisfy your sweet tooth? These products will help you make a delectable dessert that the whole family will enjoy. Our appliances include ice cream machines and blenders that will transform you into a sweets connoisseur and help you whip up everyone's favorite course: dessert. Looking for a pick-me-up in the morning? These products will help you make everything from coffee to smoothies. Our products include coffeemakers, juicers, electric kettles, and espresso machines. We carry everything you need to make the special beverage that gets you up and moving. The more specific an appliance is to your needs, the easier it will be to prepare the meals that your children will remember even after they are grown and possibly make for their own children someday.", "parent_text": "Appliances", "keyword_density": {"appliances": "2.2", "kitchen appliances": "2.2"}, "department_id": 92},
