{"department_text": "Lamps & Light Fixtures", "nr_products": "1", "level": -1, "url": "http://www.amazon.com/s/ref=lp_3736531_nr_p_n_feature_browse-b_5?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A495224%2Cn%3A3736531%2Cp_n_feature_browse-bin%3A5785247011&bbn=3736531&ie=UTF8&qid=1394033669&rnid=389544011", "text": "Metal Halide", "department_url": "http://www.amazon.com/lighting-and-ceiling-fans/b/ref=sd_allcat_llf/177-2158649-1745262?ie=UTF8&node=495224", "description_title": "Novelty Lights from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_495224_nr_n_5?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A495224%2Cn%3A3736531&bbn=495224&ie=UTF8&qid=1394033637&rnid=495224", "keyword_count": {"novelty lights": 6, "lights": 12, "amazoncom": 1, "novelty": 8}, "description_wc": 317, "description_text": "Lighting has the power to invigorate and energize us, to lift our mood, to soothe our nerves, and it even affects our health. Lowered lights can make us feel calm and relaxed, colored lights can inspire fun and adventure, and sparkling lights set the mood for dancing. Amazon.com has all the novelty lights you could need to adjust the mood of your room. Disco balls will leave you tapping your toes for Saturday night. These novelty lights are great for getting parties going with their bright colors and reflections, so don your white suit and slick shoes, and get ready to turn the beat around. Everyone will feel like hot stuff on the dance floor with the lights low and your disco ball sparkling. Many of our novelty lights are eligible for Free Shipping, so you\u2019ll have more in the budget for DJs and disco boots. Lava lamps are great for setting a whole different mood. When you want to relax and take a mini-break at your desk, there\u2019s nothing better than these novelty lamps. Just the view of them, their colors slowly floating up and down the glass, can give you a nostalgic trip to the 1970s. Now you can even filter your search by discount and see what deals will pop up. Fiber optic lights can be fun novelty lights to bring to dance parties around the world. Going to a darkened, dance floor, raising your hands with these colorful lights in them will make you create a dream-like, human light show. If you\u2019re looking for something that fits your budget, you can filter by price to see the most affordable novelty lights first. It\u2019ll ensure that you don\u2019t go over budget. Put a little novelty in your life and light up your space for work or play in a fun way with the novelty lights from Amazon.", "parent_text": "Novelty Lighting", "keyword_density": {"novelty lights": "3.8", "lights": "3.8", "amazoncom": "0.3", "novelty": "2.5"}, "department_id": 100},
{"department_text": "Computer Parts & Components", "level": 1, "url": "http://www.amazon.com/PC-Parts-Components/b/ref=sd_allcat_components/177-2158649-1745262?ie=UTF8&node=193870011", "text": "Computer Parts & Components", "department_url": "http://www.amazon.com/PC-Parts-Components/b/ref=sd_allcat_components/177-2158649-1745262?ie=UTF8&node=193870011", "description_title": "Computer Parts and Components from Amazon.com", "keyword_count": {"amazoncom": 2, "computer parts": 5, "computer": 11, "components": 4, "computer parts and components": 1}, "description_wc": 315, "description_text": "If you\u2019re looking to repair, build, or upgrade your computer, you can find the components and computer parts you need at Amazon.com. We have a wide variety of computer parts and components, so whether you\u2019re trying to build a computer from the ground up or you just need to replace a few things for optimal performance, you can find what you need. Our hard disk drives and solid state drives come in a wide variety of capacities to hold all of your games, music, movies, and TV shows without a problem., and our high-performance sound cards and graphics cards can help you create the ultimate entertainment experience with crisp pictures and life-like sounds. For those who want to build their own tower, we carry the computer parts and hardware to get you started. We have a great selection of computer cases and chasses in metal or plastic, with USB 3.0 capabilities, windowed side panels, and amazing designs. We also have reliable and fast processors from some of the top manufacturers, including Intel, AMD, Corsair, Kingston, Crucial for Memory, and more. If you\u2019re shopping for computer parts on a budget, try filtering our processors, SSDs, or other components by price, by used or refurbished models, and even by discount to see some of the most affordable options available. For a faster computer experience, we carry many different memory modules to boost your RAM. Increasing your memory by one to 16 gigabytes can significantly improve your multitasking abilities so you can go between video chatting, playing games, listening to music and more without your computer getting bogged down by all the open applications. We even have an assortment of ergonomic, purpose-built, and other input devices to give you more control over your user interface. Find the components and computer parts you need to repair, build, or upgrade your computer at Amazon.com.", "parent_text": "Electronics, Computers", "keyword_density": {"amazoncom": "0.6", "computer parts": "3.2", "computer": "3.5", "components": "1.3", "computer parts and components": "1.3"}, "department_id": 84},
{"department_text": " Laptops & Tablets", "level": 1, "url": "http://www.amazon.com/Laptops-Tablets/b/ref=sd_allcat_lapnet/177-2158649-1745262?ie=UTF8&node=2956501011", "text": " Laptops & Tablets", "department_url": "http://www.amazon.com/Laptops-Tablets/b/ref=sd_allcat_lapnet/177-2158649-1745262?ie=UTF8&node=2956501011", "description_title": "Laptops, Ultrabooks & Tablets at Amazon.com", "keyword_count": {}, "description_wc": 328, "description_text": "Nowadays, it\u2019s all about portability. More and more of us have left behind the bulky desktop PC for these smaller, more mobile (and these days just as powerful) counterparts. Still haven\u2019t made the leap? Amazon is the perfect one-stop shop for a new laptop, tablet, or Ultrabook. With brands like Acer, Apple, ASUS, Dell, HP, Kindle Fire HD, Lenovo, Samsung, Sony, and Toshiba, you\u2019re sure to end up with a great machine. On the laptop front, you\u2019ll find all the standard styles, whether you\u2019re looking for a PC, Mac, Chromebook, Netbook, touchscreen laptop, Ultrabook, or more. Check out laptop best sellers, peruse our best deals, check out our helpful buying guides, and more\u2014you\u2019ll find just the right laptop model for you. If you\u2019re looking for a powerful, ultra-portable laptop, an Ultrabook may be just the right choice. An Ultrabook is a high-end subnotebook, outfitted with a low-power Intel processor, solid-state drive, and other technologies to give you a featherweight form-factor without losing performance or battery life. If you\u2019re unsure of which Ultrabook would suit your needs, our Ultrabook Buying Guide might be a good place to start. Or perhaps you\u2019re after a tablet? Tablet computing is increasingly popular, and it\u2019s no wonder why. These flat, touchscreen devices let you casually surf the web, enjoy music and video, play games, download and use apps (tablet speak for applications), read eBooks, and so much more. Our Tablet Buying Guide can help you find the right tablet for your needs, or you can check out best sellers, browse by brand, and more to do your research. You can also check out our selection of 2-in-1, aka convertible, machines, which combine a tablet and laptop in one. So whether you\u2019re looking for a laptop, Ultrabook, or tablet\u2014or even some combination of the above\u2014you\u2019ve come to the right place.", "parent_text": "Electronics, Computers", "keyword_density": {}, "department_id": 81},
{"department_text": "Software", "level": 1, "url": "http://www.amazon.com/design-download-business-education-software/b/ref=sd_allcat_sw/177-2158649-1745262?ie=UTF8&node=229534", "text": "Software", "department_url": "http://www.amazon.com/design-download-business-education-software/b/ref=sd_allcat_sw/177-2158649-1745262?ie=UTF8&node=229534", "description_title": "Welcome to the Software Store at Amazon.com", "keyword_count": {"amazoncom": 5, "software store": 4, "software": 20}, "description_wc": 252, "description_text": "The Amazon.com Software Store is the ideal online destination for shopping computer software. Whether you own a Mac or PC, the Amazon.com Software Store has the selection to meet all your software needs. Search software by title, browse by category, and compare software programs until you find exactly the software you\u2019re looking for. If you are building a library of software programs for your home and office, the Amazon.com Software Store has you covered. Shop top Microsoft productivity titles such as Microsoft Office, Microsoft Word, Windows XP, Windows Vista, or recent and new versions like Windows 7 and Windows 8. Or if you are looking to better protect your computer and personal information, shop computer security and antivirus titles from trusted brands like McAfee, Norton, and BitDefender. In the market for photo software, video software, or design software? The Amazon.com Software Store offers a great selection from leading brands such as Adobe and Autodesk, with top titles including Photoshop Elements, InDesign, and Sketchbook Pro. You can also manage and optimize your videos with movie software or DVD software, or even harness your musical creativity with recording software. If you are looking to download software directly to your Mac or PC, you\u2019ve come to the right place. Amazon.com offers a growing collection of top software programs available for instant download to a computer, making the experience of shopping for software online more convenient than ever. Find all the latest software deals including straight price discounts, gift cards with purchase, and more.", "parent_text": "Electronics, Computers", "keyword_density": {"amazoncom": "2.0", "software store": "3.2", "software": "7.9"}, "department_id": 85},
{"department_text": "Trade In Your Electronics", "level": 1, "url": "http://www.amazon.com/Electronics-Trade-In/b/ref=sd_allcat_trade_in_elec/177-2158649-1745262?ie=UTF8&node=2226766011", "text": "Trade In Your Electronics", "department_url": "http://www.amazon.com/Electronics-Trade-In/b/ref=sd_allcat_trade_in_elec/177-2158649-1745262?ie=UTF8&node=2226766011", "description_title": "Tell Us What You Think", "keyword_count": {"think": 1, "us": 2}, "description_wc": 30, "description_text": "We're always looking to improve the customer experience in the Electronics Trade-In Store and would love to hear your feedback. Please let us know what you think .", "parent_text": "Electronics, Computers", "keyword_density": {"think": "3.4", "us": "6.9"}, "department_id": 80},
{"department_text": "Electronics Accessories", "level": 1, "url": "http://www.amazon.com/Tech-Accessories-Electronics/b/ref=sd_allcat_elec_acc/177-2158649-1745262?ie=UTF8&node=5745855011", "text": "Electronics Accessories", "department_url": "http://www.amazon.com/Tech-Accessories-Electronics/b/ref=sd_allcat_elec_acc/177-2158649-1745262?ie=UTF8&node=5745855011", "description_title": "Welcome to the Consumer Electronics Accessory Store at Amazon.com", "keyword_count": {"consumer electronics accessory store": 1, "electronics accessory": 3, "electronics": 5, "amazoncom": 1, "accessory": 4}, "description_wc": 158, "description_text": "Amazon\u2019s Consumer Electronics Accessory Store is your one-stop shop for all your electronics accessories needs. Don\u2019t know what electronics accessory or peripheral you\u2019re looking for? We are here to help. Check out our accessories in the Computers, Tablets, Office, Cameras, Cell Phones, GPS, Audio & Video, MP3, Car Electronics, or Kindle categories and find your perfect accessory. With our huge selection of cables, adapters, batteries, chargers, cases, bags, covers, sleeves, stands, mounts, power protection, ink, toner, and headsets from popular brands like HP, Canon, Belkin, OtterBox, Monster, Sony, Brother, Logitech, Apple, Sennheiser, Bose, and more, we have something for every electronic and gadget buyer. Whether your budget is limited or not, we consistently work toward maintaining competitive prices on every electronics accessory we carry. And with customer benefits such as Amazon Prime and FREE Super Saver Shipping , you can shop with confidence at Amazon.com, as we strive to give you the best customer experience.", "parent_text": "Electronics, Computers", "keyword_density": {"consumer electronics accessory store": "2.5", "electronics accessory": "3.8", "amazoncom": "0.6", "electronics": "3.2", "accessory": "2.5"}, "department_id": 79},
