{"department_text": "Musical Instruments", "level": 1, "url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/177-2158649-1745262?ie=UTF8&node=11091801", "text": "Musical Instruments", "department_url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/177-2158649-1745262?ie=UTF8&node=11091801", "description_title": "Amazon.com's Musical Instruments Store", "keyword_count": {"musical instruments store": 2, "instruments": 6, "amazoncom": 3, "musical instruments": 5, "musical": 6, "store": 5}, "description_wc": 277, "description_text": "Welcome to the Musical Instruments Store at Amazon.com. From stage to studio, this is your source for the gear you need to perform your best--whether you\u2019re a beginner or a seasoned musician. Browse our selection of guitars, keyboards, basses, amps, drums, stringed instruments, band & orchestra, DJ gear, and more to get set up with the perfect instrument. Check out the latest recording equipment, from microphones to monitors and audio interfaces to DAW software. Take care of your live sound needs with power amps, speakers, and cables galore. Pick up some pro lighting effects for your next gig. Or how about some fun kids\u2019 musical instruments to get \u2018em started at a young age? Whatever your goal--outfitting a venue, recording a rock & roll masterpiece, DJing parties, learning violin--Amazon has you covered. Check out top deals, gift ideas, best-selling gear, and featured brands such as Fender, Gibson, Line 6, Pearl, M-Audio, Avid, Shure Microphones, Zildjian, Sabian, Peavey, Epiphone, Yamaha, Casio, and hundreds more. Take advantage of Amazon Prime shipping, financing with the Amazon.com Store Card, and other special offers. Browse our special stores, such as the Beginner Store for students and those just starting out, or the Musical Instruments Outlet, featuring huge markdowns on all kinds of gear and equipment. Need accessories for your instrument? No problem\u2014pick up some strings, sticks, reeds, picks, stands, tuners, or anything else you might need from our huge selection. And, as with all things Amazon.com, check out customer reviews of musical instruments to help make your choice. Whatever your musical needs, you\u2019ll find it here in the Musical Instruments Store. Start making some music today!", "parent_text": "Electronics, Computers", "keyword_density": {"musical instruments store": "2.2", "instruments": "2.2", "amazoncom": "1.1", "musical instruments": "3.6", "musical": "2.2", "store": "1.8"}, "department_id": 78},
{"department_text": "Video Games", "level": 1, "url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/177-2158649-1745262?ie=UTF8&node=468642", "text": "Video Games", "department_url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/177-2158649-1745262?ie=UTF8&node=468642", "description_title": "Video Games from Amazon.com", "keyword_count": {"video": 6, "amazoncom": 3, "video games": 5, "games": 9}, "description_wc": 227, "description_text": "Amazon\u2019s Video Games store is your entertainment hub for everything related to Video Games. The store features thousands of games at great prices and allows you to shop by gaming platform, bestsellers, new and future releases, bonus offers, price, deals, genre, ESRB rating, and more. You can shop for every type of game you may be looking for, including Xbox 360 , PlayStation 3 , PlayStation 4 , Nintendo Wii and Wii U, Nintendo 3DS, PlayStation Vita, Digital, Free-to-Play, Kindle Fire, PC and Mac, Nintendo DS, and much more. When you\u2019re looking to join in on the hottest new video game developments online, there\u2019s no better place to be than Amazon.com. Our new & future releases section features the latest games and newest pre-order options. Its streamlined, hassle-free pages are perfect for locating new video games in seconds, so you\u2019ll be at the forefront of all the action and right in line with even the most hardcore gaming aficionados. No matter which gaming system you use, Amazon.com offers the latest updates and releases on new video games. For bonus offers and everyday savings on a wide selection of games and accessories, visit our Deals Store . Don\u2019t forget to trade in the games you\u2019ve already finished for Amazon.com gift cards in the Video Games Trade-In Store .", "parent_text": "Electronics, Computers", "keyword_density": {"games": "4.1", "amazoncom": "1.4", "video games": "4.5", "video": "2.7"}, "department_id": 75},
{"department_text": "Lamps & Light Fixtures", "nr_products": "84", "level": -1, "url": "http://www.amazon.com/s/ref=lp_3736531_nr_p_n_feature_browse-b_4?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A495224%2Cn%3A3736531%2Cp_n_feature_browse-bin%3A389564011&bbn=3736531&ie=UTF8&qid=1394033669&rnid=389544011", "text": "Fluorescent", "department_url": "http://www.amazon.com/lighting-and-ceiling-fans/b/ref=sd_allcat_llf/177-2158649-1745262?ie=UTF8&node=495224", "description_title": "Novelty Lights from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_495224_nr_n_5?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A495224%2Cn%3A3736531&bbn=495224&ie=UTF8&qid=1394033637&rnid=495224", "keyword_count": {"novelty lights": 6, "lights": 12, "amazoncom": 1, "novelty": 8}, "description_wc": 317, "description_text": "Lighting has the power to invigorate and energize us, to lift our mood, to soothe our nerves, and it even affects our health. Lowered lights can make us feel calm and relaxed, colored lights can inspire fun and adventure, and sparkling lights set the mood for dancing. Amazon.com has all the novelty lights you could need to adjust the mood of your room. Disco balls will leave you tapping your toes for Saturday night. These novelty lights are great for getting parties going with their bright colors and reflections, so don your white suit and slick shoes, and get ready to turn the beat around. Everyone will feel like hot stuff on the dance floor with the lights low and your disco ball sparkling. Many of our novelty lights are eligible for Free Shipping, so you\u2019ll have more in the budget for DJs and disco boots. Lava lamps are great for setting a whole different mood. When you want to relax and take a mini-break at your desk, there\u2019s nothing better than these novelty lamps. Just the view of them, their colors slowly floating up and down the glass, can give you a nostalgic trip to the 1970s. Now you can even filter your search by discount and see what deals will pop up. Fiber optic lights can be fun novelty lights to bring to dance parties around the world. Going to a darkened, dance floor, raising your hands with these colorful lights in them will make you create a dream-like, human light show. If you\u2019re looking for something that fits your budget, you can filter by price to see the most affordable novelty lights first. It\u2019ll ensure that you don\u2019t go over budget. Put a little novelty in your life and light up your space for work or play in a fun way with the novelty lights from Amazon.", "parent_text": "Novelty Lighting", "keyword_density": {"novelty lights": "3.8", "lights": "3.8", "amazoncom": "0.3", "novelty": "2.5"}, "department_id": 100},
