{"department_text": "Desktops & Monitors", "level": 1, "url": "http://www.amazon.com/Desktops/b/ref=sd_allcat_deskserv/177-2158649-1745262?ie=UTF8&node=4972214011", "text": "Desktops & Monitors", "department_url": "http://www.amazon.com/Desktops/b/ref=sd_allcat_deskserv/177-2158649-1745262?ie=UTF8&node=4972214011", "description_title": "Desktop Computers & Monitors at Amazon.com", "keyword_count": {"desktop computers": 4, "desktop": 5}, "description_wc": 268, "description_text": "Desktop computers are far from dead. Avid gamers, media professionals, or just home users looking for serious expandability all still look to desktop computers to suit their needs, and there are plenty of great machines available. Check out the best in desktop computers here at Amazon, from brands like Acer, Alienware, Apple, ASUS, CyberpowerPC, CybertronPC, Dell, Gateway, HP, iBUYPOWER, Lenovo, Sony, and Toshiba. You can check out our Desktop Buying Guide to find out a bit more about the right machine for you. Maybe you\u2019re looking for a newer all-in-one PC, where the monitor and CPU are a single unit, saving you all kinds of space in setting it up. Or maybe you\u2019re after the latest and greatest gaming PC--a good gaming PC is a cut above the average machine, with enhanced graphics, processing power, a supercharged cooling system, and other features to keep it at peak performance. Whether it\u2019s a gaming PC or any other type, you\u2019ll be covered here. Shop by price, brand, and other criteria such as desktop computers with a specific processor type (AMD or Intel). Check out best sellers, new releases, top rated and most gifted machines, and more. Once you\u2019ve picked out your machine you\u2019ll need to pick a monitor. Amazon has you covered there as well. Look for a monitor by size, check out monitor best sellers, choose between LCD and LED monitor types, and more. Whether you\u2019re after a massive high-definition monitor (for that gaming PC rig) or something a bit more modest, you\u2019ll find it here.", "parent_text": "Electronics, Computers", "keyword_density": {"desktop computers": "3.0", "desktop": "1.9"}, "department_id": 82},
