{"department_text": "Camera, Photo & Video", "level": 1, "url": "http://www.amazon.com/Camera-Photo-Film-Canon-Sony/b/ref=sd_allcat_p/177-2158649-1745262?ie=UTF8&node=502394", "text": "Camera, Photo & Video", "department_url": "http://www.amazon.com/Camera-Photo-Film-Canon-Sony/b/ref=sd_allcat_p/177-2158649-1745262?ie=UTF8&node=502394", "description_title": "Camera, Photo & Video", "keyword_count": {"photo": 5, "camera photo video": 1, "camera": 15}, "description_wc": 283, "description_text": "Amazon.com has a huge selection of cameras and accessories for every type of photographer. Looking for a pocket-sized camera for those unforgettable moments? Amazon.com has a huge selection of cameras small enough to keep with you everywhere you go. If you are looking for something in the professional realm, Amazon.com has a wide selection of the newest and most precise Digital SLR cameras with all the lenses and accessories to help you get that perfect image. Looking for something in between? Our broad range of compact system cameras has everything you need to start building your digital portfolio. From the smallest, most agile point & shoot digital cameras to the professional level Digital SLR cameras, Amazon.com's Camera, Photo & Video store has something for everyone. We feature the newest models from the biggest brands in photography such as Canon, Nikon, Panasonic, Sony, Olympus, and Panasonic. We not only have the base camera models, but also a plethora of lenses and accessories for every situation. If you are looking for a specialty camera, Amazon has a variety of underwater and kid\u2019s cameras as well. Our selection of underwater cameras has everything for the most hard core scuba divers as well as the cautiously clumsy. These can help you capture those incredible underwater photos or just keep your camera safe at the beach. Our children\u2019s cameras come in a variety of themes and colors and are an excellent way to inspire kids to show the unique way they see their world. All of this comes with the largest selection of reviews with the lowest prices around. So find that perfect camera for you or the perfect gift for the photographers closest to you.", "parent_text": "Electronics, Computers", "keyword_density": {"photo": "1.8", "camera photo video": "1.1", "camera": "5.3"}, "department_id": 73},
