{"department_text": "Computer Accessories & Peripherals", "level": 1, "url": "http://www.amazon.com/Computer-Accessories/b/ref=sd_allcat_compaccess/177-2158649-1745262?ie=UTF8&node=2956536011", "text": "Computer Accessories & Peripherals", "department_url": "http://www.amazon.com/Computer-Accessories/b/ref=sd_allcat_compaccess/177-2158649-1745262?ie=UTF8&node=2956536011", "description_title": "Computer Accessories at Amazon.com", "keyword_count": {"computer": 6, "accessories": 7, "computer accessories": 4}, "description_wc": 241, "description_text": "Looking for an external hard drive to expand your storage, a router to set up your own network, or just a more comfortable keyboard and mouse? Amazon\u2019s Computer Accessories Store has all these and more. You\u2019re sure to find what you need in our broad selection of computer accessories and peripherals, including flash memory cards and USB drives, wired and wireless PC headsets, cables, and laptop bags, batteries, and cases. Check out our best sellers, top-rated computer accessories, and helpful customer reviews. We have accessories for every need and every computer, Mac or PC, from compact, high-speed SDHC and microSD flash memory cards to full-featured peripherals like wired and wireless keyboards, mice, headsets, and microphones designed for business, gaming, and home computing. If you\u2019re tough on your devices, don\u2019t miss our selection of rugged and spill-resistant accessories. Does your home or office network need a boost? Take a look at our selection of AC and N Wi-Fi routers. If it\u2019s deals you want, look no further. We have big discounts on every kind of computer accessory. Or maybe you just need more cables for all your gadgets. We\u2019ll keep you connected and in sync with USB, Ethernet, SATA, Lightning cables and more. If you\u2019re always on the go, protect and power your laptop and accessories with our bags, cases, batteries, and chargers--all in Amazon\u2019s Computer Accessories Store