{"department_text": "Home Audio & Theater", "level": 1, "url": "http://www.amazon.com/Home-Audio-Electronics/b/ref=sd_allcat_hat/177-2158649-1745262?ie=UTF8&node=667846011", "text": "Home Audio & Theater", "department_url": "http://www.amazon.com/Home-Audio-Electronics/b/ref=sd_allcat_hat/177-2158649-1745262?ie=UTF8&node=667846011", "description_title": "Home Audio and Home Theater", "keyword_count": {"home audio": 3, "home theater": 1, "audio": 6, "theater": 6, "home": 12}, "description_wc": 312, "description_text": "Entertaining friends and family can be a lot of work. Whether you are hosting a movie night and want a cinema-quality sound system or just easy listening at home, you will find everything you need right here. At Amazon.com's Home Audio and Theater Store we have an unbeatable selection of home entertainment brands, a list that includes top brands such as Sonos, Polk Audio, Bose, Yamaha, Logitech, Onkyo, Soundmatters International, Eton, Definitive Technology, Pyle, ZVOX, MartinLogan, C. Crane Company, Marantz, Midland Consumer Radio, Audio-Technica, Coby, Crosley Radio, Sony, Samsung, Panasonic, Grace Digital, Bic America, LG, Denon, JBL, Sangean, Infinity, Klipsch, Harman Kardon, Vizio, Pioneer, Energy, Boston Acoustics, Atlantic Technology, RCA, and more. These brands have become trusted over time because of their expertise in a wide variety of home entertainment products. Within this long list of brands, you'll be able to find home entertainment products for all your needs, starting with the essential speakers for any home. Our store carries bookshelf speakers, subwoofers, floorstanding speakers, center channel speakers, ceiling speakers, wireless speakers, soundbars, indoor speakers, outdoor speakers, and a variety of home theater system speaker sets. We also carry a variety of other products that complete your home entertainment system such as receivers, amplifiers, CD players, CD recorders, turntables, and more. If you're building a movie theater in your own home, you'll want to be sure you have the proper components to replicate the theater experience: projectors, surround speaker systems, receivers, and amplifiers. You can also find everything you need to listen on-the-go in our store. We carry boomboxes, portable radios, clock radios, and compact stereos that make it easy to take audio anywhere. Need help finding the right home audio and theater products? Our featured home audio and theater categories make it easy to find the perfect addition to your home entertainment system.", "parent_text": "Electronics, Computers", "keyword_density": {"home audio": "1.9", "home theater": "0.6", "audio": "1.9", "theater": "1.9", "home": "3.8"}, "department_id": 72},
{"nr_products": "149737", "level": 0, "url": "http://www.amazon.com/s/ref=lp_229534_nr_p_n_feature_browse-b_0?rh=n%3A229534%2Cp_n_feature_browse-bin%3A6375078011&bbn=229534&ie=UTF8&qid=1394033673&rnid=388153011", "text": "CD/DVD", "department_url": "http://www.amazon.com/design-download-business-education-software/b/ref=sd_allcat_sw/177-2158649-1745262?ie=UTF8&node=229534", "description_wc": 0, "parent_url": "http://www.amazon.com/design-download-business-education-software/b/ref=sd_allcat_sw/177-2158649-1745262?ie=UTF8&node=229534", "parent_text": "Software", "department_text": "Software", "department_id": 85},
{"nr_products": "28", "level": 0, "url": "http://www.amazon.com/s/ref=lp_1077068_nr_n_8?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A3248684011%2Cn%3A1077068%2Cn%3A10981321&bbn=1077068&ie=UTF8&qid=1394033674&rnid=1077068", "text": "In-Dash Mounting Kits", "department_url": "http://www.amazon.com/Car-Electronics/b/ref=sd_allcat_gps/177-2158649-1745262?ie=UTF8&node=1077068", "description_wc": 0, "parent_url": "http://www.amazon.com/Car-Electronics/b/ref=sd_allcat_gps/177-2158649-1745262?ie=UTF8&node=1077068", "parent_text": "Car Electronics & GPS", "department_text": "Car Electronics & GPS", "department_id": 77},
{"department_text": "Musical Instruments", "nr_products": "106183", "level": 0, "url": "http://www.amazon.com/s/ref=lp_11091801_nr_n_9?rh=n%3A11091801%2Cn%3A%2111965861%2Cn%3A11973111&bbn=11965861&ie=UTF8&qid=1394033673&rnid=11965861", "text": "Studio Recording Equipment", "department_url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/177-2158649-1745262?ie=UTF8&node=11091801", "description_title": "Recording Equipment from Amazon.com", "parent_url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/177-2158649-1745262?ie=UTF8&node=11091801", "keyword_count": {"recording": 9, "recording equipment": 6, "amazoncom": 3}, "description_wc": 339, "description_text": "You don\u2019t need to wait for a major label to notice you before you start making your own records. Setting up a cutting-edge digital studio with professional, quality recording equipment is easier and more affordable than ever for the first timer, and experienced audio engineers have access to an enormous variety of outstanding mics, preamps, monitors, and other recording equipment. In the age of the digital audio workstation, the heart of most home recording equipment is a quality interface. At Amazon.com, we have a huge selection of home recording gear, whether you need a two-channel interface for recording podcasts and simple music projects, or a 32-channel board for full band recordings. A reliable, great sounding interface is the crucial link between the performance and your computer. All your other recording equipment will be routed through your interface, so it\u2019s important to choose the right model. Browse user reviews written by other musicians to find products with great real-life performance from top brands like Focusrite, M-Audio, and Tascam. From studio staples like the Shure SM57 to newer, trend-setting recording equipment like the Blue Blueberry, you\u2019ll find microphones for vocals, electric guitars, acoustic instruments, and more at Amazon.com. For live applications, dynamic cardioid mics are perfect for vocals, but in the controlled environment of the studio, a large diaphragm condenser mic will more accurately capture the depth and nuance of your performance. Choose from brands like AKG, Sennheiser, and Rode to find the perfect mic for your style and budget. Before you can get your tracks on the radio, they need to be mixed and mastered on accurate, transparent studio monitors. Home speakers equalize and color audio, and make it difficult to mix accurately. What sounds good on one set of home speakers might sound muddy on another, which is why professionals rely on recording equipment like quality monitors to solidify their mixes. From legendary Yamaha reference monitors, to affordable KRKs, there\u2019s a set of speakers for every studio at Amazon.com.", "parent_text": "Musical Instruments", "keyword_density": {"recording": "2.7", "recording equipment": "3.5", "amazoncom": "0.9"}, "department_id": 78},
{"department_text": "Video Games", "nr_products": "7032", "level": 0, "url": "http://www.amazon.com/s/ref=lp_468642_nr_n_13?rh=n%3A468642%2Cn%3A%2111846801%2Cn%3A979455011&bbn=11846801&ie=UTF8&qid=1394033674&rnid=11846801", "text": "Digital Games", "department_url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/177-2158649-1745262?ie=UTF8&node=468642", "description_title": "Want to see your game on Amazon?", "parent_url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/177-2158649-1745262?ie=UTF8&node=468642", "keyword_count": {"game on amazon": 1, "game": 2}, "description_wc": 19, "description_text": "Do you make games? Are you interested in selling your game on Amazon? Get started here . \u203a Learn more", "parent_text": "Video Games", "keyword_density": {"game on amazon": "16.7", "game": "11.1"}, "department_id": 75},
{"department_text": "Video Games", "nr_products": "36426", "level": 0, "url": "http://www.amazon.com/s/ref=lp_468642_nr_n_12?rh=n%3A468642%2Cn%3A%2111846801%2Cn%3A294940&bbn=11846801&ie=UTF8&qid=1394033674&rnid=11846801", "text": "More Systems", "department_url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/177-2158649-1745262?ie=UTF8&node=468642", "description_title": "Retro Games from Amazon.com", "parent_url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/177-2158649-1745262?ie=UTF8&node=468642", "keyword_count": {"retro games": 7, "amazoncom": 2, "retro": 8}, "description_wc": 334, "description_text": "If you\u2019re the kind of gamer who thinks the industry was at its best before motion-sensing controls and other bells and whistles, browse the retro games at Amazon.com to rediscover your favorite titles from a simpler time. You\u2019ll find a wide selection of retro games for legendary consoles. You can relive the golden age of the home arcade with classic titles for Atari, including Q*Bert, Pac-Man, Frogger, and more. Spurred on the by the popularity of early Atari systems, one of the most successful game consoles of all time was the original Nintendo Entertainment System, originally released in 1985. The cutting edge 8-bit graphics and sound wowed gamers, and titles like Super Mario Brothers, The Legend of Zelda, Castlevania and Final Fantasy are still producing sequels today. You can experience the roots of video game culture with retro games for these and other classic systems. In the \u201890s, televisions got bigger, and gaming consoles got more powerful. Nintendo and Sega fought for the top spot with the Super Nintendo Entertainment System, and the Sega Genesis, respectively. You\u2019ll find all the retro games for SNES and Genesis you loved back in the day in one convenient spot. From Golden Axe to Mega Man X, all your favorite 16-bit titles are available at the Amazon.com Retro games store. Nintendo 64 and PlayStation ushered in a new era of gaming. Polygons replaced pixels, and 3D rendering entered into the gaming vocabulary. Retro gaming hits like Crash Bandicoot, Mario Kart 64, and 007: Goldeneye pushed the limits of technology, and created the most realistic virtual environments seen up to that point. We also have some retro games for systems that might not feel as old as they are, including PlayStation 2, Nintendo GameCube, and the original Xbox. From the moment you get your sword in the Legend of Zelda, to doing a barrel roll in Star Fox 64, now you can relive classic scenes from all your favorite retro games.", "parent_text": "Video Games", "keyword_density": {"retro games": "4.2", "amazoncom": "0.6", "retro": "2.4"}, "department_id": 75},
{"department_text": "Video Games", "nr_products": "2082", "level": 0, "url": "http://www.amazon.com/s/ref=lp_468642_nr_n_10?rh=n%3A468642%2Cn%3A%2111846801%2Cn%3A3010556011&bbn=11846801&ie=UTF8&qid=1394033674&rnid=11846801", "text": "PlayStation Vita", "department_url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/177-2158649-1745262?ie=UTF8&node=468642", "description_title": "PS Vita Games from Amazon.com", "parent_url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/177-2158649-1745262?ie=UTF8&node=468642", "keyword_count": {"ps": 12, "amazoncom": 3, "games": 5, "vita": 13, "ps vita": 10, "ps vita games": 3}, "description_wc": 292, "description_text": "If you love your PlayStation console, you\u2019ll have no problem appreciating the feature-rich PlayStation Vita 3. After all, who wouldn\u2019t love a handheld gaming machine that also doubles as your portable multimedia device and social media access? Get your hands on the PS Vita itself, along with PS Vita games and cases, at Amazon.com and watch gaming magic unfold before your eyes. Looking to test your PlayStation Vita\u2019s superior graphics and amazing touchscreen? Amazon.com offers plenty of PS Vita games by genre, including Assassin\u2019s Creed 3 Liberation, Uncharted: Golden Abyss, Mortal Kombat, and LittleBigPlanet. Put your PS Vita\u2019s touchpad and dual analog sticks to good use with thrilling action and racing games from the Games Store. We pride ourselves in delivering all the essentials and add-ons you could ever need to experience the PS Vita\u2019s full potential. How about customizing the PS Vita to your gaming needs? Browse the Accessories Store for hundreds of options on PS Vita accessory kits, batteries and chargers, faceplates, skins, memory cards, and hand grips. These products will help you personalize the PS Vita to your specifications. For a machine that\u2019s made for the public eye, changing up the PS Vita\u2019s look is all part of the fun. Maybe you\u2019re looking to get your hands on the Vita after seeing it in action. The Console Guide offers your choice of black and white devices, along with convenient bundles that include a game and memory card, delivered straight to your door. With so many PS Vita games on Amazon.com, the only limit to your fun is your endurance. This compact device slips right into your bag and your lifestyle, taking you on new adventures whenever you want.", "parent_text": "Video Games", "keyword_density": {"ps": "4.1", "amazoncom": "1.0", "games": "1.7", "vita": "4.5", "ps vita": "6.8", "ps vita games": "3.1"}, "department_id": 75},
