{"department_text": "Camera, Photo & Video", "nr_products": "6424", "level": 0, "url": "http://www.amazon.com/s/ref=lp_502394_nr_n_12?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A502394%2Cn%3A3350161&bbn=502394&ie=UTF8&qid=1394033674&rnid=502394", "text": "Underwater Photography", "department_url": "http://www.amazon.com/Camera-Photo-Film-Canon-Sony/b/ref=sd_allcat_p/177-2158649-1745262?ie=UTF8&node=502394", "description_title": "Underwater Photography from Amazon.com", "parent_url": "http://www.amazon.com/Camera-Photo-Film-Canon-Sony/b/ref=sd_allcat_p/177-2158649-1745262?ie=UTF8&node=502394", "keyword_count": {"underwater photography from amazoncom": 1, "underwater": 9, "amazoncom": 2, "underwater photography": 7}, "description_wc": 350, "description_text": "From brightly colored fish and pastoral nature scenes to massive reefs and silent shipwrecks, underwater photography captures an enchanting and rare view of the waters that make up the majority of the Earth. Whether you\u2019re ready to take your photos to the next level or just want water-protected equipment for your next vacation, Amazon.com\u2019s selection of underwater photography camcorders, housings, cameras, lights, and lenses will get you ready for more. Choose from a variety of water-ready and waterproof products that range in style, design, capability, and features. Most underwater digital and video cameras are waterproof, shock-proof, crush-proof, freeze-proof, and dust-proof up to a certain distance or condition, making them the perfect choice for extreme conditions and trips. Underwater photography and videography can be a unique addition to your vacation memories or professional portfolio that many others don\u2019t have. Our wide selection of camcorders and cameras has something for every level and skill set, from GoPro video cameras that can be strapped to the body to waterproof digital cameras that can travel as far into the depths as you can. Simply browse for suitable underwater photography equipment, or filter by keywords, brands, condition, price, and more to quickly refine your search to preferred qualities. You can also filter by material attributes like waterproof, floating, soft, hard, and water resistant for strong and reliable products that fit your criteria. With top brands like Olympus, Nikon, Sony, Fuji, Panasonic, and Canon, you can be sure you\u2019re shopping tried-and-true underwater photography equipment. For planned shoots and professional needs, we offer a selection of underwater lighting and lenses that can help create the environment and look you want. Or if you\u2019re more of a casual photographer looking for a new challenge, our Underwater Photography Store features a large assortment of camera and camcorder housings that will keep your equipment safe submerged in water, on rainy day hikes, and in other extreme conditions. With underwater photography from Amazon.com, you don\u2019t be afraid to jump in and splash around for the best photos.", "parent_text": "Camera, Photo & Video", "keyword_density": {"underwater photography from amazoncom": "1.1", "underwater": "2.6", "amazoncom": "0.6", "underwater photography": "4.0"}, "department_id": 73},
