{"department_text": "Camera, Photo & Video", "nr_products": "62180", "level": 0, "url": "http://www.amazon.com/s/ref=lp_502394_nr_n_13?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A502394%2Cn%3A7161091011&bbn=502394&ie=UTF8&qid=1394033674&rnid=502394", "text": "Video Surveillance", "department_url": "http://www.amazon.com/Camera-Photo-Film-Canon-Sony/b/ref=sd_allcat_p/177-2158649-1745262?ie=UTF8&node=502394", "description_title": "Video Surveillance Cameras from Amazon.com", "parent_url": "http://www.amazon.com/Camera-Photo-Film-Canon-Sony/b/ref=sd_allcat_p/177-2158649-1745262?ie=UTF8&node=502394", "keyword_count": {"cameras": 7, "amazoncom": 2, "surveillance": 10, "video surveillance cameras from amazoncom": 1, "video": 10, "video surveillance": 7, "video surveillance cameras": 5}, "description_wc": 334, "description_text": "Whether you\u2019re a business owner who wants a camera to protect your retail space or you\u2019re looking for a way to protect your property at home, the video surveillance cameras from Amazon.com can be a great solution. From small and discreet camera systems to smartphone-compatible webcams, we have a wide variety of video surveillance cameras to choose from. CCTV cameras, similar to the ones used professionally in retail stores, hang from the ceiling or the walls for clear visuals and recordings. Weatherproof models are great for outdoor surveillance as well, to add security to dark backyards, secluded alleys, and poorly visualized entrances and exits. Many of our video surveillance systems come with added LED lights and night vision capabilities so you can record clear images, even when it gets dark outside. Many of our video surveillance cameras even feature Wi-Fi and remote-access capabilities so you can watch live video and recordings from a remote location or surveillance hub.. For home use, we also have a great selection of video surveillance cameras to keep a comforting eye on your kids and pets when you're away or out of the room. Video baby monitors are extremely easy to set up and use, and are great for checking on baby without the risk of waking him up. Some baby monitors have up to an 800-foot range, so you never have to be far from your little ones with handheld monitors while tossing the laundry in the dryer, checking emails in the living room, or letting the the cat out. For full home protection, we also offer larger bundles of video surveillance cameras to completely monitor every room in the house. Some bundles come with up to sixteen individual video cameras and a surveillance system that keeps up to 1TB of stored information that you can access with any enabled device, including smartphones, tablets, and network-connected computers. You can find video surveillance equipment for professional and private use at Amazon.com.", "parent_text": "Camera, Photo & Video", "keyword_density": {"cameras": "2.1", "video surveillance cameras from amazoncom": "1.5", "surveillance": "3.0", "amazoncom": "0.6", "video": "3.0", "video surveillance": "4.2", "video surveillance cameras": "4.5"}, "department_id": 73},
{"department_text": "Home Audio & Theater", "nr_products": "494", "level": 0, "url": "http://www.amazon.com/s/ref=lp_667846011_nr_n_8?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A667846011%2Cn%3A11973981&bbn=667846011&ie=UTF8&qid=1394033677&rnid=667846011", "text": "Turntable Cartridges & Needles", "department_url": "http://www.amazon.com/Home-Audio-Electronics/b/ref=sd_allcat_hat/177-2158649-1745262?ie=UTF8&node=667846011", "description_title": "Turntable Cartridges from Amazon.com", "parent_url": "http://www.amazon.com/Home-Audio-Electronics/b/ref=sd_allcat_hat/177-2158649-1745262?ie=UTF8&node=667846011", "keyword_count": {"amazoncom": 2, "cartridges": 9, "turntable": 11, "turntable cartridges": 5}, "description_wc": 321, "description_text": "Whether you are getting ready for a stellar DJ performance or a private party at home with friends, you will need a good turntable cartridge to ensure you get the best quality music from your audio equipment. Cartridges hold the needle in a traditional turntable and the magnet in more modern versions, transmitting sound to your speakers. High-quality turntable cartridges may or may not include needles or magnets. The stylus on modern magnet-driven turntables allows for high-quality sound with less concern about scratching potentially rare vinyl albums. Many DJs prefer the sound of more traditional turntable cartridges, and not all cartridges will work on all turntable systems. Amazon.com carries a wide selection of available cartridges from companies such as Audio Technica, Panasonic, and Shure so that you can easily find the right piece for your needs. The tone arm mount is also a major consideration when replacing turntable cartridges. Modern systems typically have a half-inch mount, which has become standard in the industry. Longer mounts may not work with specific turntables, and incorrect cartridges could lead to potential damage. Choosing the right arm mount length can help minimize the risks to your records. Force gauges and other accessories can also help prevent damage from regular turntable use. Modern features have made turntable cartridges far more advanced than earlier versions. Styluses have begun to replace needles, and special guards protect your records from damage. Headshell wires are often easily replaced using only a small screwdriver, allowing you to get the most out of your cartridge and ensure that it lasts for some time with regular maintenance. Many units are designed to work with specific equipment, creating powerful sounds when employed in combination with their sister parts. Amazon.com allows you to shop for turntable cartridges and other musical accessories or instruments from the comfort of your own home. Save both time and money with inexpensive and fast shipping options.", "parent_text": "Home Audio & Theater", "keyword_density": {"amazoncom": "0.6", "cartridges": "2.8", "turntable": "3.4", "turntable cartridges": "3.1"}, "department_id": 72},
