{"department_text": "Video Games", "nr_products": "1408", "level": -1, "url": "http://www.amazon.com/s/ref=lp_294940_nr_n_27?rh=n%3A468642%2Cn%3A%2111846801%2Cn%3A294940%2Cn%3A294945&bbn=294940&ie=UTF8&qid=1394033680&rnid=294940", "text": "Super Nintendo", "department_url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/177-2158649-1745262?ie=UTF8&node=468642", "description_title": "Super Nintendo Games from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_468642_nr_n_12?rh=n%3A468642%2Cn%3A%2111846801%2Cn%3A294940&bbn=11846801&ie=UTF8&qid=1394033674&rnid=11846801", "keyword_count": {"super nintendo games": 8, "super nintendo": 11, "games": 12, "amazoncom": 2, "super": 12}, "description_wc": 341, "description_text": "The Super Nintendo Entertainment System was one of the most popular video game consoles of all time. Countless classic titles were released during its lifetime, including memorable favorites from franchises that still exist today. Super Nintendo games were released across all genres, from action to strategy and beyond. At Amazon.com, you\u2019ll find a wide variety of Super Nintendo games from popular developers like Capcom, Rare Ltd., Konami, and more. Fans of action adventure titles can browse our selection to find your favorite Super Nintendo games like Donkey Kong Country, Super Mario World, and Earthworm Jim. Relive classic moments and explore familiar Super Nintendo games in a completely new way. If you\u2019re looking for retro games you\u2019ve never played before, be sure to browse by genre to find unfamiliar titles. Some players say the Super Nintendo ushered in the golden age of role playing games. Legendary titles like Zelda: A Link to the Past, Chrono Trigger, and The Secret of Evermore support this theory, with their compelling gameplay, engaging stories, and creative graphics. To find RPGs and other Super Nintendo games you love, you can use our helpful product filters. Simply choose the developers, genres, and price range you\u2019re interested in, and we\u2019ll create a list of products that fit your criteria. Our wide network of sellers means you can find rare and hard to find Super Nintendo games quickly and easily, even special edition cartridges. Many Super Nintendo games were popular enough to spawn several sequels, and eventually entire franchises. If you love playing Mario Kart on the Wii, you\u2019ll love exploring the roots of the series that began on the Super Nintendo. You\u2019ll find familiar faces, ballistic shells, and plenty of banana peels, as well as a handful of courses you recognize from newer games. Super Nintendo games have stood up to the test of time, and remain some of the most popular and entertaining video games ever made. You can find your copies and relive the excitement of the SNES at Amazon.com.", "parent_text": "More Systems", "keyword_density": {"super nintendo games": "7.0", "super nintendo": "6.5", "games": "3.5", "amazoncom": "0.6", "super": "3.5"}, "department_id": 75},
