{"department_text": "Camera, Photo & Video", "nr_products": "15289", "level": -1, "url": "http://www.amazon.com/s/ref=lp_525462_nr_n_1?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A502394%2Cn%3A525462%2Cn%3A300334&bbn=525462&ie=UTF8&qid=1394033683&rnid=525462", "text": "Video Projectors", "department_url": "http://www.amazon.com/Camera-Photo-Film-Canon-Sony/b/ref=sd_allcat_p/177-2158649-1745262?ie=UTF8&node=502394", "description_title": "Projectors from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_502394_nr_n_10?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A502394%2Cn%3A525462&bbn=502394&ie=UTF8&qid=1394033674&rnid=502394", "keyword_count": {"amazoncom": 1, "projectors": 3}, "description_wc": 324, "description_text": "Cinephiles will love to see their favorite film in a format that gives its wide-screen spectacle justice with one of these video projectors. When your television isn't big enough, purchasing a projector will give you the opportunity to watch a movie or show in high definition on your wall. You can even bring it out to your backyard for a bit of summertime movie watching. As you search through the various projector reviews, you'll see brand names like Epson, Sony, and BenO offering projection equipment that is both moderately priced and ready to provide you with the high-definition viewing you crave. Set it up in your living room, dim the lights and splash the sights of your favorite show, sporting event, or movie across your wall. Choose a projector that not only works in the dark, but can also be used in some low lighting situations. Of course, some movie fans can bring the movie theater experience anywhere in their home. Remodel your bonus room into your own theater, complete with movie seats, a projector and a screen to get the best out of your viewing experience. Connect your cable box, streaming device, or video game system to your projector and entertain yourself with a large viewing experience in the comfort of your own home. Some of the best projectors can also be used outside. If you want to have a nighttime barbecue while replicating the drive-in experience, use a projector to play one of your favorite movies for your friends and family. It's a fun way to experience your cinematic treats while enjoying the outdoors. At Amazon.com, you'll find plenty of projectors of all stripes, so you can choose the right one for your home entertainment needs. With shipping options that'll bring your projector to you within a few days, you're only a few clicks from taking your movie viewing to the next level.", "parent_text": "Projectors", "keyword_density": {"amazoncom": "0.3", "projectors": "0.9"}, "department_id": 73},
