{"department_text": "Video Games", "nr_products": "540", "level": -1, "url": "http://www.amazon.com/s/ref=lp_294940_nr_n_13?rh=n%3A468642%2Cn%3A%2111846801%2Cn%3A294940%2Cn%3A10995911&bbn=294940&ie=UTF8&qid=1394033680&rnid=294940", "text": "Intellivision", "department_url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/177-2158649-1745262?ie=UTF8&node=468642", "description_title": "Intellivision Games from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_468642_nr_n_12?rh=n%3A468642%2Cn%3A%2111846801%2Cn%3A294940&bbn=11846801&ie=UTF8&qid=1394033674&rnid=11846801", "keyword_count": {"intellivision games from amazoncom": 1, "amazoncom": 2, "intellivision games": 5, "games": 9, "intellivision": 6}, "description_wc": 330, "description_text": "Whether you call yourself a pop-culture archeologist, scouring the depths of retro gaming to relive the wonder of the late 1970s, or you just want to replay some old favorites, Amazon.com has a collection of Intellivision games for all audiences. You\u2019ll find a wide variety of Intellivision games to choose from, including Old adventure game classics such as Advanced Dungeons & Dragons: Cloudy Mountain and Tower of Doom. These classic games will have you exploring the depths of caverns or castles looking for treasures, keys, and more ammunition to use against a wide variety of exciting enemies. Since the Intellivision is a previous generation retro gaming system, the games are rare and our collection is constantly changing. That means what you see here today may not be here tomorrow, and new games are always emerging, so every time you visit, you may find a different collectible game cartridge you were looking for. Shooting games can also be a lot of fun, and are easy to pick up and play whenever you feel like it without having to read through a long storyline. Shoot UFOs and flying objects out of the sky with Intellivision games such as Atlantis and Astrosmash! to bolster your Earth-defending capabilities. Instead of defending your civilization on the surface, you could also retreat underground to find safety, treasure, and adventure in the classic game Dig Dug. They say timing is everything. That\u2019s especially true for some of the best puzzle and reflex-based Intellivision games we carry. Frogger will not only test your timing prowess, but also the importance of adhering to jay-walking laws and to only rely on turtles when all other options are lost. You can also jump barrels and save princesses in the old classic Donkey Kong for a thrilling and high-score-shattering good time. You can conduct as much \u201cpop-culture research\u201d as you want with the Intellivision games from Amazon.com, and have a great time doing it.", "parent_text": "More Systems", "keyword_density": {"intellivision games from amazoncom": "1.2", "amazoncom": "0.6", "intellivision games": "3.0", "games": "2.7", "intellivision": "1.8"}, "department_id": 75},
