{"department_text": "Video Games", "nr_products": "190", "level": -1, "url": "http://www.amazon.com/s/ref=lp_294940_nr_n_8?rh=n%3A468642%2Cn%3A%2111846801%2Cn%3A294940%2Cn%3A10994631&bbn=294940&ie=UTF8&qid=1394033680&rnid=294940", "text": "Commodore Amiga", "department_url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/177-2158649-1745262?ie=UTF8&node=468642", "description_title": "Commodore Amiga Games from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_468642_nr_n_12?rh=n%3A468642%2Cn%3A%2111846801%2Cn%3A294940&bbn=11846801&ie=UTF8&qid=1394033674&rnid=11846801", "keyword_count": {"commodore amiga games": 2, "amiga games": 5, "amiga": 9, "commodore amiga": 4, "amazoncom": 2, "amiga games from amazoncom": 1, "games": 13}, "description_wc": 329, "description_text": "Spanning seven years, the life of the Commodore Amiga was a colorful one full of exciting adventure and puzzling games. Now you can relive the glory-days of this retro gaming masterpiece with Amiga games from Amazon.com. We offer a wide selection of Commodore Amiga games to choose from. Since the Amiga is an older-generation computer and gaming system, the games are not manufactured anymore, meaning our collection of Amiga games may change based on availability. Tomorrow we may carry more than we do today, and the games we carry now may not be here the next day. Be sure to grab the titles you want quickly, and if you don\u2019t find what you\u2019re looking for, you can check back from time to time to see when we may have a copy. Now you can relive the thrilling action and adventure that Commodore Amiga games offered players in the late 80s and early 90s. Side-scrolling adventures like Golden Axe, Belial, and other games are precursors to many of the most-popular games out there today. You can even explore alternate worlds solve mysteries and find hidden treasures in old classics like Another World, Cruise for a Corpse, and Darkseed. If you\u2019re looking for Amiga games on a budget, you can try filtering your search by price so you can see the most affordable games first to bolster your home arcade. The Commodore Amiga was a diverse system that featured popular games from almost every genre you can think of. If you\u2019re a fan of war games, consider classic titles like Cabal, Nuclear War, and Canon Fodder, or try out Lemmings and its sequel for fun nail-biting strategy puzzles. You can even step back in time with such classic titles as Centurion: Defenders of Rome and Joan of Arc: Seige & Sword. You can find all the Amiga game floppy disks you need to relive the glory of gaming in the 1980s from Amazon.com.", "parent_text": "More Systems", "keyword_density": {"commodore amiga games": "1.8", "amiga games": "3.0", "amiga": "2.7", "commodore amiga": "2.4", "amazoncom": "0.6", "amiga games from amazoncom": "1.2", "games": "4.0"}, "department_id": 75},
