{"department_text": "Camera, Photo & Video", "nr_products": "8788", "level": 0, "url": "http://www.amazon.com/s/ref=lp_502394_nr_n_4?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A502394%2Cn%3A7161070011&bbn=502394&ie=UTF8&qid=1394033674&rnid=502394", "text": "Film Photography", "department_url": "http://www.amazon.com/Camera-Photo-Film-Canon-Sony/b/ref=sd_allcat_p/177-2158649-1745262?ie=UTF8&node=502394", "description_title": "Film Photography Equipment from Amazon.com", "parent_url": "http://www.amazon.com/Camera-Photo-Film-Canon-Sony/b/ref=sd_allcat_p/177-2158649-1745262?ie=UTF8&node=502394", "keyword_count": {"film photography": 7, "equipment": 7, "amazoncom": 2, "film photography equipment from amazoncom": 1, "film photography equipment": 6, "film": 18}, "description_wc": 369, "description_text": "If you miss the tactile pleasure and art of taking physical photos, developed commercially or in your own private darkroom, or you\u2019d like to be able to pass a tangible print between family and friends, the film photography equipment from Amazon.com can help you capture precious moments on real film. From instant photo films to analog cameras, we have a wide variety of film photography equipment to choose from. Our film cameras come in a selection of formats, sizes, designs, and more. Find tidy point-and-shoot film cameras, waterproof cameras you can use in the rain, and even high-quality SLR cameras for crystal clear landscapes, portraits, family pictures, and many other shots. If you\u2019re planning a party, barbecue, wedding reception, or other big event, we also offer disposable cameras to place around tables, counters, and more to inspire guests to take fun commemorative pictures of the big day. Once you\u2019ve picked out your camera, we also have a great selection of film among our camera and film photography equipment. You can find all of the standard sizes of film to fit any camera, including 35mm and instant film. Instant film cameras, including Fujifilm Instax and Polaroid models, can be incredibly fun for parties or for kids. Take a picture, wait a few minutes for it to develop, and you can have the fun, immediate gratification of a physical photo. You can find packs of multiple film rolls so you can always have enough to record trips, parties, family visits, and more. We even carry film from some of the most popular film photography equipment brands, including Fuji, Kodak, Impossible, and many others. You can also find a great selection of darkroom equipment for film photography as well. Slide viewers are extremely convenient ways to look at your negatives in detail without having to develop them first. We carry many smaller models with 2 x 2-inch displays that you can carry around wherever you go to show negatives to clients, family members, and more. We also carry many developing solutions, red bulbs, and other crucial film photography equipment to set up your very own darkroom. You can find quality film photography equipment at Amazon.com.", "parent_text": "Camera, Photo & Video", "keyword_density": {"film photography": "3.8", "equipment": "1.9", "amazoncom": "0.5", "film photography equipment from amazoncom": "1.4", "film photography equipment": "4.9", "film": "4.9"}, "department_id": 73},
