{"department_text": "Video Games", "nr_products": "15828", "level": 0, "url": "http://www.amazon.com/s/ref=lp_468642_nr_n_1?rh=n%3A468642%2Cn%3A%2111846801%2Cn%3A14210751&bbn=11846801&ie=UTF8&qid=1394033674&rnid=11846801", "text": "PlayStation 3", "department_url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/177-2158649-1745262?ie=UTF8&node=468642", "description_title": "PlayStation 3 from Amazon.com", "parent_url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/177-2158649-1745262?ie=UTF8&node=468642", "keyword_count": {"amazoncom": 2, "playstation 3": 8, "3": 11}, "description_wc": 342, "description_text": "The Sony PlayStation 3 is one of the most advanced gaming consoles ever produced. Cutting edge 3D graphics, 5.1 surround digital audio, fully integrated wireless networking, and a dozen other features make it a popular choice among gamers. The PlayStation 3 can do more than just play video games, too. With a Blu-Ray player and hard disk drives up to 500GB, this console is a complete home entertainment unit, capable of playing HD movies, streaming media content from your home computer, and even browsing the internet. At Amazon.com, we offer a complete line of PlayStation 3 consoles, games, and accessories to satisfy gamers, movie watchers, and media streamers alike. You\u2019ll find bestselling PlayStation 3 classics, new releases, and hard to find titles from popular developers like AcTiVision, Ubisoft, and Square Enix across all genres, from FPS to RPGs. To find PlayStation 3 games that you\u2019re interested in, you can use our fast and easy product filters. Choose the developers, genres, ESRB ratings, and release dates you want to browse, and we\u2019ll automatically create a list of games that meet your criteria. If you\u2019re looking to pick up accessories and add-ons for your PS3, you can browse our selection of PlayStation 3 controllers, keyboards, remotes, and more. The original Sony Dualshock controller is a time tested and well-loved peripheral. You\u2019ll find Dualshock and Sixaxis controllers in a wide variety of colors, including brilliant white, satin reds and blues, and even metallic silver and gold. If you\u2019re shopping for your first PlayStation 3, you\u2019ll find a wide selection of consoles to choose from, including Slim models with hard drive space ranging from 160 to 500GB. Many new games are downloadable, so larger hard drives are a must-have for avid gamers. The Sony PlayStation 3 is more than a simple gaming console. The PS3 is an all-in-one entertainment hub for games, movies, and more. Amazon.com carries the consoles, games, and accessories you need to enjoy one of the most popular gaming consoles.", "parent_text": "Video Games", "keyword_density": {"amazoncom": "0.6", "playstation 3": "4.7", "3": "3.2"}, "department_id": 75},
{"nr_products": "252292", "level": -1, "url": "http://www.amazon.com/s/ref=lp_172435_nr_n_0?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A502394%2Cn%3A172435%2Cn%3A13535371&bbn=172435&ie=UTF8&qid=1394033691&rnid=172435", "text": "Batteries & Chargers", "department_url": "http://www.amazon.com/Camera-Photo-Film-Canon-Sony/b/ref=sd_allcat_p/177-2158649-1745262?ie=UTF8&node=502394", "description_wc": 0, "parent_url": "http://www.amazon.com/s/ref=lp_502394_nr_n_0?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A502394%2Cn%3A172435&bbn=502394&ie=UTF8&qid=1394033674&rnid=502394", "parent_text": "Accessories", "department_text": "Camera, Photo & Video", "department_id": 73},
{"department_text": "Musical Instruments", "nr_products": "7577", "level": 0, "url": "http://www.amazon.com/s/ref=lp_11091801_nr_n_7?rh=n%3A11091801%2Cn%3A%2111965861%2Cn%3A11973881&bbn=11965861&ie=UTF8&qid=1394033673&rnid=11965861", "text": "DJ, Electronic Music & Karaoke", "department_url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/177-2158649-1745262?ie=UTF8&node=11091801", "description_title": "DJ Equipment from Amazon.com", "parent_url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/177-2158649-1745262?ie=UTF8&node=11091801", "keyword_count": {"equipment": 6, "amazoncom": 2, "dj": 10, "dj equipment": 4}, "description_wc": 328, "description_text": "Being a DJ is about spinning a mixture of music, lighting, and timing to create ambience and the perfect environment for guests to enjoy their night out. With the DJ equipment and synthesizers from Amazon.com in your booth, you can drop beats with the best of them. Our DJ mixers, controllers and other equipment can help you scratch, mix, loop and more with ease. Ditch the vinyl, now you can hook up electronic turn tables to your computer or MP3 player and mix your entire library. Many of our models are portable enough that you can always be ready to DJ at a moment\u2019s notice. If you need your DJ equipment fast, we have a variety of expedited shipping options, so you can get the party started on time. When the club or the party gets loud and rowdy, every DJ needs a reliable pair of headphones. You need to keep an ear for the musical cues, and make sure the levels are right to ensure a smooth, musical experience. Our DJ headphones block out ambient noise and keep your monitoring cues out of your microphones. Used with your own home computer, our drum machines, synthesizers, and other DJ equipment can even help you create original mixes, mash-ups, and tracks. Now that you have your music all set up, it\u2019s time to add a little light show. We carry a variety of DJ lighting and equipment, including laser lights, fog machines, mirrored disco balls, and more so you can set the mood. Our ribbons of LED lights are ideal for marking off dance floors, adding accent to the architecture of a venue, and decorating to your booth. Our strobes are ideal for when the beat picks up and you want to let the dancers get lost in a sensory experience. When you need an extra oomph to get your next party, reception, or school dance bumping, check out the selection of DJ equipment at Amazon.com.", "parent_text": "Musical Instruments", "keyword_density": {"equipment": "1.8", "amazoncom": "0.6", "dj": "3.0", "dj equipment": "2.4"}, "department_id": 78},
