{"department_text": "Musical Instruments", "nr_products": "3441", "level": -1, "url": "http://www.amazon.com/s/ref=lp_405757011_nr_n_1?rh=n%3A11091801%2Cn%3A%2111965861%2Cn%3A405757011%2Cn%3A11974921&bbn=405757011&ie=UTF8&qid=1394033694&rnid=405757011", "text": "Monitors, Speakers & Subwoofers", "department_url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/177-2158649-1745262?ie=UTF8&node=11091801", "description_title": "Stage Monitors from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_11091801_nr_n_8?rh=n%3A11091801%2Cn%3A%2111965861%2Cn%3A405757011&bbn=11965861&ie=UTF8&qid=1394033673&rnid=11965861", "keyword_count": {"stage monitors": 3, "amazoncom": 2, "monitors": 7, "stage": 11}, "description_wc": 308, "description_text": "Musicians know that their success on stage depends on the right combination of musical talent and their ability to project to their audience. Stage monitors work to feed sound back to the musician so that performances go off without a hitch. At Amazon.com, we have you covered with a variety of monitors and speakers to benefit all of your stage shows. Stage monitors come in many shapes and sizes. You can use headsets, large speakers, discreet floor models and combination surround sound units to ensure that what you are performing is reaching your audience as intended. We know that every musician has different requirements, so we designed our selection to meet those needs. Headset and inner ear monitors provide continuous feedback on your performance. You'll find that these options work well during recording sessions as well as when you're on stage in front of a live audience. Are you an individual performer? If so, you may be looking for a discrete floor stage monitor that lets you hear exactly what your audience is hearing. Multiple performers on stage may be able to use multiple floor monitors to track their sounds. Pair these models with personal mixers to adjust the way microphones and amplified instruments are broadcast. For larger productions or multimember bands, you will probably be interested in larger stage monitors or combination surround-sound monitors. These options will enable you to hear the combination of sounds coming from you and your fellow performers. Like smaller floor models, these can also be paired with on-stage mixers to adjust sound mid-performance. We offer a large variety of options to suit your stage monitor needs, with models available to meet any budget. Enhance your performance when you ensure that you control exactly what your audience hears. Use Amazon.com for all your stage monitor and performance necessities.", "parent_text": "Live Sound & Stage", "keyword_density": {"stage monitors": "1.9", "amazoncom": "0.6", "monitors": "2.3", "stage": "3.6"}, "department_id": 78},
{"department_text": "Musical Instruments", "nr_products": "14467", "level": -1, "url": "http://www.amazon.com/s/ref=lp_405757011_nr_n_4?rh=n%3A11091801%2Cn%3A%2111965861%2Cn%3A405757011%2Cn%3A11974231&bbn=405757011&ie=UTF8&qid=1394033694&rnid=405757011", "text": "Lighting Equipment & Accessories", "department_url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/177-2158649-1745262?ie=UTF8&node=11091801", "description_title": "Lighting Equipment and Accessories from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_11091801_nr_n_8?rh=n%3A11091801%2Cn%3A%2111965861%2Cn%3A405757011&bbn=11965861&ie=UTF8&qid=1394033673&rnid=11965861", "keyword_count": {"equipment": 8, "amazoncom": 1, "lighting": 9, "lighting equipment and accessories": 7}, "description_wc": 311, "description_text": "When you're looking for lighting equipment and accessories, you need a great range to brighten up your show or even your home. Light is a big part of our lives, and it's our way of celebrating the various festivals of the year, from Diwali to Christmas. When you pair it with music, however, you create something awesome. When you're looking for lighting equipment and accessories, you might consider long rows of LED lights. These can come in a number of colors, and as they're LEDs, they won't put a major dent in your electric bill. Strips are great as they can be quickly strung up as they come on spools. Other lighting equipment and accessories include fog machines. These machines emit dense vapor that either crawls across the floor or rises slowly, depending on the type it is. Dry ice vapors crawl; glycerin/water mixes rise slowly. These can provide impressive effects for your party or show. Some lighting equipment and accessories include disco balls and disco lights. These can throw glittering highlights across the room and can really contribute to the atmosphere at a party or event. You might also consider remote control floodlights, as these lighting equipment and accessories can add an extra dash of brightness to your room. When you're thinking about what sort of lighting equipment and accessories to get, you cannot forget the cables that you need to hook it all up. While you may be able to control many things remotely, it's sometimes better to have a few cables in case your wireless device packs up. Whether you're contemplating stage lighting by PSSL, DJ equipment by KpoDJ, or just some stage lighting from Christmas Central, you'll find the right lighting equipment and accessories at Amazon.com. There's one thing you simply cannot forget, though: spare bulbs.", "parent_text": "Live Sound & Stage", "keyword_density": {"equipment": "2.6", "amazoncom": "0.3", "lighting": "2.9", "lighting equipment and accessories": "9.0"}, "department_id": 78},
