{"department_text": "Video Games", "level": 1, "url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/177-2158649-1745262?ie=UTF8&node=468642", "text": "Video Games", "department_url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/177-2158649-1745262?ie=UTF8&node=468642", "description_title": "Video Games from Amazon.com", "keyword_count": {"video": 6, "amazoncom": 3, "video games": 5, "games": 9}, "description_wc": 227, "description_text": "Amazon\u2019s Video Games store is your entertainment hub for everything related to Video Games. The store features thousands of games at great prices and allows you to shop by gaming platform, bestsellers, new and future releases, bonus offers, price, deals, genre, ESRB rating, and more. You can shop for every type of game you may be looking for, including Xbox 360 , PlayStation 3 , PlayStation 4 , Nintendo Wii and Wii U, Nintendo 3DS, PlayStation Vita, Digital, Free-to-Play, Kindle Fire, PC and Mac, Nintendo DS, and much more. When you\u2019re looking to join in on the hottest new video game developments online, there\u2019s no better place to be than Amazon.com. Our new & future releases section features the latest games and newest pre-order options. Its streamlined, hassle-free pages are perfect for locating new video games in seconds, so you\u2019ll be at the forefront of all the action and right in line with even the most hardcore gaming aficionados. No matter which gaming system you use, Amazon.com offers the latest updates and releases on new video games. For bonus offers and everyday savings on a wide selection of games and accessories, visit our Deals Store . Don\u2019t forget to trade in the games you\u2019ve already finished for Amazon.com gift cards in the Video Games Trade-In Store .", "parent_text": "Movies, Music, Games", "keyword_density": {"games": "4.1", "amazoncom": "1.4", "video games": "4.5", "video": "2.7"}, "department_id": 68},
{"department_text": "Musical Instruments", "level": 1, "url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/177-2158649-1745262?ie=UTF8&node=11091801", "text": "Musical Instruments", "department_url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/177-2158649-1745262?ie=UTF8&node=11091801", "description_title": "Amazon.com's Musical Instruments Store", "keyword_count": {"musical instruments store": 2, "instruments": 6, "amazoncom": 3, "musical instruments": 5, "musical": 6, "store": 5}, "description_wc": 277, "description_text": "Welcome to the Musical Instruments Store at Amazon.com. From stage to studio, this is your source for the gear you need to perform your best--whether you\u2019re a beginner or a seasoned musician. Browse our selection of guitars, keyboards, basses, amps, drums, stringed instruments, band & orchestra, DJ gear, and more to get set up with the perfect instrument. Check out the latest recording equipment, from microphones to monitors and audio interfaces to DAW software. Take care of your live sound needs with power amps, speakers, and cables galore. Pick up some pro lighting effects for your next gig. Or how about some fun kids\u2019 musical instruments to get \u2018em started at a young age? Whatever your goal--outfitting a venue, recording a rock & roll masterpiece, DJing parties, learning violin--Amazon has you covered. Check out top deals, gift ideas, best-selling gear, and featured brands such as Fender, Gibson, Line 6, Pearl, M-Audio, Avid, Shure Microphones, Zildjian, Sabian, Peavey, Epiphone, Yamaha, Casio, and hundreds more. Take advantage of Amazon Prime shipping, financing with the Amazon.com Store Card, and other special offers. Browse our special stores, such as the Beginner Store for students and those just starting out, or the Musical Instruments Outlet, featuring huge markdowns on all kinds of gear and equipment. Need accessories for your instrument? No problem\u2014pick up some strings, sticks, reeds, picks, stands, tuners, or anything else you might need from our huge selection. And, as with all things Amazon.com, check out customer reviews of musical instruments to help make your choice. Whatever your musical needs, you\u2019ll find it here in the Musical Instruments Store. Start making some music today!", "parent_text": "Movies, Music, Games", "keyword_density": {"musical instruments store": "2.2", "instruments": "2.2", "amazoncom": "1.1", "musical instruments": "3.6", "musical": "2.2", "store": "1.8"}, "department_id": 66},
{"department_text": "Movies & TV", "level": 1, "url": "http://www.amazon.com/movies-tv-dvd-bluray/b/ref=sd_allcat_mov/177-2158649-1745262?ie=UTF8&node=2625373011", "text": "Movies & TV", "department_url": "http://www.amazon.com/movies-tv-dvd-bluray/b/ref=sd_allcat_mov/177-2158649-1745262?ie=UTF8&node=2625373011", "description_title": "More About Movies & TV at Amazon", "keyword_count": {"tv": 6, "movies": 3, "amazon": 2, "movies tv": 2}, "description_wc": 164, "description_text": "The Amazon Movies & TV Store is your one stop shop for films and TV shows--new releases, best sellers, and today's best deals. With over 500,000 DVDs and Blu-rays to choose from, you\u2019ll find plenty of favorites right here. Search for exactly what you\u2019re looking for or discover new DVD and Blu-ray titles by browsing the Movies & TV Store. You can shop by genre, format, price, and more, or check out editors\u2019 picks for a curated selection. Shop our Deals Store for daily movie and TV deals on DVD and Blu-ray, as well as our TV and Blu-ray Deal of the Week. Finally, if you\u2019re looking for new movies or TV shows, check out the New Release store. When you pre-order select DVDs or Blu-rays at Amazon you get our Pre-order Price Guarantee. Also, you can receive your order on release date with our Release-Date Delivery program (restrictions apply). Happy Shopping!", "parent_text": "Movies, Music, Games", "keyword_density": {"tv": "3.7", "movies": "1.8", "amazon": "1.2", "movies tv": "2.5"}, "department_id": 61},
{"department_text": "Blu-ray", "level": 1, "url": "http://www.amazon.com/movies-tv-bluray-bluray3d/b/ref=sd_allcat_blu/177-2158649-1745262?ie=UTF8&node=2901953011", "text": "Blu-ray", "department_url": "http://www.amazon.com/movies-tv-bluray-bluray3d/b/ref=sd_allcat_blu/177-2158649-1745262?ie=UTF8&node=2901953011", "description_title": "More About Blu-ray at Amazon Movies & TV", "keyword_count": {"blu ray": 6, "movies": 4, "amazon": 1, "movies tv": 2}, "description_wc": 111, "description_text": "The Amazon.com Movies & TV Blu-ray Store is your one-stop shop for everything Blu-ray. Browse best sellers, today\u2019s deals, top new and upcoming releases, hit movies, and more. Find titles to take advantage of everything your Blu-ray player offers: high-definition 1080p video, multi-channel surround sound, extra features with Bonus View or online with BD Live, or immersive 3D Blu-ray titles. Take a look at customer Blu-ray reviews of movies, TV shows, documentaries, and other favorites, from the Star Wars series to Avatar. Whether you\u2019re shopping for a gift or are an avid collector, you\u2019ll find the best Blu-ray movies here.", "parent_text": "Movies, Music, Games", "keyword_density": {"blu ray": "10.8", "movies": "3.6", "amazon": "0.9", "movies tv": "3.6"}, "department_id": 62},
