{"department_text": "Magazines", "level": 1, "url": "http://www.amazon.com/magazines/b/ref=sd_allcat_magazines/177-2158649-1745262?ie=UTF8&node=599858", "text": "Magazines", "department_url": "http://www.amazon.com/magazines/b/ref=sd_allcat_magazines/177-2158649-1745262?ie=UTF8&node=599858", "description_title": "More About Amazon Magazines", "keyword_count": {"amazon magazines": 1, "amazon": 4, "magazines": 9}, "description_wc": 260, "description_text": "Amazon Magazines offers tens of thousands of discount magazine subscriptions , spanning every topic. We have bestselling magazines like National Geographic , Vogue , Esquire , and more. Or you can shop by favorite topics like fashion magazines , home & garden magazines , entertainment magazines , cooking magazines , and craft magazines . Magazine subscriptions make great gifts. Check out our magazine gift ideas for our editors\u2019 recommendations for moms , dads , kids , family , and co-workers . After you order, select from gift notification options including email or printing a gift note - both are easily available from the Magazine Subscription Manager . Learn more about our gift notification options. The Magazine Subscription Manager gives you complete control of your magazine subscriptions online. You can change your address, cancel for a pro-rated refund, report a problem to the publisher, send a gift notification, and keep track of your expiration dates. Amazon makes managing all of your magazine subscriptions easy. You can also use the Magazine Subscription Manager to manage magazines that you didn't purchase on Amazon. Just go to Magazine Subscription Manager and click on 'add a new magazine' to start the process. Don\u2019t want to worry about renewing your favorite magazines every year? Each magazine that has 'auto-renewal' in its title comes with Amazon\u2019s auto-renewal service. We offer the same price to both new and renewing subscribers, and you won\u2019t receive any renewal notices. You can turn off auto-renewal at any time in the Magazine Subscription Manager .", "parent_text": "Books, Audible", "keyword_density": {"amazon magazines": "0.8", "amazon": "1.6", "magazines": "3.7"}, "department_id": 56},
