{"department_text": "Audible Audiobooks & More", "level": 1, "url": "http://www.amazon.com/b/ref=sd_allcat_aud_bks/177-2158649-1745262?ie=UTF8&node=2402172011", "text": "Audible Audiobooks & More", "department_url": "http://www.amazon.com/b/ref=sd_allcat_aud_bks/177-2158649-1745262?ie=UTF8&node=2402172011", "description_title": "About Audible Audiobooks", "keyword_count": {"audible": 5, "audiobooks": 6}, "description_wc": 177, "description_text": "Audible.com is the Internet's leading provider of digital audiobooks, featuring more than 150,000 titles available for download. These titles include books, magazines, radio shows, podcasts, stand-up comedy, and speeches. We feature the best narrators interpreting bestselling books by top authors. Audible's audiobooks can be downloaded to over 500+ mp3 players, including Kindle\u2122 and iPod\u00ae. You can also download and listen to audiobooks on MP3 players from Creative, Zune, and other top manufacturers. And with Audible's new apps for iPhone\u2122 and Android\u2122, you can now download and listen to audiobooks wirelessly on your phone. The best way to experience Audible is as a member. Members choose a listening plan that suits their pace, and enjoy access to exclusive sales, promotions, and discounts. Members also receive monthly credits good for the audiobook of their choice, plus 30% off all audiobooks purchased without credits. So, if you'd like to enjoy more books, more often, experience books in a whole new way with digital audiobooks from Audible.com that you can listen to anytime, anywhere.", "parent_text": "Books, Audible", "keyword_density": {"audible": "2.9", "audiobooks": "3.4"}, "department_id": 59},
