{"department_text": "Musical Instruments", "nr_products": "106223", "level": 0, "url": "http://www.amazon.com/s/ref=lp_11091801_nr_n_9?rh=n%3A11091801%2Cn%3A%2111965861%2Cn%3A11973111&bbn=11965861&ie=UTF8&qid=1394033701&rnid=11965861", "text": "Studio Recording Equipment", "department_url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/177-2158649-1745262?ie=UTF8&node=11091801", "description_title": "Recording Equipment from Amazon.com", "parent_url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/177-2158649-1745262?ie=UTF8&node=11091801", "keyword_count": {"recording": 9, "recording equipment": 6, "amazoncom": 3}, "description_wc": 339, "description_text": "You don\u2019t need to wait for a major label to notice you before you start making your own records. Setting up a cutting-edge digital studio with professional, quality recording equipment is easier and more affordable than ever for the first timer, and experienced audio engineers have access to an enormous variety of outstanding mics, preamps, monitors, and other recording equipment. In the age of the digital audio workstation, the heart of most home recording equipment is a quality interface. At Amazon.com, we have a huge selection of home recording gear, whether you need a two-channel interface for recording podcasts and simple music projects, or a 32-channel board for full band recordings. A reliable, great sounding interface is the crucial link between the performance and your computer. All your other recording equipment will be routed through your interface, so it\u2019s important to choose the right model. Browse user reviews written by other musicians to find products with great real-life performance from top brands like Focusrite, M-Audio, and Tascam. From studio staples like the Shure SM57 to newer, trend-setting recording equipment like the Blue Blueberry, you\u2019ll find microphones for vocals, electric guitars, acoustic instruments, and more at Amazon.com. For live applications, dynamic cardioid mics are perfect for vocals, but in the controlled environment of the studio, a large diaphragm condenser mic will more accurately capture the depth and nuance of your performance. Choose from brands like AKG, Sennheiser, and Rode to find the perfect mic for your style and budget. Before you can get your tracks on the radio, they need to be mixed and mastered on accurate, transparent studio monitors. Home speakers equalize and color audio, and make it difficult to mix accurately. What sounds good on one set of home speakers might sound muddy on another, which is why professionals rely on recording equipment like quality monitors to solidify their mixes. From legendary Yamaha reference monitors, to affordable KRKs, there\u2019s a set of speakers for every studio at Amazon.com.", "parent_text": "Musical Instruments", "keyword_density": {"recording": "2.7", "recording equipment": "3.5", "amazoncom": "0.9"}, "department_id": 66},
