{"department_text": "Musical Instruments", "nr_products": "13049", "level": -1, "url": "http://www.amazon.com/s/ref=lp_11965871_nr_n_5?rh=n%3A11091801%2Cn%3A%2111965861%2Cn%3A11965871%2Cn%3A5524110011&bbn=11965871&ie=UTF8&qid=1394033705&rnid=11965871", "text": "Orchestral Strings Accessories", "department_url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/177-2158649-1745262?ie=UTF8&node=11091801", "description_title": "Orchestral String Accessories from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_11091801_nr_n_6?rh=n%3A11091801%2Cn%3A%2111965861%2Cn%3A11965871&bbn=11965861&ie=UTF8&qid=1394033701&rnid=11965861", "keyword_count": {"orchestral string accessories": 1, "amazoncom": 2, "orchestral string": 11, "string": 16, "accessories": 5}, "description_wc": 355, "description_text": "The boisterous baritone of the cello, or the warm, rich sound of the violin and violas, make orchestral strings a popular choice for the beginning musician, and together make up string quartets. Caring for your instrument with the right orchestral string accessories ensure perfect precision each time you pick up your bow. Whether you're a novice or a professional you can find everything you need on Amazon.com to keep your orchestral strings tuned and conditioned. Take time to browse our selection of orchestral strings accessories from a variety of manufacturers, including Vio Music, Larsen, Stagg, Thomastik, and Artino. Choose an endpin tip, stop, or disc to balance your instrument while playing and protect your delicate hardwood and tile floors as well. If practicing keeps the rest of the house up, invest in a practice mute for your\u2014it's one accessory that will preserve peace while you hone your stringed-instrument skills. If you play professionally, replacement strings are just one of the cello orchestral strings you won't want to be without. Shop our wide selection from the comfort of your couch, and enjoy quick shipping, so you'll always be ready to play. They're also a great idea for a band teacher to keep on hand for forgetful students, with multipacks of student strings available at reasonable prices. You'll also want to keep your bow perfectly primed with one of a multitude of orchestral strings rosins we have in stock; many of them formulated for use specifically with the each type of orchestral string instrument. When your music keeps you on the road, search our orchestral strings accessories for lightweight cases that are airline travel approved. Several have padding to keep your orchestral stringed instrument protected from turbulence or potholes if you travel by road. In the event of an unfortunate incident, we're proud to offer various replacement parts; including spare bows, bridges, endpins, fingerboards, and bibs. All offered at affordable prices that make shopping for your orchestral strings accessories a breeze. You make beautiful music with a bow and strings; Amazon.com makes picking up orchestral strings accessories easy.", "parent_text": "Instrument Accessories", "keyword_density": {"orchestral string accessories": "0.8", "amazoncom": "0.6", "orchestral string": "6.2", "string": "4.5", "accessories": "1.4"}, "department_id": 66},
