{"department_text": "Musical Instruments", "nr_products": "23437", "level": 0, "url": "http://www.amazon.com/s/ref=lp_11091801_nr_n_2?rh=n%3A11091801%2Cn%3A%2111965861%2Cn%3A11970241&bbn=11965861&ie=UTF8&qid=1394033701&rnid=11965861", "text": "Drums & Percussion", "department_url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/177-2158649-1745262?ie=UTF8&node=11091801", "description_title": "Drums from Amazon.com", "parent_url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/177-2158649-1745262?ie=UTF8&node=11091801", "keyword_count": {"amazoncom": 2, "drums": 9}, "description_wc": 420, "description_text": "Percussion instruments are the most ancient instruments of all, and were present in the early tribal days of nearly every civilization. Drums today are an important part of human culture, not just because they speak to a variety of musical heritages, but because it\u2019s said we all carry around a personal rhythm in our beating hearts. At Amazon.com, we honor one of the world\u2019s oldest traditions by offering drums and percussion accessories for every level of player. Looking for complete drum sets for the drummer in your life? You\u2019ll feel like a king when you sit at the throne of a new five-piece drum set from one of the industry\u2019s most popular brands, such as Pearl, Tama, Mapex, and more. We even offer all the extra bells and whistles so you can start rocking away. Find all the drum accessories you need, from double bass pedals, cymbals, and triangles, to replacement drum heads, drum stools, and stands. When you need more cow bell, or your intense, gut-busting, around-the-world drum fills break the heads off of your sticks, be sure to stock up on replacement sticks and other drum accessories. If you\u2019re looking for more traditional hand drums, you can travel the world with our assortment of hand drums from all over the world. Djembes are rich-sounding, African drums that can produce a variety of tones. Check out our selection of doumbeks, Arabic drums, usually made of metal, that provide crisp, melodic cracks and pops. Hand drums and other handheld percussions, like tambourines and shakers, are great for impromptu jam sessions and for kids to learn basic rhythms. Our bongos are fun for reliving the glory of the beat poets of the 1950s, or for a foray into the lively musical traditions of salsa, son, or samba. Electronic drum sets provide a great way to practice without rattling the whole house. These sets provide volume control so you won\u2019t wake up the neighbors, but you can also plug in headphones to achieve a very quiet percussion session. That way only you will feel the noise. Electronic drums make ideal beginning sets, so students who are a little shy to practice out loud can just play to themselves. An extra benefit of electric drum sets is that some come equipped with built-in metronomes to keep you on time. Drum up a little inspiration and vigor--and keep the beat going on--with all the drums and percussion instruments from Amazon.com.", "parent_text": "Musical Instruments", "keyword_density": {"amazoncom": "0.5", "drums": "2.1"}, "department_id": 66},
