{"department_text": "Video Games", "nr_products": "5009", "level": 0, "url": "http://www.amazon.com/s/ref=lp_468642_nr_n_9?rh=n%3A468642%2Cn%3A%2111846801%2Cn%3A2622269011&bbn=11846801&ie=UTF8&qid=1394033698&rnid=11846801", "text": "Nintendo 3DS", "department_url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/177-2158649-1745262?ie=UTF8&node=468642", "description_title": "3DS Games from Amazon.com", "parent_url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/177-2158649-1745262?ie=UTF8&node=468642", "keyword_count": {"games": 10, "amazoncom": 1, "3ds games": 9, "3ds": 13}, "description_wc": 298, "description_text": "Whether you\u2019re craving a mind-bending puzzle or adventures in plumbing, Nintendo 3DS games elevate your gaming experience to an incredible new dimension. Amazon.com wants to help you savor your gaming endeavors through uncharted territory, which is why you\u2019ll find cases and protectors, along with 3DS games, to safeguard your pocket-sized device. Looking for an immersive gaming machine that you can bring with you on any journey? The Console Guide is your first stop on the way to 3DS games and 3-dimensional freedom. It features a varied selection of 3DS devices, from extra-large varieties to brightly colored units and the all-inclusive 3DS bundle. These products will propel your life into action even when you\u2019re playing 3DS games from your couch. The Nintendo 3DS Games Store contains all of your favorite portable games, including 3DS classics and stunning new releases. Narrow your search for 3DS games by genre, release date, and rating to quickly browse titles. Popular 3DS games include Paper Mario: Sticker Star, Pok\u00e9mon White and Black, Mario Kart 7, and Frogger 3DS. We pride ourselves on providing the most recent Nintendo hardware and a considerable collection of 3DS games for fun that never ends. No 3-dimensional travel partner is complete without the proper accessories. We offer a large variety of Nintendo cases, screen protectors, cartridge boxes, and comfort grips to make your device feel a little more hefty and secure in your hands. These products keep your portable device safe and sound while you\u2019re out and about. For the gamer on the go, 3DS games from Nintendo will deliver fun-filled journeys over land, sea, and air with fully immersive, never-before-seen, 3-dimensional gameplay. It\u2019s portable gaming done right for kids and adults alike.", "parent_text": "Video Games", "keyword_density": {"3ds games": "6.0", "amazoncom": "0.3", "games": "3.4", "3ds": "4.4"}, "department_id": 68},
