{"department_text": "Musical Instruments", "nr_products": "3079", "level": 0, "url": "http://www.amazon.com/s/ref=lp_11091801_nr_n_1?rh=n%3A11091801%2Cn%3A%2111965861%2Cn%3A11971311&bbn=11965861&ie=UTF8&qid=1394033701&rnid=11965861", "text": "Bass Guitars", "department_url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/177-2158649-1745262?ie=UTF8&node=11091801", "description_title": "Bass Guitars from Amazon.com", "parent_url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/177-2158649-1745262?ie=UTF8&node=11091801", "keyword_count": {"amazoncom": 1, "bass guitars": 5, "bass": 14}, "description_wc": 355, "description_text": "Electric bass guitars have been the foundation of the rock, funk, and R&B sound for decades. Legends like Geddy Lee, Bootsy Collins, and Flea defined and redefined what was possible with only four strings on every album they released. Holding down the bottom end is no small task, so make sure your bass and amp give you all the low frequency thunder you need to shake up the crowd all night long. When Leo Fender released the Precision Bass in 1951, no one could have guessed how far reaching of an impact it would have. Bass players were able to compete with drummers and horn sections for volume, and whole new genres of music emerged. A lot has changed since then, however. Bass guitars with active electronics, exotic wood bodies, and 5 or more strings are common, giving modern bass players have unprecedented control over their sound. You\u2019ll find bass guitars with from Fender, Gibson, Warwick, and other top brands at Amazon.com. Our product filters make it easy to browse basses you\u2019re interested in. Just choose the brands, colors, and even number of strings you want, and we\u2019ll show you instruments that fit your style and sound. Are you looking for a new way to supercharge your tone? Bass guitars that are equipped with active pickups like the EMG-P humbucker have highly articulated high-end response, combined with a powerful low end, and virtually no unwanted feedback. Whether you\u2019re going for a warm, tube-driven vintage vibe, or a heavy modern sound, choosing the right bass amp is crucial to getting the most out of your bass guitar\u2019s tone. Classic amp makers like Ampeg deliver all the 1970s authenticity and charm you could want from a bass amp, while newer manufacturers like Genz Benz and Gallien-Kreuger can get you more watts per dollar than ever before. Behind every guitar solo, epic vocal performance, and catchy keyboard hook, there\u2019s a solid wall of thick, groovy bass propping it all up. Make the most of your sound with bass guitars and amps that maximize your rumble and roar.", "parent_text": "Musical Instruments", "keyword_density": {"amazoncom": "0.3", "bass guitars": "2.8", "bass": "3.9"}, "department_id": 66},
