{"department_text": "Car Electronics & GPS", "nr_products": "6708", "level": -1, "url": "http://www.amazon.com/s/ref=lp_10980521_nr_n_10?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A3248684011%2Cn%3A1077068%2Cn%3A10980521%2Cn%3A1253823011&bbn=10980521&ie=UTF8&qid=1394033698&rnid=10980521", "text": "Vehicle Backup Cameras", "department_url": "http://www.amazon.com/Car-Electronics/b/ref=sd_allcat_gps/177-2158649-1745262?ie=UTF8&node=1077068", "description_title": "Vehicle Backup Cameras from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_1077068_nr_n_1?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A3248684011%2Cn%3A1077068%2Cn%3A10980521&bbn=1077068&ie=UTF8&qid=1394033674&rnid=1077068", "keyword_count": {"backup cameras": 3, "amazoncom": 1, "vehicle backup cameras": 2, "backup": 7, "vehicle": 4}, "description_wc": 299, "description_text": "You can't have eyes in the back of your head, but you can put them on the back of your vehicle by installing a backup camera. These devices use wired or wireless installations to connect a small camera on the back of your car to a screen mounted on or in your dashboard, helping you see what's going on behind you. At last, you can quit worrying about running into other vehicles or low obstacles. While vehicle backup cameras are fairly straightforward devices, you'll find a few differences between the various models available. Perhaps the most noteworthy difference is the range of viewing angle your camera provides: anything from 120 degrees to 180 degrees. For most purposes, the basic 120-degree angle is adequate. However, if you're in the habit of towing boats or trailers, you might want a backup camera with a wider view angle for easier backing into turns. Other options to look for include mounting location, infrared capability, night vision quality, wired or wireless installation, and weatherproofing. All of these options depend on your needs and tastes. If you are installing it yourself, a wireless backup camera with good weatherproofing would probably be better. If you're looking for a backup camera to add after-market value to a very nice-looking car, you'll probably be interested in subtle placement, like in a license plate frame. It's also a good idea to read the reviews others have written about backup cameras. At Amazon.com, you'll find a great selection of vehicle backup cameras, and our community of customers and users can help you identify problems before they happen. No matter what kind of rear-mounted camera you need, we can deliver it to your doorstep right when you need it.", "parent_text": "Car Video", "keyword_density": {"vehicle backup cameras": "2.0", "amazoncom": "0.3", "backup cameras": "2.0", "backup": "2.3", "vehicle": "1.3"}, "department_id": 77},
