{"department_text": "Storage & Organization", "nr_products": "559172", "level": 1, "url": "http://www.amazon.com/s/ref=lp_1055398_nr_n_11?rh=n%3A1055398%2Cn%3A%211063498%2Cn%3A3610841&bbn=1063498&ie=UTF8&qid=1394033734&rnid=1063498", "text": "Storage & Organization", "department_url": "http://www.amazon.com/s/ref=lp_1055398_nr_n_11?rh=n%3A1055398%2Cn%3A%211063498%2Cn%3A3610841&bbn=1063498&ie=UTF8&qid=1394033734&rnid=1063498", "description_title": "Home Storage from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "keyword_count": {"home": 8, "amazoncom": 2, "storage": 10, "home storage": 4}, "description_wc": 307, "description_text": "Every household has that drawer, closet, or room that is in desperate need of decluttering. Home storage products from Amazon.com, including laundry sorting bins, shelving, and closet systems, can help straighten out messy and chaotic areas throughout your house. Looking for a tasteful way to clear the clutter from your home? Our Furniture and Decor Storage Store has decorative racks, floating shelves, and a variety of kitchen storage products to help. Get the right home storage tools to help you clear off that coffee table and the top of the television and eliminate the pile of books in the corner. These products will also help you manage and store everything that is hiding in the back of your kitchen cabinets and behind the living room couch. Looking to sort your jumbled pile of outdoor tools? We proudly offer several options to help you in our Outdoor Storage Store. Our outdoor home storage tools include large-scale solutions, like storage sheds and smaller items, such as deck boxes and decorative storage benches. These products will not only help you clear lawn tools, toys, and other things out of your yard, they will also protect those items from the elements and enhance your home's curb appeal. What about making the pet's feeding corner look less like a natural disaster site? Our Pet Product Organizer Store offers a variety of things you\u2019ll need to keep your pet's food secure from prying snouts and off the floor, like feeding stations, storage drawers, and bowl holders. Browse our pooper-scoopers and bags that help you tackle another messy chore, too. There is no reason to let chaos keep you from enjoying your home. Take back every area permanently. Armed with home storage equipment from Amazon.com, you can attack the mess head on and bring order to your home.", "parent_text": "Home, Garden, Tools", "keyword_density": {"home": "2.6", "amazoncom": "0.7", "storage": "3.3", "home storage": "2.6"}, "department_id": 160},
