{"department_text": "Bath", "nr_products": "255870", "level": 1, "url": "http://www.amazon.com/s/ref=lp_1055398_nr_n_3?rh=n%3A1055398%2Cn%3A%211063498%2Cn%3A1063236&bbn=1063498&ie=UTF8&qid=1394033734&rnid=1063498", "text": "Bath", "department_url": "http://www.amazon.com/s/ref=lp_1055398_nr_n_3?rh=n%3A1055398%2Cn%3A%211063498%2Cn%3A1063236&bbn=1063498&ie=UTF8&qid=1394033734&rnid=1063498", "description_title": "Bathroom Supplies from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "keyword_count": {"bathroom": 17, "amazoncom": 2, "bathroom supplies": 6}, "description_wc": 306, "description_text": "Whether you are stocking your new bathroom after a move or simply improving the usability of your existing bathroom, Amazon.com has the bathroom supplies you need. Our bathroom supplies help you clear up clutter in the bathroom and decorate it to your tastes. From scales to shower caddies, you'll find everything you need to make your bathroom as useful as possible for every member of your family. Looking for a wide selection of bathroom supplies and accessories to jazz up your decor? Add a new shower curtain, a bath rug, or coordinated bath linens to your bathroom to give it a new look and feel. We pride ourselves on offering a wide range of colors and styles to help you achieve the look you want, whether that be sophisticated or whimsical. Extend the utility of your bathroom by choosing from our selection of scales, or change out your showerhead for one that has the extra features you need. Wastebaskets, handheld showers, shower treads, drain stoppers, and plungers are other bathroom supplies that can help you make the most out of this often-overlooked room. You can also find bath fixtures in brass, bronze, chrome, nickel and other materials. If your bathroom is in need of better organization, we offer shower caddies, bathroom shelves, soap dispensers, towel racks, medicine cabinets and cosmetic organizers to help you create a place for everything. These products can help you get organized, so you can find what you need quickly and easily while in the bathroom. You and your family spend countless hours in the bathroom, so choose bathroom supplies and accessories that will make your time spent there as enjoyable and useful as possible. With the wide range of bathroom supplies available at Amazon.com, you are sure to find just the right products for all of your bathroom needs.", "parent_text": "Home, Garden, Tools", "keyword_density": {"bathroom": "5.6", "amazoncom": "0.7", "bathroom supplies": "3.9"}, "department_id": 152},
