{"department_text": "Vacuums & Floor Care", "nr_products": "68723", "level": 1, "url": "http://www.amazon.com/s/ref=lp_1055398_nr_n_10?rh=n%3A1055398%2Cn%3A%211063498%2Cn%3A510106&bbn=1063498&ie=UTF8&qid=1394033734&rnid=1063498", "text": "Vacuums & Floor Care", "department_url": "http://www.amazon.com/s/ref=lp_1055398_nr_n_10?rh=n%3A1055398%2Cn%3A%211063498%2Cn%3A510106&bbn=1063498&ie=UTF8&qid=1394033734&rnid=1063498", "description_title": "Vacuum Cleaners from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "keyword_count": {"cleaners": 5, "amazoncom": 2, "vacuum cleaners": 4, "vacuum": 9}, "description_wc": 301, "description_text": "Whether you're in the middle of spring-cleaning or just tidying up after a long day, a good vacuum cleaner can quickly and efficiently remove dirt and debris from your floor, resulting in a clean, fresh look. At Amazon.com, you can find a wide selection of vacuum cleaners available for sale. There are multiple models to choose from, enabling you to pick the vacuum type that best suits your needs. Picking a vacuum for everyday use is easy with the number of choices available in both upright and canister models. For both model types, you can choose between bagged or bagless versions, depending on how you wish to handle the dirt and debris removed from your carpeting. Famous manufacturers, including Hoover, Dirt Devil, Bissell and Electrolux, offer each model type. Different versions of the models are available for purchase, with the primary differences between models being the types of attachments available and the suction strength. Lightweight vacuum cleaners are also available from many manufacturers. These lightweight cleaners allow you to quickly clean a lightly soiled area. Versions of lightweight vacuums include stick vacs, hand vacs and electric brooms for use on hard surfaces like hardwood floors or tiles. For deeper cleaning, Amazon.com has carpet-cleaning machines available that can handle ground-in dirt. There're even a few robotic vacuum cleaners to do the work of cleaning your carpets and floors automatically. We offer many cleaning product options to ensure you'll be able to find the vacuum cleaner that provides you with the best results for your floors. Cleaning your carpets and hardwood and tile floors doesn't have to be a long, drawn-out process. With the selection of vacuum cleaners available, you'll be able to keep your floors tidy while expending as little energy as possible.", "parent_text": "Home, Garden, Tools", "keyword_density": {"cleaners": "1.7", "amazoncom": "0.7", "vacuum": "3.0", "vacuum cleaners": "2.7"}, "department_id": 159},
