{"department_text": "Furniture", "nr_products": "467126", "level": 1, "url": "http://www.amazon.com/s/ref=lp_1055398_nr_n_4?rh=n%3A1055398%2Cn%3A%211063498%2Cn%3A1063306&bbn=1063498&ie=UTF8&qid=1394033734&rnid=1063498", "text": "Furniture", "department_url": "http://www.amazon.com/s/ref=lp_1055398_nr_n_4?rh=n%3A1055398%2Cn%3A%211063498%2Cn%3A1063306&bbn=1063498&ie=UTF8&qid=1394033734&rnid=1063498", "description_title": "Home Furniture from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "keyword_count": {"home furniture": 5, "amazoncom": 2, "home furniture from amazoncom": 1, "furniture": 11, "home": 9}, "description_wc": 301, "description_text": "Your home is a place where many of your life's major events happen. From your child's first steps to the first time you throw a birthday party, your life happens here. Home furniture is an integral part of the design and feeling of your home, so check out our home furniture on Amazon.com. We have many types of home furniture that you can choose from in our Furniture Store. This store has items including dressers for the bedroom; headboards for twin-, full-, queen-, or king-sized beds; rugs that add to your room's decoration; and more. Whether you are looking for a place to sleep or a comfortable seat for watching movies in, our Furniture Store has it all. You can even find storage ottomans and TV mounts to keep your electronics hanging on the wall. There are many different parts to our home furniture section. You can search by brand names, which include Sleep Innovations, Skyline, Southern Enterprises, and Steelcase, or you can search by the type of furniture you want, including coffee tables, couches, and ottomans. The section is also separated into areas of the home, so you can easily find what you're looking for. You can click through to any section to find a variety of options, from hardwood chairs to microfiber cushions. If you're looking for dining chairs, check out our Dining Room Furniture Store. There are dining chairs, bar stools, and more that you can look through. For bedroom furniture, you can visit out Bedroom Furniture Store. This section has items such as vanities, nightstands, bed frames, and more that will make your bedroom a comfortable place to relax and sleep. Your home is part of your life every day, so customize it with home furniture from Amazon.com.", "parent_text": "Home, Garden, Tools", "keyword_density": {"home": "3.0", "home furniture": "3.4", "amazoncom": "0.7", "home furniture from amazoncom": "1.3", "furniture": "3.7"}, "department_id": 153},
