{"department_text": "Home D\u00e9cor", "nr_products": "33196", "level": 0, "url": "http://www.amazon.com/s/ref=lp_1063278_nr_n_9?rh=n%3A1055398%2Cn%3A%211063498%2Cn%3A1063278%2Cn%3A1063284&bbn=1063278&ie=UTF8&qid=1394033740&rnid=1063278", "text": "Fireplaces & Accessories", "department_url": "http://www.amazon.com/s/ref=lp_1055398_nr_n_5?rh=n%3A1055398%2Cn%3A%211063498%2Cn%3A1063278&bbn=1063498&ie=UTF8&qid=1394033734&rnid=1063498", "description_title": "Fireplaces from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_1055398_nr_n_5?rh=n%3A1055398%2Cn%3A%211063498%2Cn%3A1063278&bbn=1063498&ie=UTF8&qid=1394033734&rnid=1063498", "keyword_count": {"fireplaces": 7, "fireplaces from amazoncom": 1}, "description_wc": 335, "description_text": "It was on one fateful New Year\u2019s Eve in England that bassist Noel Redding invited American guitar legend Jimi Hendrix to his mother\u2019s house. The night was so cold, and the fire so warm, it inspired Jimi to write his hit \u201cFire\u201d. Let the fireplaces from Amazon.com inspire you on the coldest nights. Classic wood burning fireplaces give your home a traditional feeling and a wonderful smell. Our fireplace surrounds make sure you can tailor the look of your fireplace to fit your home\u2019s d\u00e9cor, whether you want to add a rustic cabin-style atmosphere, or one of luxury and grace. Our gas fireplaces look authentic, but since they do not make ash or cinders, they can be a cleaner and safer alternative to traditional fireplaces. We make it easy for you to search fireplaces by letting you filter by price, so you can easily stay within your budget. Our outdoor and portable fireplaces make it easy to stay toasty even outside. If you are hosting a barbeque, a pool party or just having a few friends over for a drink on the patio, do not let the conversation freeze up. You will be glad you have these sturdy outdoor units to keep you warm while the beautiful exterior keeps your guests talking. We have a variety of shipping options, so if you need your order quickly to ensure your guests are not left out in the cold, we have you covered. It can be tough to remember all the fireplace accessories you need when you go out shopping. That\u2019s why we also offer kindling, Zippos, logs, and more to light your fire and keep it burning strong. Our magnesium fire starters fit great on key chains, and come in handy when camping or just lighting up a log. We have only one burning desire: to offer you the best and most affordable fireplaces possible. Once you write your legendary musical hit, just remember who helped light your fire.", "parent_text": "Home D\u00e9cor", "keyword_density": {"fireplaces from amazoncom": "0.9", "fireplaces": "2.1"}, "department_id": 154},
{"nr_products": "456", "level": 0, "url": "http://www.amazon.com/s/ref=sr_nr_n_3?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A172623%2Cn%3A172632&bbn=172623&ie=UTF8&qid=1394033740&rnid=172623", "text": "Microcassette Recorders", "department_url": "http://www.amazon.com/s/ref=sr_nr_n_9?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A172623&bbn=493964&ie=UTF8&qid=1394033734&rnid=493964", "description_wc": 0, "parent_url": "http://www.amazon.com/s/ref=sr_nr_n_9?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A172623&bbn=493964&ie=UTF8&qid=1394033734&rnid=493964", "parent_text": "Portable Audio & Video", "department_text": "Portable Audio & Video", "department_id": 171},
{"department_text": "Home Audio", "nr_products": "357", "level": 0, "url": "http://www.amazon.com/s/ref=lp_667846011_nr_n_4?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A667846011%2Cn%3A322215011&bbn=667846011&ie=UTF8&qid=1394033741&rnid=667846011", "text": "Multiroom Digital Music Systems", "department_url": "http://www.amazon.com/s/ref=sr_nr_n_7?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A667846011&bbn=493964&ie=UTF8&qid=1394033734&rnid=493964", "description_title": "Music Streaming from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=sr_nr_n_7?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A667846011&bbn=493964&ie=UTF8&qid=1394033734&rnid=493964", "keyword_count": {"streaming": 7, "music streaming": 6, "music": 12, "amazoncom": 1}, "description_wc": 322, "description_text": "When you are shopping for a multiroom music system, what music streaming device you choose makes a large impact on the quality of your listening experience. Whether you want a wireless model, Bluetooth capabilities, or a music-streaming player small enough to carry with you, you can use our site's convenient search and filter options to browse through our catalog and find a device that fits your needs and your budget. We have a variety of music streaming players that have built-in Wi-Fi, giving you the freedom to take your music with you wherever there is a wireless Internet connection. We also have a wide selection of Bluetooth-enabled devices, from full stereo systems to compact devices designed for areas with limited space. Whether you are looking for a weather-resistant outdoor speaker system, a video and music streaming box that includes a remote and keyboard, or an all-in-one player with integrated speakers that lets you play different tracks in different rooms of your home, you can browse, search, and select music streaming equipment from top brands like Roku, Apple, Sonos, Netgear, Sling Media, and more. We also offer media streaming devices, including projectors and tuners that feature a variety of convenient functions, including alarms, AM/FM and HD radio capabilities, and LCD displays. If you are looking for equipment that has modern functionality but vintage-appeal, we have options featuring classic finishes designed to mimic the wood construction of old-school music players. Your personality and style should be reflected in your music-streaming player, which gives you all of the modern conveniences of digital music. Whether you want a device for personal listening or want to play music through your entire house, you can shop for the audiophile in your life, all from the comfort of your own home. Amazon.com has what you need to bring music to every area in your home and yard.", "parent_text": "Home Audio", "keyword_density": {"streaming": "2.2", "music streaming": "3.7", "music": "3.7", "amazoncom": "0.3"}, "department_id": 169},
{"department_text": "Home Audio", "nr_products": "1758", "level": 0, "url": "http://www.amazon.com/s/ref=lp_667846011_nr_n_5?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A667846011%2Cn%3A172521&bbn=667846011&ie=UTF8&qid=1394033741&rnid=667846011", "text": "Portable DVD Players", "department_url": "http://www.amazon.com/s/ref=sr_nr_n_7?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A667846011&bbn=493964&ie=UTF8&qid=1394033734&rnid=493964", "description_title": "Portable DVD Players from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=sr_nr_n_7?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A667846011&bbn=493964&ie=UTF8&qid=1394033734&rnid=493964", "keyword_count": {"amazoncom": 1, "portable dvd players": 4, "portable dvd": 8}, "description_wc": 322, "description_text": "Whether you travel often for work or are going on a trip for fun, bring a portable DVD player with you to pass the time while you're on a plane or a train. Bring your favorite movies along with you and watch them by yourself or with a friend. These portable DVD players come in a compact size that can fit nicely in your book bag or suitcase. When searching for the best portable DVD player, you'll find devices from Sony, Sylvania, and Phillips that come with screens anywhere from seven to nine inches in size. The best of these portable DVD players feature a high definition screen that'll bring out a high-quality picture from your disc. With your portable DVD player, you can watch you movie on your lap or at a desk. While at home, the player is small enough to fit nicely on your desk or shelf. Some of the devices even have a USB port so you can transfer music or video files onto the player from your computer. You'll also find portable DVD players with a swivel design that lets you move the device's screen to face you. It's great for when you want to view a movie without anyone else seeing what you're watching. There's also a jack on the side so you can plug in your headphones and view your movie or TV show without bothering those around you. Some portable DVD players even have audio options, allowing you to customize the sound settings on your device. After you've found the right portable DVD player for you, make your order right here on Amazon.com. You'll find plenty of shipping options that'll get your device to your home within a few days. Once you have it, you'll be set to entertain yourself on that long flight or train ride for work or play.", "parent_text": "Home Audio", "keyword_density": {"amazoncom": "0.3", "portable dvd players": "3.7", "portable dvd": "5.0"}, "department_id": 169},
