{"department_text": "Portable Audio & Video", "nr_products": "1261", "level": 0, "url": "http://www.amazon.com/s/ref=sr_nr_n_0?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A172623%2Cn%3A172633&bbn=172623&ie=UTF8&qid=1394033740&rnid=172623", "text": "Boomboxes", "department_url": "http://www.amazon.com/s/ref=sr_nr_n_9?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A172623&bbn=493964&ie=UTF8&qid=1394033734&rnid=493964", "description_title": "Boomboxes from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=sr_nr_n_9?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A172623&bbn=493964&ie=UTF8&qid=1394033734&rnid=493964", "keyword_count": {"boomboxes": 4}, "description_wc": 305, "description_text": "Today's boomboxes have come a long way from the heavy over-the-shoulder models popular in '80s music videos. What started out as a boombox designed to amplify sound and give your music a wider listening range has turned into sophisticated electronic equipment that lets you play music from your smartphone, the radio, your iPod, and cassette tapes. Whether you are looking for larger cabinet-style boomboxes or their more convenient portable counterparts, we have it all from the best-known brands in the industry, including Sony, Grace Digital, Logitech, Coby, and Naxa. Our portable models let you play your CDs and MP3s and listen to the radio no matter where you are. If you want even more out of your listening experience, try a portable radio with an LCD screen, letting you add a visual element to your tracks. Many modern boomboxes come with a variety of special features including remote controls, USB inputs, AM/FM tuners, and mega basses to take your music to the next level. You can use the site's convenient search and filter features to narrow down the options to the boomboxes that have exactly what you want. Your boombox doesn't have to be just about playing music. Choose from a wide range or style and color options to match your equipment to your personality, style, and purpose. There are even those designed specifically for kids that stand up to normal wear and tear and feature characters from shows like Yo Gabba Gabba and Hello Kitty. Whether you just need a speaker to boost your iPod's sound, want a boombox you can easily carry from place to place, or are looking for a top of the line model for your living space, our catalog has just what you need at the price you are looking for.", "parent_text": "Portable Audio & Video", "keyword_density": {"boomboxes": "1.3"}, "department_id": 171},
